 ('49', '53', 'no', NULL, '<p>En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus p menneskene som maten, bndene og dyrene, med kjtt og fisk tilberedt i samme ml, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbrd, andebryst, stekte torskehoder og rabarbraslush.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-09-21 09:53:14', '2018-08-15 10:02:31', '2ebc9917-f496-4e8d-b92d-1c3cb1e347fc'),
