 ('76', '83', 'no', 'Forvandlingen p Lilleby ', NULL, NULL, NULL, 'left', NULL, '<p>Credo er en rvare-drevet restaurant som pnet i Credoveita i Trondheim i 1998. Februar 2018 gjenpner vi p Lilleby i nye lokaler.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Forvandlingen p\\u00e5 Lilleby \",\"seoDescription\":\"Credo er en r\\u00e5vare-drevet restaurant som \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler.\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"81\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Forvandlingen p\\u00e5 Lilleby \",\"seoDescriptionUnparsed\":\"Credo er en r\\u00e5vare-drevet restaurant som \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. \",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 11:58:11', '2018-08-15 09:45:19', 'a706520c-86e5-472e-b4ee-506f8bac0782'),
 ('77', '84', 'no', NULL, '<p>Credo nsker  ta deg gjennom flerfoldige smaker, teksturer og flelser. Vi nsker  vise deg grdene vre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p  finne rvarer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p det mest interessante og beste vi fr levert, fra dag til dag. Vi setter ogs sammen en drikkemeny som p beste mulige mte komplementerer og lfter frem hver enkelt rett. Har du spesielle nsker kan du gjerne bestille fra vr rikholdige vinkjeller bestende av flere tusen viner.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 11:58:11', '2018-08-15 09:45:19', '0b870d27-e0f3-4498-8f79-b9d0e6d9000a'),
 ('78', '85', 'no', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 11:58:11', '2018-08-15 09:45:06', 'cd7c4415-3752-4c06-a70f-8b644dbb1812'),
 ('79', '86', 'no', NULL, '<p>Credo nsker  ta deg gjennom flerfoldige smaker, teksturer og flelser. Vi nsker  vise deg grdene vre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p  finne rvarer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p det mest interessante og beste vi fr levert, fra dag til dag. Vi setter ogs sammen en drikkemeny som p beste mulige mte komplementerer og lfter frem hver enkelt rett. Har du spesielle nsker kan du gjerne bestille fra vr rikholdige vinkjeller bestende av flere tusen viner.</p>', 'En liten mellomtittel', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 12:04:13', '2018-08-15 09:45:19', '0bb4e9af-f54f-4d8b-9c07-a27f0e5bd311'),
 ('80', '87', 'no', NULL, '<p>Rvarene er motivasjonen vr. Hvorfor skulle vi ellers betale 260 kroner per kilo smr? Med rent hndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, p gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, mnen, sjen, kroppen.<br /></p>', 'Vegen videre', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 12:04:13', '2018-08-15 09:45:19', '7fe950f0-2a3c-4b9d-afa8-f0db8766ad8c'),
 ('81', '88', 'no', 'B5 A6477', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 12:05:02', '2018-08-15 13:24:55', 'a6f1ebcd-6573-44c1-bffc-f318146d3d22'),
