 ('83', '90', 'no', 'Skjlberg Sndre, Svorkmo', NULL, NULL, NULL, 'left', NULL, '<p>Grnnsaker og andre spiselige vekster, and, andeegg, kjtt av \"utegris\", storfe, lam og ferskmelk.\n  </p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"seoDescription\":\"Vegetables and other edible growths, duck eggs, duck meat, pork and fresh milk.\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"98\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"seoDescriptionUnparsed\":\"Skj\\u00f8lberg S\\u00f8ndre er en biodynamisk kretsl\\u00f8psg\\u00e5rd som drives av Elin \\u00d6stlund og Carl Erik Skj\\u00f8lberg.\\u00a0\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 12:08:02', '2018-09-08 14:12:06', '57dba44c-5d7b-4def-98d6-e6024ba70c9f'),
 ('84', '91', 'no', NULL, '<p>Det er grnt overalt, vanligvis skeptiske og dystre byfolk blir overrasket nr de kommer hit og ser alt det som gror i skrningen p Svorkmo.</p>\n<p>Bakken ligger i Orkdal, inntil n mest kjent for sin elv som deler sitt navn med den strste produsenten av bearbeidede matvarer i Norge.\n  </p>\n<p>Grunnen til at dette grnne paradiset finnes er p grunn av Elin og Carl Erik stlunds utrettelige arbeid og ren viljestyrke.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 12:08:02', '2018-09-08 14:12:06', 'c2c70baf-c490-4313-a423-2bced97e1a82'),
