 ('95', '102', 'no', NULL, '<p>P Credo skal du f mat laget p rvarer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert p mter der smak og brekraft er viktige elementer.<br /></p>', 'Credos hjerte ligger der rvarene produseres.', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 12:34:47', '2018-09-13 09:59:16', '927c9b8d-ba62-4b17-874f-1a5c0fddb000'),
 ('97', '104', 'no', NULL, '<p>P Credo er vi underordnet den opprinnelig smak, smakene som er stedsbestemt. Vi trenger tilgang p de beste rvarene, ogderfor leter vi etter smaker, smaken som kommer fra en grd, en grdbruker eller et jordsmonn, fordet er de sm forskjellene som gir de gode rvarene.</p>\n<p>Credo nsker  ta deg gjennom flerfoldige smaker, teksturer og flelser. Vi nsker  vise deg grdene vre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p  finne rvarer som best viser egenskapene til tiden vi er i og til stedet vi er, og dermed ermenyen basert p det mest interessante og beste vi fr levert, fra dag til dag.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 12:34:47', '2018-09-13 09:59:16', '488467dd-66d3-4bef-a537-36ccfdc14acb'),
 ('99', '106', 'no', NULL, '<p>Med nr kontakt til produsentene vre og med en etisk tilnrming til det vi gjr, sker vi kontinuerlig utvikling mot brekraft, da vitror p at det gjenspeiler seg i smak.Rvarene er motivasjonen, ogmed rent hndverk kan vi utfolde oss med en oppmerksomhet rettet utad. Vi tror at enhver komponent er gjeldende - dyrene, skogen, jorden, mnen, sjen og kroppen.</p>\n<p>P Credo feirer vi dette mangfoldet. Vi feirer hydementer, tke, sol og regn i strre og mindre mengder. P Credo feirer vi smaken av stedet.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 12:34:47', '2018-09-13 09:59:16', '8d1bd7b7-570d-4b39-a10a-dd51cbc44a9a'),
 ('102', '109', 'no', 'B5 A7193', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 12:37:22', '2018-08-15 13:25:09', '4ee8e850-f2df-4038-b2a3-a3312bf31a1e'),
