 ('134', '141', 'no', 'Jossa til Peru', NULL, NULL, NULL, 'left', NULL, '<p>P midten av 1900-tallet bodde det en nysgjerrig, ujlete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne nrmest, hadde hun en umettelig utfartstrang i verden. <em>Hva trigget henne?</em> Vi tror det var jakten p de rene smakene. Og mat som ingen hun kjente hadde hrt om fr. Rettene mtte ha jordnr betydning for  smake det lille ekstra, i flge Jossa.<br /></p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa til Peru\",\"seoDescription\":\"P\\u00e5 midten av 1900-tallet bodde det en nysgjerrig, uj\\u00e5lete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne n\\u00e6rmest, hadde\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"197\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"P\\u00e5 tur til Peru\",\"seoDescriptionUnparsed\":\"P\\u00e5 midten av 1900-tallet bodde det en nysgjerrig, uj\\u00e5lete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne n\\u00e6rmest, hadde\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custo