 ('137', '144', 'no', NULL, '', 'Jossa mat og drikke', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 15:21:00', '2019-08-14 19:06:41', '12e1e277-db19-4ac4-ba3c-1d4e411ce054'),
 ('138', '145', 'no', NULL, '<p>P midten av 1900-tallet bodde det en nysgjerrig, ujlete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne nrmest, hadde hun en umettelig utfartstrang i verden.<em>Hva trigget henne?</em>Vi tror det var jakten p de rene smakene. Og mat som ingen hun kjente hadde hrt om fr. Rettene mtte ha jordnr betydning for  smake det lille ekstra, i flge Jossa. Hun nsket  forst seg p verden gjennom mat. Vi er derfor veldig glad og takknemlig for  f fortsette historiene hennes videre, gjennom Jossa mat og drikke.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2017-12-15 15:21:00', '2019-08-14 19:06:41', '9edebf16-7fc4-4bae-9d57-39b8ddd5b09c'),
