 ('161', '171', 'no', 'Heidi Bjerkan', NULL, NULL, NULL, 'left', NULL, '<p>Heidi Bjerkan er en norsk kokk og kjkkensjef. I dag driver hun mat-triangelen Credo Restaurant, Jossa mat og drikke og Finnes Kaf p Lilleby, Trondheim.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Heidi Bjerkan\",\"seoDescription\":\"Heidi Bjerkan is a Norwegian chef, our chef de cuisine and owner of Credo. Now she is running the food-triangle Credo Restaurant, Jossa mat og drikke and Finnes\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"174\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Heidi\",\"seoDescriptionUnparsed\":\"Heidi Bjerkan er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 11:28:00', '2019-08-14 15:57:39', 'a2721b91-a4b7-446e-a419-234238b9d7f6'),
 ('162', '172', 'no', NULL, '<p>Heidi vokste opp i Trondheim og i bten til bestefaren p Garten langs Trndelagskysten. Her knyttet hun sterke bnd til jord og vann, som siden er  se i hennes matlaging.</p>\n<p>Bjerkan sin karriere innenfor kokkeyrket startet allerede somattenring da hun begynte sin sommerjobbp stbanekafeen. Der forstod hun rasktat hunville jobbe med mat. Det hye tempoet et kjkken innebrer var til stor begeistring for Bjerkan, som er rastls av natur.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 11:28:00', '2019-08-14 15:57:39', 'a531715c-77e3-442e-be2a-2f81ed4ba2bc'),
