 ('179', '189', 'no', 'Jossa til sterrike', NULL, NULL, NULL, 'left', NULL, '<p>Jossa str p stasjonen med sekken full av tjrepastiller og kandisert angelicastang, en god porsjon med isterban, en falukorv og en limpa.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa til \\u00d8sterrike\",\"seoDescription\":\"Jossa st\\u00e5r p\\u00e5 stasjonen med sekken full av tj\\u00e6repastiller og kandisert angelicastang, en god porsjon med isterban, en falukorv og en limpa.\\u00a0\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"188\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Jossa til \\u00d8sterike\",\"seoDescriptionUnparsed\":\"Jossa st\\u00e5r p\\u00e5 stasjonen med sekken full av tj\\u00e6repastiller og kandisert angelicastang, en god porsjon med isterban, en falukorv og en limpa.\\u00a0\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 14:07:06', '2018-08-15 11:52:58', '55ceb305-c99d-460f-90f7-de22cc109778'),
 ('180', '190', 'no', NULL, '<p>Tobias har sagt farvel for kort tid siden. Han takket for selskapet, ga henne en god klem og trykket en gave ned i sekken.  Du m ikke pne den pakken fr du er fremme. Tobias s p Jossa og smilte.\n God tur, og hils til Werner.</p>\n<p>Jossa klatrer om bord i toget og finner kupeen sin. Nattoget til malm, en behagelig mte  reise p, og fra Malm er det ikke langt til kontinentet. Hun bryter av skalken p brdet og legger seg p den oppredde senga. Fttene er mre etter all vandringen.Hun forsvinner inn i svnen samtidig med togets startende bevegelser. Som et barn blir hun dysset i svn, fr hun selv hadde tenkt. Det er mrkt, varmt og behagelig.</p>\n<p>Det spraker i en hyttaler, plinger i en bjelle og det bankes p dren. Det fles som om det er samtidig, men hun tar det p oppvkingsfasen, at hun har duppet av mellom lydene, bare fortrengt det litt.\nMalm, den kom raskere enn hun trodde, hele byen ligger der, foran henne, flat som den er.\nHun har brstet av seg smulene fra brdskalken, skiftet, tatt en kattevask og prvd  legge hret stramt slik det smmer seg, fr hun gikk av toget.</p>\n<p>Bten venter, bten til kontinentet str i havna, noen hundre meter bortenfor stasjonen.\nFra Kbenhavn ble det tog til wien, med bytte i mnchen, Jossa var utmattet men merket seg at Kbenhavn var en by hun skulle utforske, men da p vei hjem.</p>\n<p>Brosteinen og kumlokkene, de er fine. Jossa ser ned mens hun tusler ut av stasjonsbygget i Wien.\nMen jeg er sulten. Sier hun hyt til seg selv, s den dsige mannen som sto rett ved siden av i sin egen verden skvetter til og ser p henne.\n unnskyld, sier han.\nh, nei  det var ikke meningen, men jeg er bare litt sulten. Eller hvis jeg skal si det som sant er, jeg er skrubbsulten.\nHun hadde helt glemt  spise, helt glemt at hun var sulten nr hun lp fra bt til tog i Kbenhavn, og i Mnchen ble det akkurat tid nok til en plse med sauerkraut.\nHaha! Mannen smiler til, det glimter i gull bakerst i munnen\n Du har kommet til rett sted. Kom bli med meg.\n-Unnskyld, jeg glemte meg helt bort. Hvor er mine manerer, uff , Werner heter jeg frken. Han strekker ut en hnd. Jossa griper den og kjenner det faste hndtrykket. Jossa sier hun, og smiler.</p>\n<p>De nrmest smlper innover byen. Jossa klarer ikke f med seg noe, hun tenker bare p mat.\n Hva skal du her i Wien ?\n Jeg skal spise, jeg vil smake det som er sterisk. Det er det som er reisen min skjnner du, jeg vil finne ut av hva ting smaker p forskjellige steder.\nWerner stopper litt, mens han tenker.\n S du vil smake det som er mest Wiensk, ok, men da tar vi til hyre her.\nDu skal f Sptzle, og det er best p et bitte lite sted rett her borte.</p>\n<p>De smlper videre, litt uten grunn, men drevet av sult og nysgjerrighet.Sptzle, en slags urpasta, eller gnocchi, eller en blanding av de begge.Nr Werner forteller om smaken, den smeltede osten og ikke minst vinen som skal drikkes til gr det nesten rundt for Jossa.</p>\n<p>Endelig skal hun f mat.\nWerner dumper ned i stolen ved siden av henne.\n Snn, vin og mat p vei. Du er skikkelig sulten ? Jossa klarer knapt  ytre ja, hun venter bare p noe  spise.\n Jeg bestillte litt forskjellig, s du skal f et raskt overblikk, det blir kanskje litt mye. Men det kommer noen andre venner av meg ogs, som kan mer om vin, s da spiser han det vi ikke klarer. Ok? Werner har tatt kommandoen og ser ut til  kose seg i rollen som vertskap.  Grillet kalvetunge med syltede grnnsaker, Sptzle med sopp og ost, Gresskarsuppe med krepse-dumplings, Plse med sauerkraut, Snitzel med potetsalat og sitron, Rye med kl, og til dessert fr du Schwartswaldkake med kirsebr ogs kan du ikke unng strudelen da. Den m du smake nr du er i Wien .\nJossa rister p hodet og ler.\n Jeg klarer jo ikke alt sammen, det er jo umulig.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 14:07:06', '2018-08-15 11:52:58', 'edbe0c19-5227-4dd1-b565-ebf9132274ca'),
