 ('185', '195', 'no', 'Jossa p hjemmebane', NULL, NULL, NULL, 'left', NULL, '<p>Jossa ser utover Ripa p den store bten. Hun tar dype trekk av den friske lufta, helt inn. Det er som om lungene har lengtet etter den kjlige fuktige lufta.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa p\\u00e5 hjemmebane\",\"seoDescription\":\"Jossa ser utover Ripa p\\u00e5 den store b\\u00e5ten. Hun tar dype trekk av den friske lufta, helt inn. Det er som om lungene har lengtet etter den kj\\u00f8lige fuktige\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"194\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Jossa p\\u00e5 hjemmebane\",\"seoDescriptionUnparsed\":\"Jossa ser utover Ripa p\\u00e5 den store b\\u00e5ten. Hun tar dype trekk av den friske lufta, helt inn. Det er som om lungene har lengtet etter den kj\\u00f8lige fuktige\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 14:10:01', '2018-08-15 09:40:35', 'dec9e3cf-5b77-43fb-ab68-93fee0efdea9'),
 ('186', '196', 'no', NULL, '<p>Hun ser havnen i det fjerne, og tusler ned i kahytten.<br /> Hjem. Jeg skal hjem en liten tur, hun smiler til seg selv og tenker p hvordan hun plutselig savnet sild. Og akevitt.</p>\n<p>Det har vrt en lang reise siden hun var i Bangkok, eller lille bangkokk da, gjemt inne i chinatown i london. Der hun fikk noen nye smaker, som aldri hadde vrt innom Trondheim, fr n. Hun klapper p kofferten som er breddfull av urter, rtter, krydder og oppskrifter hun tar med seg hjem.<br />Men nam prik pao til side, selv om det kanskje er det beste hun hadde smakt, p alt, hun er klar for sild. Og for svinekjtt. Hun har tenkt mye p hvordan svinekjttet fra nettopp trndelag vil passe til alle de thailandske smakene, som et avbrekk fra all julematen. Friskt, sterkt, morsomt.</p>\n<p>Men n er det rmme som str i hodet. Rmme p vaffel, med lyrom. Og riskrem. Jossa klarer nesten ikke st stille hun tripper opp og ned dekk mens de legger landgangen klar.</p>\n<p>Hjemme, nrmest roper hun nr hun treffer brygga med foten.</p>\n<p>N skal det bli godt med gravet fisk.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 14:10:01', '2018-08-15 09:40:35', '44304869-abe8-415e-846f-222d24bfe632'),
