 ('204', '214', 'no', 'Jossa til Thailand & Laos', NULL, NULL, NULL, 'left', NULL, '<p>Vel tilbake fra Mexico ble ikke lysten p eventyr mettet for Jossa.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa til Thailand & Laos\",\"seoDescription\":\"Vel tilbake fra Mexico ble ikke lysten p\\u00e5 eventyr mettet for Jossa.\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"213\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Jossa p\\u00e5 vei til Thailand & Laos\",\"seoDescriptionUnparsed\":\"Vel tilbake fra Mexico ble ikke lysten p\\u00e5 eventyr mettet for Jossa.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 15:51:49', '2018-08-15 09:39:21', 'e878825a-3280-4c17-860f-2d8c57a5fae0'),
 ('205', '215', 'no', NULL, '<p>Koffertene er ikke ferdig utpakket fr at utstyret pakkes ned igjen og nye reiseml str for tur, for savnet etter de friske urtene, sterke kryddrene og de lekne smakene frer Jossa til big Thailand og Laos!</p>\n<p>Nam prik pao, pad thai og gaeng phed ped yang er bare noen av rettene som str p smaksagendaen for reisen, og Jossa fr vann i munnen av tanken.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 15:51:49', '2018-08-15 09:39:21', '71d5a0ab-e866-4a6d-841c-ba7b5dffaeea'),
