 ('207', '217', 'no', 'Grnne omgivelser ', NULL, NULL, NULL, 'left', NULL, '<p>Vel i hus p Finnes Kaf s blomstrer det for fullt i parsellhagen p Lilleby.<br /></p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Gr\\u00f8nne omgivelser \",\"seoDescription\":\"Vel i hus p\\u00e5 Finnes Kaf\\u00e9 s\\u00e5 blomstrer det for fullt i parsellhagen p\\u00e5 Lilleby.\\u00a0\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"216\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Gr\\u00f8nne omgivelser \",\"seoDescriptionUnparsed\":\"Vel i hus p\\u00e5 Finnes Kaf\\u00e9 s\\u00e5 blomstrer det for fullt i parsellhagen p\\u00e5 Lilleby.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 15:56:35', '2018-08-15 09:38:46', '7198c92c-98b9-45b9-8f78-67f9e74af6b7'),
 ('208', '218', 'no', NULL, '<p>Friske urter, nydelige blomster og nyttevekster som folk flest bare kan drmme om er lett tilgjengelig like utenfor dra  For en LUKSUS!</p>\n<p>Lilleby Hagelag, i samarbeid med kretslpsgrden Skjlberg Sndre holder hagen i sjakk, og til vr fornyelse srger de for friske og grnne omgivelser rundt Finnes Kaf, Jossa mat &amp; drikke og Credo Restaurant.</p>\n<p>Alle som nsker kan bli med i Lilleby Hagelag, og for mer informasjon, ta kontakt p <a href=\"mailto:post@lillebyhagelag.no\">post@lillebyhagelag.no</a></p>\n<p>\n  </p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 15:56:35', '2018-08-15 09:38:46', 'a82265bc-f0ba-4582-a293-5ca4af7ea097'),
