 ('212', '222', 'no', 'Finnes bakeri', NULL, NULL, NULL, 'left', NULL, '<p>Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Brd Surdeigsbakeri* startet vi opp et lite hndtverksbakeri p Finnes Kaf i September 2017.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Finnes bakeri\",\"seoDescription\":\"Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Br\\u00f8d Surdeigsbakeri* startet vi opp et lite h\\u00e5ndtverksbakeri p\\u00e5 Finnes\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"221\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Finnes bakeri\",\"seoDescriptionUnparsed\":\"Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Br\\u00f8d Surdeigsbakeri* startet vi opp et lite h\\u00e5ndtverksbakeri p\\u00e5 Finnes\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 16:00:53', '2018-08-15 09:37:58', 'fe54a911-edb8-4a0e-9801-5d6a473c21a8'),
 ('213', '223', 'no', NULL, '<p>Bakeriet har fokus p naturlig hevet brd  SURDEIGSBRD  og brdene er utelukkende laget p norsk mel og kornarter. Spelt, Havre, Emmer, og rkt bygg er bare noen alternativer som er  f p kafeen.</p>\n<p>*Ille Brd Surdeigsbakeri (<a href=\"https://www.facebook.com/illebrod/)\">https://www.facebook.com/illebrod/)</a> er et surdeigsbakeri lokalisert i Oslo. De lager naturlig hevet brd og tar utelukkende i bruk lokalt dyrket mel og urkorn. Bakeriet holder til i Lakkegata 53, Oslo, og vi anbefaler hele Oslos befolkning, og alle tilreisende  ta turen innom bakeriet for en smak av byens beste brd!</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 16:00:53', '2018-08-15 09:37:58', '0d118a6f-b1a7-4e2c-a688-2acba0df9d68'),
