 ('216', '226', 'no', 'Fossan Brd', NULL, NULL, NULL, 'left', NULL, '<p>Fossan Mlle er en perle av mlleverk fra 1936 lokalisert i Skjelstadmarka i Trndelag.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Fossan Br\\u00f8d\",\"seoDescription\":\"Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.\\u00a0\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"224\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Fossan Br\\u00f8d\",\"seoDescriptionUnparsed\":\"Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 16:03:40', '2018-08-15 09:51:29', '6ff3d674-e5ba-471d-9293-9b4a23298d23'),
 ('217', '227', 'no', NULL, '<p>Den ble til da selve turbinen mllen bestr av, ble fraktet med jernbane til Hegra, ogderetter med hest og vogn opp til Skjelstadmarka. I dag driftes Fossan Mlle av Petter Fossan,og matmel blir fortsatt malt i denne gamle mlla. Finnes Kaf nsker  sette lys p denne gamle perlen, og til vr store begeistring fr vi oppdage melet i brdbaksten vr. Vi har utforsket med ulike melsorter fra Fossan Mlle, og eksperimentene har resultert i et eget Fossan Brd som er til salgs i kafeen!</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-01-10 16:03:40', '2018-08-15 09:37:36', '5556681b-f81b-44ae-8893-131a4837e437'),
