 ('418', '275', 'no', NULL, '<p>Det er flere enn f som har ristet p hodet av mten Elin og Carl Erik jobber p. Det er ikke mulig  dyrke de planter dere nsker her, ikke p den mten dere drmmer om uansett, sier de.\n  Elin og Carl Erik arbeider etter biodynamiske prinsipper, og for dem er jorden alt. Den m vre sunn og full av liv. P Skjlberg Sndre hadde ikke jorda vrt i drift p femten r, s de har over tid mtte pleie jordsmonnet tilbake til liv.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:05:46', '2018-09-08 14:12:06', '16005329-322c-4f6a-8ba1-ca536f551999'),
 ('419', '276', 'no', NULL, '<p>P Skjlberg Sndre produseres det blant annet rotgrnnsaker, kl og neper av ulike variasjoner, agurker, epleagurker, spiselige vekster og urter. P grden har de ogs den gamle kurasen \"Sidet Trnder\" og \"Gammel Norsk Splsau\". Dyrene lever i harmoni med grdens kretslpsfilosofi, og er en viktig bidragsyter til grdens kretslp.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:05:47', '2018-09-08 14:12:06', 'c2a56d5a-7e2b-4e3f-8092-362859e78755'),
 ('420', '277', 'no', NULL, '<p>Kompostering er ogs en stor del av kretslpet til grden, og alle grnnsaksrester fra Credo Restaurant blir omgjort til kompost i fraukjelleren p Skjlberg Sndre. Denne operasjonen er holistisk, og de beholder og gjenbruker s mye som overhodet mulig. I de senere r har de ogs begynt  dyrke mikrogrnt i jordkjelleren.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:05:47', '2018-09-08 14:12:06', '0a9a4660-476c-4750-8d84-c6a1191d07db'),
 ('421', '278', 'no', NULL, '<p>Mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale i Skjlberg Sndre sitt arbeid, og det plukke rene, rlige grnnsaker og urter med egne hender er et hydepunkt for oss som restaurant. Vi setter svrt stor pris p kunnskapen som Skjlberg Sndre viser oss om agro-kologisk jordbruk, og sammen pusher vi grensen for hva som er mulig  dyrke p Svorkmo<br /></p>\n<p><a href=\"http://www.skjolbergsondre.no/\">www.skjolbergsondre.no</a>\n  </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:05:47', '2018-09-08 14:12:06', '4ca17862-c500-45fe-8db6-8bf42a14caa0'),
 ('422', '279', 'no', 'B5 A2735 2', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:09:53', '2018-08-15 13:24:46', 'b152f098-57b4-4522-88a5-3bd4a6475de5'),
 ('423', '279', 'en', 'B5 A2735 2', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:09:53', '2018-08-14 15:09:53', '3532d220-0c0b-4212-afd5-d297b15985c1'),
 ('424', '280', 'no', 'B5 A2318', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:21:31', '2018-08-15 13:24:45', 'e1230db6-8ece-4ade-a0dd-572f8c5ba277'),
