 ('426', '281', 'no', 'B5 A3089 3', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:25:44', '2018-08-15 13:24:47', '99480fec-6011-471b-81ea-7a7cb7b68ff9'),
 ('427', '281', 'en', 'B5 A3089 3', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:25:44', '2018-08-14 15:25:44', 'f605b9db-7750-4e35-97f6-daf06325d365'),
 ('428', '282', 'no', 'B5 A3045', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:27:26', '2018-08-15 13:24:47', 'd284e943-3476-4aa9-acac-69711ee3d3f1'),
 ('429', '282', 'en', 'B5 A3045', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:27:26', '2018-08-14 15:27:26', '8fc2999c-a640-4d24-92b6-4b7ad65e065d'),
 ('430', '283', 'no', NULL, '<p>Jon Fredrik har syv kyr, den samme typen storfe som var vanlig i dette omrdet fr den mer produktive NRF (Norsk Rdt Fe) kom som resultat av modernisering. Sidet Trnder er ikke en veldig kjent kurase n om dagen, men hvis du forestiller deg en ku som er mindre enn en moderne ku, nesten p strrelse med en Grand Danoise, bare kraftigere, er du p rett spor. Disse kyrene, valgt bort tidlig under effektiviseringen av landbruket, produserer ikke den gjennomsnittlige 10.000 liter melk som NRF, de melker mer i de lave tresifrede tallene - men for Jon Fredrik er ikke dette et problem.</p>\n<p>-Det er ikke mengden vi ser etter, sier han med et smil.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:28:34', '2018-09-13 09:55:47', '2d0f494a-5288-4c51-b9ab-32172e6a7472'),
 ('431', '284', 'no', NULL, '<p>Tilbake til smrformen, som et objekt av vellyst, er det plassert p midten av bordet akkurat som noen man tilber. Smr har alltid vrt sentrum for oppmerksomheten, og gullfargen er bevis p verdien, verdien av melkefett. I mange r var smr den viktigste (og noen ganger eneste) inntekt for bnder. De solgte smret og beholdt skummetmelken og kjernemelken til eget bruk.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:28:34', '2018-09-13 09:55:47', '832db0c6-0c4d-428f-aa2c-2507a0d61c9b'),
 ('432', '285', 'no', NULL, '<p>Jon Fredrik leverer mesteparten av sin melk til Credo Restaurant, resten bruker han til sine gjester, ettersom Fannremsgrden har mange beskende som er interessert i tradisjonelt hndverk og grdskultur. Hus, holdt i stand akkurat slik hans besteforeldre hadde det, er fylt opp med flere kulturskatter enn gjennomsnittlig folkemuseum.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:28:34', '2018-09-13 09:55:47', '625ff046-0826-46ab-90ca-f9b0d33cb434'),
 ('433', '286', 'no', NULL, '<p>Fannremsgrden ligger i Orkanger, i et typisk indre klima. Jorden er basert p sand og moll, perfekte forhold for avlinger og gress. Og vret?<br />- Solen skinner alltid, nr jeg er hjemme, sier Jon Fredrik.</p>\n<p>I tillegg til \"Sidet Trnderfe\" som produserer melk, og etter etter livets lp, kjtt, har Jon Fredrik ogs hner for egg, og hester til fritid. Du kan beske han for  prve ut alle hans produkter, og kjpe tradisjonelle hndverksprodukter i den lille butikken. Smret alene er verdt turen. Men for  f den aller beste smaken av Jon Fredriks smr, lukk ynene dine og husk potetkaken servert hos oss p Credo.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:28:34', '2018-09-13 09:55:47', '029d292c-c037-412e-802a-365dfc189426'),
 ('434', '287', 'no', NULL, '<p>Bjerkan er omtalt som en hyt respektert kokk med en kompromissls, engasjert og grundig visjon om fruktbart land, rvarenes ubenyttede ressurser og framtidens bonde.</p>\n<p>Bjerkan har alltid vrt opptatt av  jobbe brekraftig, noe som gjenspeiler seg i kvaliteten Credo str for. Med sterk interesse og dedikert ansvar, har Bjerkan i senere tid rekonstruert og utvidet hvordan drive restaurant med et ideal om at nringen kan livsgi lokale bnder i et voksende kommersialisert landbruk. De tette samarbeidene med grdene Skjlberg Sndre og Fannremsgrden er eksempler p hvordan Credo nsker  bringe fram de lokale bndenes hndarbeid.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:49:53', '2019-08-14 15:57:39', '3f038009-d99c-4000-9bed-ac34a9283324'),
 ('435', '288', 'no', NULL, '<p>For Heidi er det bndene som er heltene, og det er produsentene som skal skinne. Gjennom mltidet p Credo tar hun med gjestenp hennes tur gjennom grdene, sjen og skogen der rvarene kommer fra.</p>\n<p>Heidi Bjerkan ble i 2015 kret til rets Kjkkensjef,fikk i 2017 bde Ingridprisen ogMatprisen for sitt engasjement for bedre mat og et bedre landbruk, og ble i 2019 kret til Kokkenes Kokk.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 15:49:53', '2019-08-14 15:57:39', '7ecc2583-e195-4947-93bd-6d3848b762d3'),
 ('436', '289', 'no', NULL, '<p>Det viktigste her p Credo er rvarene. Nr vi snakker om smak, s tenker vi p muligheten en rvare gir. Hva smaker en gulrot, hva smaker denne gulroten? Hvordan kan vi bruke den, og hvordan endrer smaken seg over tid? Kan den fermenteres, kan den rykes, eller skal vi gjre begge deler?</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 16:29:49', '2018-09-13 09:59:16', 'fa0e4b2c-0d1b-45ec-8421-8d7ae47bea56'),
 ('439', '291', 'no', 'B5 A8024 2 1', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 16:37:59', '2018-08-15 13:25:21', '98590946-a575-4ec1-8ff3-9ea552a40140'),
