 ('444', '293', 'en', 'B5 A1425 2 2 1', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 16:46:58', '2018-08-14 16:46:58', '0d057c67-5ffe-4134-b4ca-019fcc7e7a22'),
 ('445', '294', 'no', NULL, '<p>P Credo nsker vi  ta deg gjennom flerfoldige smaker, teksturer og flelser. Vi nsker  vise deg det beste fra grdene vre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p  finne rvarer som best viser egenskapene til tiden vi er i, og til stedet vi er p.</p>\n<p>Menyen er satt og bestr av mellom 20-25 serveringer. Den endres hver eneste dag, da dener basert p det mest interessante og beste vi fr levert fra vre leverandrer.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 16:48:16', '2019-08-01 11:43:30', '815b997f-ff2b-43bb-9fd0-2f4fd6bdec3f'),
 ('446', '295', 'no', NULL, '<p>Vi setter ogs sammen en drikkemeny som p beste mulige mte komplementerer og lfter frem hver enkelt rett. Drikkemenyen bestr av bde l, cider og et utvalg av viner, og ogs denne endres daglig. Har du spesielle nsker kan du gjerne bestille fra vr rikholdige vinkjeller bestende av flere tusen viner.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 16:48:16', '2019-08-01 11:43:30', 'c6223ca9-9808-45d9-9824-b889ad86b5e8'),
 ('447', '296', 'no', NULL, '<p>+47 954 37 028<br /><a href=\"mailto:credo@restaurantcredo.no\" class=\"link\">credo@restaurantcredo.no</a></p>\n<p>Ladeveien 9, 7066 Trondheim</p>\n<p>Flg oss p<a href=\"https://www.facebook.com/restaurantcredo.no/\" target=\"_blank\" rel=\"noreferrer noopener\">Facebook</a>og<a href=\"https://www.instagram.com/restaurantcredo/\" target=\"_blank\" rel=\"noreferrer noopener\">Instagram</a></p>', 'Kontakt', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 17:02:04', '2019-08-14 18:58:27', '77e123c8-06b9-401a-854c-710eec8954d7'),
