 ('454', '300', 'no', 'Jossa til Korea', NULL, NULL, NULL, 'left', NULL, '<p>Etter en lengre pause fra kjkkenet og en strre mengde norkse tradisjoner som sild, torsk og akevitt etter pning av et nytt kjkken p Lilleby, er Jossa sin eventyrlyst tilbake for fullt.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa til Korea\",\"seoDescription\":\"Etter en lengre pause fra kj\\u00f8kkenet og en st\\u00f8rre mengde norkse tradisjoner som sild, torsk og akevitt etter \\u00e5pning av et nytt kj\\u00f8kken p\\u00e5 Lilleby, er Jossa\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"299\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Jossa til Korea\",\"seoDescriptionUnparsed\":\"Etter en lengre pause fra kj\\u00f8kkenet og en st\\u00f8rre mengde norkse tradisjoner som sild, torsk og akevitt etter \\u00e5pning av et nytt kj\\u00f8kken p\\u00e5 Lilleby, er Jossa\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 17:45:37', '2018-08-21 10:37:55', 'eb16430d-c9cd-4b1d-8efb-56edbf028826'),
 ('455', '301', 'no', NULL, '<p>Sekken har vrt pakket og klar i lang tid, og endelig er ogsJossa klar til  vendesnuten i en retning av mer spicy smaker i Asia og nrmere Korea.<br /></p>\n<p>Vel fremme i Korea, og med kimchi, gochujang, tofu og grillet kjtt i tankene fr Jossa vann i munnen. Men aller frst - Spicy Koreansk Ramen!</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-14 17:45:37', '2018-08-21 10:37:55', 'd1b1bdad-3c55-4ed2-8578-dd08c5105c23'),
