 ('497', '198', 'en', 'Smak.no om Jossa i Venezuela', NULL, NULL, NULL, 'left', NULL, '<p>Smak.no, Dagens Nringslivs matportal har skrevet en flott<strong><a href=\"http://www.dn.no/smak/2016/02/17/1409/Restauranter/lag-lammebog-med-sramerikansk-vri\" target=\"_blank\" rel=\"noreferrer noopener\">anmeldelse</a></strong>av frste uken vr i Venezuela med Karlos Ponte. Selv om gjestekokken Ponte er tilbake p hjemmebane i Kbenhavn, kjrer Jossa videre med meny fra Venezuela fremover! Les teksten<strong><a href=\"http://www.dn.no/smak/2016/02/17/1409/Restauranter/lag-lammebog-med-sramerikansk-vri\" target=\"_blank\" rel=\"noreferrer noopener\">her</a>.</strong></p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Smak.no om Jossa i Venezuela\",\"seoDescription\":\"Smak.no, Dagens N\\u00e6ringslivs matportal har skrevet en flott\\u00a0anmeldelse\\u00a0av f\\u00f8rste uken v\\u00e5r i Venezuela med Karlos Ponte. Selv om gjestekokken Ponte er\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"197\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Smak.no om Jossa i Venezuela\",\"seoDescriptionUnparsed\":\"Smak.no, Dagens N\\u00e6ringslivs matportal har skrevet en flott\\u00a0anmeldelse\\u00a0av f\\u00f8rste uken v\\u00e5r i Venezuela med Karlos Ponte. Selv om gjestekokken Ponte er\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"se