 ('498', '201', 'en', 'Lokalt grogrunnlag', NULL, NULL, NULL, 'left', NULL, '<p>Jossa setter seg opp i stolen, tar en slurk kaffe og tenker p hva hun smakte i gr. Det er utvilsomt det beste i Norge sier hun hyt til seg selv. Men hvor gr egentlig grensene for smak, og hvem bestemmer hva som er godt og vondt, fortsetter hun mens koppen snart er tom. Med rvarer fra trndelag, s burde man kunne lag hva som helst, men hvem avgjr hva som er best akkurat her?</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Lokalt grogrunnlag\",\"seoDescription\":\"Jossa setter seg opp i stolen, tar en slurk kaffe og tenker p\\u00e5 hva hun smakte i g\\u00e5r. Det er utvilsomt det beste i Norge sier hun h\\u00f8yt til seg selv. Men hvor\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"200\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Lokalt grogrunnlag\",\"seoDescriptionUnparsed\":\"Jossa setter seg opp i stolen, tar en slurk kaffe og tenker p\\u00e5 hva hun smakte i g\\u00e5r. Det er utvilsomt det beste i Norge sier hun h\\u00f8yt til seg selv. Men hvor\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"s