 ('503', '226', 'en', 'Fossan Brd', NULL, NULL, NULL, 'left', NULL, '<p>Fossan Mlle er en perle av mlleverk fra 1936 lokalisert i Skjelstadmarka i Trndelag.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Fossan Br\\u00f8d\",\"seoDescription\":\"Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.\\u00a0\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"224\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Fossan Br\\u00f8d\",\"seoDescriptionUnparsed\":\"Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:34:50', '2018-08-15 09:51:29', '4fdd364c-a09e-47d8-95f2-17f31dfdd055'),
 ('504', '300', 'en', 'Jossa goes to Korea', NULL, NULL, NULL, 'left', NULL, '', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa til Korea\",\"seoDescription\":\"Etter en lengre pause fra kj\\u00f8kkenet og en st\\u00f8rre mengde norkse tradisjoner som sild, torsk og akevitt etter \\u00e5pning av et nytt kj\\u00f8kken p\\u00e5 Lilleby, er Jossa\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"299\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Jossa til Korea\",\"seoDescriptionUnparsed\":\"Etter en lengre pause fra kj\\u00f8kkenet og en st\\u00f8rre mengde norkse tradisjoner som sild, torsk og akevitt etter \\u00e5pning av et nytt kj\\u00f8kken p\\u00e5 Lilleby, er Jossa\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:34:50', '2018-08-21 10:37:55', 'eb31436c-1f2b-4d44-99fe-9038a228e82f'),
 ('505', '301', 'en', NULL, '<p>Etter en lengre pause fra kjkkenet og en strre mengde norkse tradisjoner som sild, torsk og akevitt etter pning av et nytt kjkken p Lilleby, er Jossa sin eventyrlyst tilbake for fullt.</p>\n<p>Sekken har vrt pakket og klar i lang tid, og endelig er ogsJossa klar til  vendesnuten i en retning av mer spicy smaker i Asia og nrmere Korea.</p>\n<p>Vel fremme i Korea, og med kimchi, gochujang, tofu og grillet kjtt i tankene fr Jossa vann i munnen. Men aller frst - Spicy Koreansk Ramen!</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:36:23', '2018-08-21 10:37:55', '518481f0-bff6-4c01-af3c-e1755bf43729'),
 ('507', '227', 'en', NULL, '<p>Den ble til da selve turbinen mllen bestr av, ble fraktet med jernbane til Hegra, ogderetter med hest og vogn opp til Skjelstadmarka. I dag driftes Fossan Mlle av Petter Fossan,og matmel blir fortsatt malt i denne gamle mlla. Finnes Kaf nsker  sette lys p denne gamle perlen, og til vr store begeistring fr vi oppdage melet i brdbaksten vr. Vi har utforsket med ulike melsorter fra Fossan Mlle, og eksperimentene har resultert i et eget Fossan Brd som er til salgs i kafeen!</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:37:36', '2018-08-15 09:51:29', '59662c52-dc2b-456e-851d-2f796a8cecb5'),
 ('508', '223', 'en', NULL, '<p>Bakeriet har fokus p naturlig hevet brd  SURDEIGSBRD  og brdene er utelukkende laget p norsk mel og kornarter. Spelt, Havre, Emmer, og rkt bygg er bare noen alternativer som er  f p kafeen.</p>\n<p>*Ille Brd Surdeigsbakeri (<a href=\"https://www.facebook.com/illebrod/)\">https://www.facebook.com/illebrod/)</a> er et surdeigsbakeri lokalisert i Oslo. De lager naturlig hevet brd og tar utelukkende i bruk lokalt dyrket mel og urkorn. Bakeriet holder til i Lakkegata 53, Oslo, og vi anbefaler hele Oslos befolkning, og alle tilreisende  ta turen innom bakeriet for en smak av byens beste brd!</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:37:58', '2018-08-15 09:37:58', 'cfd1fbdc-323e-41b6-b7ca-1c2dd40ce4d0'),
 ('509', '218', 'en', NULL, '<p>Friske urter, nydelige blomster og nyttevekster som folk flest bare kan drmme om er lett tilgjengelig like utenfor dra  For en LUKSUS!</p>\n<p>Lilleby Hagelag, i samarbeid med kretslpsgrden Skjlberg Sndre holder hagen i sjakk, og til vr fornyelse srger de for friske og grnne omgivelser rundt Finnes Kaf, Jossa mat &amp; drikke og Credo Restaurant.</p>\n<p>Alle som nsker kan bli med i Lilleby Hagelag, og for mer informasjon, ta kontakt p <a href=\"mailto:post@lillebyhagelag.no\">post@lillebyhagelag.no</a></p>\n<p>\n  </p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:38:29', '2018-08-15 09:38:46', '87588864-8228-4f60-90df-5d15d7f658cb'),
 ('510', '215', 'en', NULL, '<p>Koffertene er ikke ferdig utpakket fr at utstyret pakkes ned igjen og nye reiseml str for tur, for savnet etter de friske urtene, sterke kryddrene og de lekne smakene frer Jossa til big Thailand og Laos!</p>\n<p>Nam prik pao, pad thai og gaeng phed ped yang er bare noen av rettene som str p smaksagendaen for reisen, og Jossa fr vann i munnen av tanken.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:39:21', '2018-08-15 09:39:21', '13f3b042-214b-4013-bef0-00e909f54f99'),
 ('511', '196', 'en', NULL, '<p>Hun ser havnen i det fjerne, og tusler ned i kahytten.<br /> Hjem. Jeg skal hjem en liten tur, hun smiler til seg selv og tenker p hvordan hun plutselig savnet sild. Og akevitt.</p>\n<p>Det har vrt en lang reise siden hun var i Bangkok, eller lille bangkokk da, gjemt inne i chinatown i london. Der hun fikk noen nye smaker, som aldri hadde vrt innom Trondheim, fr n. Hun klapper p kofferten som er breddfull av urter, rtter, krydder og oppskrifter hun tar med seg hjem.<br />Men nam prik pao til side, selv om det kanskje er det beste hun hadde smakt, p alt, hun er klar for sild. Og for svinekjtt. Hun har tenkt mye p hvordan svinekjttet fra nettopp trndelag vil passe til alle de thailandske smakene, som et avbrekk fra all julematen. Friskt, sterkt, morsomt.</p>\n<p>Men n er det rmme som str i hodet. Rmme p vaffel, med lyrom. Og riskrem. Jossa klarer nesten ikke st stille hun tripper opp og ned dekk mens de legger landgangen klar.</p>\n<p>Hjemme, nrmest roper hun nr hun treffer brygga med foten.</p>\n<p>N skal det bli godt med gravet fisk.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:40:35', '2018-08-15 09:40:35', 'f5dba14b-d744-45d9-9c2f-1f50909568fa'),
 ('512', '193', 'en', NULL, '<p> Jaha du, s du er ute etter den svenske smaken du, sier Tobias p slepent svensk ml.<br />Jossa har spurt og gravd for  finne den som lager den beste maten p denne siden av grensen.</p>\n<p> S de sier det ja. Hehe.Tobias ler mens han plukker opp noe som kan virke som en vilkrlig blomst fra bakken.Han smaker og smatter.<br /> At jeg er den du skal snakke med ja.<br />Jossa smiler opprmt, og nikker.<br /> Den kommer herfra. Det er i jordenalt starter, det er der alt opprinner. S vi m bevege oss litt rundt.</p>\n<p>De fortsetter ferden nedover, mot et forgjettet sted, mot en grd som det gr flotte ord om rundt i hele verden.<br /> For at du skal forst hva de gjr akkurat der, s m vi nesten spise et par ting p veien.</p>\n<p>Tobias lister opp hva Jossa skal smake-Raggmunk med Vesterbotten,Sild med egg, poteter, rug og rdbeter , sild ost og smr,Falukorv,Flesk, rotmos, lk,Fisk med Skagensaus.<br />Dette er veldig kjente smaker, men Raggmunk, det er jeg usikker p.<br />Han ler, mens han henter ut en potet fra sekken. Raggmunk, det er nesten det beste du kan gjre med poteter.<br />Men kom n, s spiser vi. S fr du oppskriftenen p alt, som du kan ta med deg hjem igjen.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:41:52', '2018-08-15 09:41:52', '4f0bf65b-18e9-4cf8-a618-06e90c46a0d7'),
 ('513', '190', 'en', NULL, '<p>Tobias har sagt farvel for kort tid siden. Han takket for selskapet, ga henne en god klem og trykket en gave ned i sekken.  Du m ikke pne den pakken fr du er fremme. Tobias s p Jossa og smilte.\n God tur, og hils til Werner.</p>\n<p>Jossa klatrer om bord i toget og finner kupeen sin. Nattoget til malm, en behagelig mte  reise p, og fra Malm er det ikke langt til kontinentet. Hun bryter av skalken p brdet og legger seg p den oppredde senga. Fttene er mre etter all vandringen.Hun forsvinner inn i svnen samtidig med togets startende bevegelser. Som et barn blir hun dysset i svn, fr hun selv hadde tenkt. Det er mrkt, varmt og behagelig.</p>\n<p>Det spraker i en hyttaler, plinger i en bjelle og det bankes p dren. Det fles som om det er samtidig, men hun tar det p oppvkingsfasen, at hun har duppet av mellom lydene, bare fortrengt det litt.\nMalm, den kom raskere enn hun trodde, hele byen ligger der, foran henne, flat som den er.\nHun har brstet av seg smulene fra brdskalken, skiftet, tatt en kattevask og prvd  legge hret stramt slik det smmer seg, fr hun gikk av toget.</p>\n<p>Bten venter, bten til kontinentet str i havna, noen hundre meter bortenfor stasjonen.\nFra Kbenhavn ble det tog til wien, med bytte i mnchen, Jossa var utmattet men merket seg at Kbenhavn var en by hun skulle utforske, men da p vei hjem.</p>\n<p>Brosteinen og kumlokkene, de er fine. Jossa ser ned mens hun tusler ut av stasjonsbygget i Wien.\nMen jeg er sulten. Sier hun hyt til seg selv, s den dsige mannen som sto rett ved siden av i sin egen verden skvetter til og ser p henne.\n unnskyld, sier han.\nh, nei  det var ikke meningen, men jeg er bare litt sulten. Eller hvis jeg skal si det som sant er, jeg er skrubbsulten.\nHun hadde helt glemt  spise, helt glemt at hun var sulten nr hun lp fra bt til tog i Kbenhavn, og i Mnchen ble det akkurat tid nok til en plse med sauerkraut.\nHaha! Mannen smiler til, det glimter i gull bakerst i munnen\n Du har kommet til rett sted. Kom bli med meg.\n-Unnskyld, jeg glemte meg helt bort. Hvor er mine manerer, uff , Werner heter jeg frken. Han strekker ut en hnd. Jossa griper den og kjenner det faste hndtrykket. Jossa sier hun, og smiler.</p>\n<p>De nrmest smlper innover byen. Jossa klarer ikke f med seg noe, hun tenker bare p mat.\n Hva skal du her i Wien ?\n Jeg skal spise, jeg vil smake det som er sterisk. Det er det som er reisen min skjnner du, jeg vil finne ut av hva ting smaker p forskjellige steder.\nWerner stopper litt, mens han tenker.\n S du vil smake det som er mest Wiensk, ok, men da tar vi til hyre her.\nDu skal f Sptzle, og det er best p et bitte lite sted rett her borte.</p>\n<p>De smlper videre, litt uten grunn, men drevet av sult og nysgjerrighet.Sptzle, en slags urpasta, eller gnocchi, eller en blanding av de begge.Nr Werner forteller om smaken, den smeltede osten og ikke minst vinen som skal drikkes til gr det nesten rundt for Jossa.</p>\n<p>Endelig skal hun f mat.\nWerner dumper ned i stolen ved siden av henne.\n Snn, vin og mat p vei. Du er skikkelig sulten ? Jossa klarer knapt  ytre ja, hun venter bare p noe  spise.\n Jeg bestillte litt forskjellig, s du skal f et raskt overblikk, det blir kanskje litt mye. Men det kommer noen andre venner av meg ogs, som kan mer om vin, s da spiser han det vi ikke klarer. Ok? Werner har tatt kommandoen og ser ut til  kose seg i rollen som vertskap.  Grillet kalvetunge med syltede grnnsaker, Sptzle med sopp og ost, Gresskarsuppe med krepse-dumplings, Plse med sauerkraut, Snitzel med potetsalat og sitron, Rye med kl, og til dessert fr du Schwartswaldkake med kirsebr ogs kan du ikke unng strudelen da. Den m du smake nr du er i Wien .\nJossa rister p hodet og ler.\n Jeg klarer jo ikke alt sammen, det er jo umulig.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:42:33', '2018-08-15 11:52:58', 'df9a6ef7-95ca-442c-9322-61c011b6ffd7'),
 ('514', '172', 'en', NULL, '<p>Heidi grew up in Trondheim and on her grandfathers boat in Garten along the Trndelag coast.Here she developed strong connections to the land and sea, which to this day may be seen in hercooking.</p>\n<p>Bjerkan\'s career within the food industry started already when she was eighteen years old during a summer job at the caf at stbanehallen. She soon realized that she wanted to work as a chef, as the high tempo within a kitchen fed Bjerkan\'snatural habit of being restless.<br /></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:05', '2019-08-14 15:57:39', '333ab84f-a145-47ac-8f25-9280a0243ad8'),
 ('515', '287', 'en', NULL, '<p>Heidi is passionate about raising awareness of our food systems, improving land use practices and preserving the traditional food cultures of the region.</p>\n<p>For Heidi, the farmers are the heroes of this story, and it is their work that should shineabove all others. During a meal at Credo, Heidi takes all of her guests on a personal tour through thegardens, waterways and forests where our raw ingredients grow.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:05', '2019-08-14 15:57:39', 'bdcd4315-2a50-4acb-85d2-f519f3d1fa83'),
 ('516', '288', 'en', NULL, '<p>Heidi was in 2015 voted as the Head Chef of the year, awarded thedistinguished Matprisen (Food Prize) and Ingridprisenfor her engagement in promoting better food and sustainableland use practices in 2017, and in 2019 she was awarded as the Chef\'s Chef in Norway.<br /></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:05', '2019-08-14 15:57:39', '0ac3367b-85cc-4649-ba68-a167733e463b'),
 ('517', '95', 'en', NULL, '<p>Jon Fredrik, a defender of tradition, a knight of old crafts, both in his making of butter and sour cream, as well as in his needlework.</p>\n<p>- My knowledge and craft are really of historic clothing, og textiles and traditions, he says, but milk and butter, well, it\'s a big part of the same culture. And the farm is my inheritance, it\'s been in my family for centuries.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:31', '2018-09-13 09:55:47', '6164fd43-fc7e-4375-b300-1e4ce01e16a8'),
 ('518', '283', 'en', NULL, '<p>Jon Fredrik has seven cows, the same type of bovinae kept in this area before the more productive NRF (Norwegian Red Cow) came along. Sidet Trnder has no English name, but if you imagine a cow smaller than a modern cow, almost of the size of an overgrown Grand Danoise only stockier, you\'re on the right track. These cows, selected away in early modernization of agriculture doesn\'t produce the average 10.000 liters of milk as the NRF. They are more in the lower three-digit number, but for Jon Fredrik that isn\'t a problem.</p><p>- It\'s not the quantity we are looking for, he says with a smile.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:32', '2018-09-13 09:55:47', '703d86a4-0a13-4027-b8a3-a55d1f5e9ba7'),
 ('519', '284', 'en', NULL, '<p>Back to the butter - shaped as an object of desire, it is placed in the middle of the tavle as something to worship. Butter has always been the center of attention, it\'s golden color proves its value, the value of milkfat. For many years, butter was the main (and sometimes the only) income for farmers. They sold the butter and kept the skimmed milk and the buttermilk for their own use.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:32', '2018-09-13 09:55:47', '9dd0b0a6-1e56-4870-9d0f-9c3a7eeeafca'),
 ('520', '285', 'en', NULL, '<p>Jon Fredrik delivers most of his milk to Restaurant Credo, the rest he keeps for his own guests, as his farm has quite a few visitors interested in traditional crafts and farming. His house, kept the way his grandparents had it, only adding items of numbers that would surpass the amount of memorabilia in a national museum of a mid-sized country.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:32', '2018-09-13 09:55:47', 'fe57bdfc-f999-4604-aa13-0501fb9f6c2b'),
 ('521', '286', 'en', NULL, '<p>Fannremsgrden is located in Orkanger, in a typical inland climate. The soil is based on sand and moll, perfect conditions for crops and grass. And the weather, well - The sun always shines when I\'m home, Jon Fredrik says.</p><p>Aside from the \"Sidet Trnder\" for his milk, sour cream and butter production, Jon Fredrik also have hens for eggs, and gorses for leisure. You can visit him to try out all his products, and also yo buy traditional handcrafted products in his little shop. The butter alone is worth the trip. But to really get the very best taste of Jon Fredrik\'s butter, just close your eyes and remember the potato cake, served here at Credo.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:32', '2018-09-13 09:55:47', '150fbb3b-1dd1-46be-98c4-220df85c1d40'),
 ('522', '91', 'en', NULL, '<p>In the vast green hills of The Valley in Orkdal, guests will get lost of words. This is a heaven of biodiversity. The Valley is filled to the treetops with life in all shapes and sizes, but the valley is most known for its river, which shares its name with the biggest producer of processed foods in Norway.</p><p>The reason this green paradise exists is because of Elin and Carl Erik stlund\'s stubbornness and willfull work.<br /></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:56', '2018-09-08 14:12:06', '6468b3f5-b269-4a9b-aefa-3d85a2d9e335'),
 ('523', '275', 'en', NULL, '<p>Elin and Carl Erik have been the talk of the valley for some years, not in a good way, more of a head shaking disturbed distrust kind of way, from the other farmers that is. It is not possible to grow the plants you would like to grow here, not the way you are dreaming of anyway, they say.Elin and Carl Erik work after biodynamic principles, and for them the soil is everything. It needs to be healthy and full of life, and in this hill, they started the work of rebuilding the soil. So they carried on, and slowly but decisivly it started to grow, to almost overgrow that small part of the hill facing west.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:56', '2018-09-08 14:12:06', 'b2681291-d9de-44c4-b485-6ed0b150e9b6'),
 ('524', '276', 'en', NULL, '<p>At the farm they produce root vegetables, cabbage, cucumbers, apple cucumbers, chilies, edible flowers and herbs. They also have the old bovinae \"sidet trnderfe\", mosk ducks, pigs and the lamb breed \"Gr Trnder\" and \"Gammel Norsk Splsau\". The animals live in harmony with the farm\'s cyclical philosophy, and are an important supporter of the farm\'s cycle.<br /></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:56', '2018-09-08 14:12:06', '13b52680-4574-4b76-9152-ee1e4b81045f'),
 ('525', '277', 'en', NULL, '<p>Composting is a big part of the cycle of life at the farm as well, and all the compost from Credo are given to the farm. This process of composting is holistic, and they keep and reuse as much as possible. Lately, they have also started growing micro greens in the cellar during winter.<br /></p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:57', '2018-09-08 14:12:06', 'b5f78ce3-81f7-44b3-8cb1-166f576789c7'),
 ('526', '278', 'en', NULL, '<p>Diversity, taste, experiences and curiosity for the order of nature is in center at Skjlberg Sndre, and being able to pick honest vegetables and herbs ourselves is the highlight for our restaurant. We appreciate the knowledge Skjlberg Sndre show and teach us about agro-ecological farming, and together, we push the limit of what is possible to grow at Svorkmo.</p>\n<p><a href=\"http://www.skjolbergsondre.no/\">www.skjolbergsondre.no</a>\n  </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:43:57', '2018-09-08 14:12:06', '08e7d7d7-9a96-45c6-82b2-fc0e7ca959ee'),
 ('527', '84', 'en', NULL, '<p>Credo nsker  ta deg gjennom flerfoldige smaker, teksturer og flelser. Vi nsker  vise deg grdene vre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p  finne rvarer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p det mest interessante og beste vi fr levert, fra dag til dag. Vi setter ogs sammen en drikkemeny som p beste mulige mte komplementerer og lfter frem hver enkelt rett. Har du spesielle nsker kan du gjerne bestille fra vr rikholdige vinkjeller bestende av flere tusen viner.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:45:06', '2018-08-15 09:45:19', '3ab40429-648a-47d8-ac96-927d24611b0b'),
 ('528', '85', 'en', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:45:06', '2018-08-15 09:45:19', '593b62be-ae5c-4c7b-8ab2-0990ac41c830'),
 ('529', '86', 'en', NULL, '<p>Credo nsker  ta deg gjennom flerfoldige smaker, teksturer og flelser. Vi nsker  vise deg grdene vre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p  finne rvarer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p det mest interessante og beste vi fr levert, fra dag til dag. Vi setter ogs sammen en drikkemeny som p beste mulige mte komplementerer og lfter frem hver enkelt rett. Har du spesielle nsker kan du gjerne bestille fra vr rikholdige vinkjeller bestende av flere tusen viner.</p>', 'En liten mellomtittel', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:45:06', '2018-08-15 09:45:19', 'bc7bebbe-fb24-4851-af16-75d72e017f2a'),
 ('530', '87', 'en', NULL, '<p>Rvarene er motivasjonen vr. Hvorfor skulle vi ellers betale 260 kroner per kilo smr? Med rent hndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, p gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, mnen, sjen, kroppen.<br /></p>', 'Vegen videre', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:45:06', '2018-08-15 09:45:19', '925a68d7-ee0d-41e3-b7cd-f247015dda82'),
 ('531', '56', 'en', NULL, '<p>Ramen will be served from 12PM - 8PM, and the price will be 150NOK. No reservation is needed and we are looking forward to welcome you all!</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:45:30', '2018-08-15 09:45:30', '3b2f5f47-c1cb-47c4-bfd4-93d187541cab'),
 ('532', '102', 'en', NULL, '<p>At Credo you will experience food cooked from the raw goods grown in the Trndelag region, fished from the waters surrounding it, and dairy and local speciality products cultivated with a focus on flavors and sustainability.</p>\n<p><br /></p>', 'Credos heart lies where our raw ingredients are produced.', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:58:38', '2018-09-13 09:59:16', '0306ab68-76d7-4a6a-a3d5-e603d8fa3dae'),
 ('533', '289', 'en', NULL, '<p>Credos great wish is to take you through a multi-faceted experience of tastes, textures and experiences when you dine with us. We want to show you our gardens, our animals and all that we get from land and sea. We dedicate our time to finding raw ingredients that exemplify the best qualities of the time and place we are in.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:58:39', '2018-09-13 09:59:16', '7ad61d5c-36df-41a8-a787-86703e0f99ac'),
 ('534', '104', 'en', NULL, '<p>Ingredients are our motivation. Why else would we spend 260 kr ($32) per kilogram on butter alone?With proper craftsmanship, our chefs goal is to give equal attention to our guests as we do to ourplates. We believe that each component is crucial - the animals, forests, earth, moon, sea and you,the individual.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:58:39', '2018-09-13 09:59:16', '80a80bab-f98b-4393-90aa-9dcb4b6d405a'),
 ('535', '106', 'en', NULL, '<p>At Credo we wish to bring you as close to the tastes, textures and feelings of our food as we possiblycan. We cant wait to introduce you to our farms, food and philosophy by sharing the best of whoand what we are with all who visit.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:58:39', '2018-09-13 09:59:16', 'e2b720c3-56de-4708-b5c9-b35807b7760c'),
 ('536', '117', 'en', NULL, '<p>Credo menu - 1400,-<br /></p>\n<p>Wine menu- 1300,-</p>', 'Menu', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:59:06', '2019-08-01 11:43:30', '0d9003d6-fc76-49ff-9aee-a792dba13ee1'),
 ('537', '294', 'en', NULL, '<p>Our menu is based on the most interesting and highestquality goods we receive from day to day. The menu is set, andconsist of in between 20-25 courses, and it changes every day.<br /></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:59:06', '2019-08-01 11:43:30', '4765223c-9b70-4893-ab34-3fd5f7b67cea'),
 ('538', '295', 'en', NULL, '<p>Our drink menu is thoughtfully arranged to bestcompliment our dishes, so that each combination raises the profile of the individual dish. If you havea special request, you will be delighted by our extensive wine cellar of several thousand wines.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:59:06', '2019-08-01 11:43:30', 'ce52b079-2740-44cf-aa41-8dfbc79d5116'),
 ('539', '121', 'en', NULL, '<p>Here you can read press articles about Heidi Bjerkan andRestaurant Credo</p>', 'Press', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 09:59:43', '2019-12-01 16:30:36', 'b333ef7d-113b-4f94-bc70-f1e3113d5001'),
 ('540', '296', 'en', NULL, '<p>+47 954 37 028<br /><a href=\"mailto:credo@restaurantcredo.no\" class=\"link\">credo@restaurantcredo.no</a></p>\n<p>Ladeveien 9, 7066 Trondheim</p>\n<p>Follow us on<a href=\"https://www.facebook.com/restaurantcredo.no/\" target=\"_blank\" rel=\"noreferrer noopener\">Facebook</a>and<a href=\"https://www.instagram.com/restaurantcredo/\" target=\"_blank\" rel=\"noreferrer noopener\">Instagram</a></p>', 'Contact', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 10:00:39', '2019-08-14 18:58:27', '11c30951-69da-4151-8a10-1f044347757c'),
 ('541', '74', 'en', NULL, '<p>We are always on the lookout for new, engaged and passionate employees who wish to become a part of our family.</p>\n<p>If you wish to apply for a position, or have questions, please contact us at:<a href=\"mailto:credo@restaurantcredo.no\" class=\"link\">credo@restaurantcredo.no</a></p>', 'Careers', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 10:00:57', '2018-09-08 11:35:31', '40375a89-29f2-4fba-83bf-e6932f6f2a6a'),
 ('542', '144', 'en', NULL, '<p>P midten av 1900-tallet bodde det en nysgjerrig, ujlete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne nrmest, hadde hun en umettelig utfartstrang i verden. <em>Hva trigget henne?</em> Vi tror det var jakten p de rene smakene. Og mat som ingen hun kjente hadde hrt om fr. Rettene mtte ha jordnr betydning for  smake det lille ekstra, i flge Jossa. Hun nsket  forst seg p verden gjennom mat. Vi er derfor veldig glad og takknemlig for  f fortsette historiene hennes videre, gjennom Jossa mat og drikke her i Credoveita.<br /></p>', 'Jossa', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 10:01:19', '2019-08-14 19:06:41', 'bd79f79d-b416-410c-996c-f06e46763110'),
 ('543', '145', 'en', NULL, '', 'Vi pner i starten av 2018, s meld deg p nyhetsbrevet vrt for  motta oppdateringer.', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 10:01:19', '2019-08-14 19:06:41', '3d792a9a-5b6c-4b4f-9f5f-9110a39d685e'),
 ('544', '180', 'en', NULL, '<p><a href=\"http://www.restaurantcredo.no/uploads/main/MENY-Jossa.pdf\" target=\"_blank\" rel=\"noreferrer noopener\">Trykk her for  se meny</a></p>', 'Dagens meny', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 10:01:32', '2019-11-07 18:07:03', '1f0537e4-d5ec-4059-a286-2a1e4e5afbef'),
 ('549', '185', 'en', NULL, '<p>Vi er alltid p utkikk etter nye, engasjerte ansatte som nsker  bli en del av Credo-familien.</p>\n<p>Hvis du nsker  ske en stilling eller har noen sprsml, ta kontakt p:<a href=\"mailto:credo@restaurantcredo.no\" class=\"link\">credo@restaurantcredo.no</a></p>\n<p><a href=\"mailto:credo@restaurantcredo.no\" class=\"link\"></a></p>', 'Karriere', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 10:02:07', '2018-08-15 10:02:07', '63c6d870-1ac1-47e4-8b8b-ebeb0d686dce'),
