 ('553', '153', 'en', NULL, '<p>Innkvartert i Lillebys historiske gamle barnehjem er Finnes Kafe det siste kulinariske tillegget til Heidi Bjerkans voksende spisestue.</p>', 'Finnes Kaf', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 10:02:31', '2018-08-15 10:02:31', '91c7f343-9d9d-4d0a-b08b-e64444b0fc40'),
 ('554', '53', 'en', NULL, '<p>En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus p menneskene som maten, bndene og dyrene, med kjtt og fisk tilberedt i samme ml, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbrd, andebryst, stekte torskehoder og rabarbraslush.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-08-15 10:02:31', '2018-08-15 10:02:31', '802d34d1-9595-4392-907b-e8103e6c0acb'),
