 ('628', '330', 'no', NULL, '<p>Den sterrikske familiebedriften Meinklang er i fullstendig harmoni med naturens syklus, og det er ikke bare vin de lager i solfylte Burgenland. Mens det unge ekteparet Angela og Werner Michlits har ansvar for vinproduksjonen p grden, tar Werners foreldre og to brdre seg av oppdrett av storfe og svin, i tillegg til dyrking av korn, epler, mais og solsikker  alt produsert p biodynamisk vis.<br /><br />P mange mter er dette forenelig med Credos filosofi, og vi er kjempestolte av  f Meinklang p besk til Jossa.<br /><br />Fredag 26. oktober fr vi et lrerikt innsyn i bde ideologi og viner.<br />Et must for alle som er interessert i kologiske tankesett og kvalitet,<br />men det er ogs verd  nevne at Werner er en skikkelig trivelig fyr.<br /><br />Kvelden er todelt. Du kan selv velge smaking, middag eller begge deler:<br /><br />Kl 17.00: Foredrag og vinsmaking av seks viner med Werner Michlits, mannen bak vinhuset Meinklang.<br />Pris 200,- Tid: 90 minutter.<br />Book gjerne plass via mail: credo@restaurantcredo.no.<br /><br />Fra kl 18.30: Middag med Werner p Jossa.<br />4-retters middag med vinpakke fra Meinklang.<br />Pris kr 950,-<br />Book gjerne bord til middagen via:<a href=\"https://jossa.dinesuperb.com/reserve/guests?fbclid=IwAR0kSaTQqD7LxSDYKfGq1Whjk_BpwQNMe7bx2XOGtaY64ohyrpTaCszuLxc\" target=\"_blank\" rel=\"noreferrer noopener\">https://jossa.dinesuperb.com/reserve/guests</a>.</p>', 'Den biodynamiske vinprodusenten Meinklang gjester Jossa og Credo', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-10-24 07:06:49', '2018-10-24 07:09:44', '28886e1e-7314-48fb-a5b4-23b569fb08bb'),
 ('629', '330', 'en', NULL, '<p>Den sterrikske familiebedriften Meinklang er i fullstendig harmoni med naturens syklus, og det er ikke bare vin de lager i solfylte Burgenland. Mens det unge ekteparet Angela og Werner Michlits har ansvar for vinproduksjonen p grden, tar Werners foreldre og to brdre seg av oppdrett av storfe og svin, i tillegg til dyrking av korn, epler, mais og solsikker  alt produsert p biodynamisk vis.<br /><br />P mange mter er dette forenelig med Credos filosofi, og vi er kjempestolte av  f Meinklang p besk til Jossa.<br /><br />Fredag 26. oktober fr vi et lrerikt innsyn i bde ideologi og viner.<br />Et must for alle som er interessert i kologiske tankesett og kvalitet,<br />men det er ogs verd  nevne at Werner er en skikkelig trivelig fyr.<br /><br />Kvelden er todelt. Du kan selv velge smaking, middag eller begge deler:<br /><br />Kl 17.00: Foredrag og vinsmaking av seks viner med Werner Michlits, mannen bak vinhuset Meinklang.<br />Pris 200,- Tid: 90 minutter.<br />Book gjerne plass via mail: credo@restaurantcredo.no.<br /><br />Fra kl 18.30: Middag med Werner p Jossa.<br />4-retters middag med vinpakke fra Meinklang.<br />Pris kr 950,-<br />Book gjerne bord til middagen via:<a href=\"https://jossa.dinesuperb.com/reserve/guests?fbclid=IwAR0kSaTQqD7LxSDYKfGq1Whjk_BpwQNMe7bx2XOGtaY64ohyrpTaCszuLxc\" target=\"_blank\" rel=\"noreferrer noopener\">https://jossa.dinesuperb.com/reserve/guests</a>.</p>', 'Den biodynamiske vinprodusenten Meinklang gjester Jossa og Credo', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2018-10-24 07:06:49', '2018-10-24 07:09:44', '9d0b7836-0560-4b4a-9417-0323edcfacdd'),
