 ('634', '333', 'no', NULL, '<p>I det pne kjkkenet som vender ut mot gaten lukter det av grill og frityr - Det freser og koker, P Jay Fai blir all maten laget over trekull, det wokkes p rdgldende trekull, og kokken selv str med skibriller mens hun friterer en av hennes mest ikoniske retter - En Gigantisk krabbeomelett. Den lille damen bak de store smakene jobber utrettelig over den boblende woken.</p>\n<p>Rett bortenfor str en annen kokk, med en fjl p magen og fire btter rundt seg - En rekke mennesker har stilt seg opp i k og ser p kokken som jobber raskt og uten stans -Hun fyller et grnt blad med reker, chilli, kokos, ingefr og lime fr hun bretter bladet og rekker det til Jossa. - Ventetiden belnnes med en smaksbombe - Hun tar en til med det samme. Miang Kham, sier de nr hun spr hva hun akkurat har spist.\nMiang Kham - Det skal jeg servere hjemme.</p>\n<p>Vi ses p Jossa 4.januar - 13.januar</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2019-01-03 13:55:10', '2019-01-03 14:19:27', '066cc736-fb6c-4869-970a-8e2bad8ae6a7'),
 ('635', '333', 'en', NULL, '<p>I det pne kjkkenet som vender ut mot gaten lukter det av grill og frityr - Det freser og koker, P Jay Fai blir all maten laget over trekull, det wokkes p rdgldende trekull, og kokken selv str med skibriller mens hun friterer en av hennes mest ikoniske retter - En Gigantisk krabbeomelett. Den lille damen bak de store smakene jobber utrettelig over den boblende woken.</p>\n<p>Rett bortenfor str en annen kokk, med en fjl p magen og fire btter rundt seg - En rekke mennesker har stilt seg opp i k og ser p kokken som jobber raskt og uten stans - Hun fyller et grnt blad med reker, chilli, kokos, ingefr og lime fr hun bretter bladet og rekker det til Jossa. - Ventetiden belnnes med en smaksbombe - Hun tar en til med det samme. Miang Kum, sier de nr hun spr hva hun akkurat har spist.\nMiang Kum - Det skal jeg servere hjemme.</p>\n<p>Vi ses p Jossa 4.januar - 13.januar</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2019-01-03 13:55:10', '2019-01-03 14:19:27', '96d099f7-7e79-449f-97f0-d78580d4c980'),
