 ('668', '350', 'no', NULL, '<p>Lange frokoster i store rom fulle av tedrikkende mennesker som plukket sm retter fra traller som kom i endelse rekker. Ste, salte, sure og bitre biter pakket inn i dampet, stekt eller fritert deig.</p>\n<p>Siden vi i trndelag ikke er s sterke p frokost og lunsj utenfor faste rammer har hun bestemt seg for  gjre det til et like fint middagsrituale. P jossa blir det kinesisk matfest i fem dager til ende, og festen starter p Kinesisk nyttr, 5. februar. Allerede 6. februar er det en viktig dag i vrfestivalen - Det er dagen da du tar med svigermor p middag.</p>\n<p>Vi sees p Jossa 5.februar - 10.februar!</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2019-02-03 16:24:56', '2019-02-03 16:24:56', '15187909-2758-4744-aebf-c83ffc4ca31b'),
