 ('701', '366', 'en', 'Julelunsj buffet p Jossa ', NULL, NULL, NULL, 'left', NULL, '<p>Vi har gleden av  lansere rets julelunsj buffet p Jossa Mat &amp; Drikke. Trykk deg videre for  se menyen som vil vre gjeldende fratirsdag 12. november tillrdag 21. desember.</p>\n', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Julelunsj buffet 2019\",\"seoDescription\":\"Vi har gleden av \\u00e5 lansere \\u00e5rets julelunsj buffet p\\u00e5 Jossa.\\u00a0Menyen vil v\\u00e6re gjeldende fra\\u00a0tirsdag 12. november til\\u00a0l\\u00f8rdag 21. desember. \",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"365\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Julelunsj buffet p\\u00e5 Jossa \",\"seoDescriptionUnparsed\":\"Vi har gleden av \\u00e5 lansere \\u00e5rets julelunsj buffet p\\u00e5 Jossa Mat & Drikke. Trykk deg videre for \\u00e5 se menyen som vil v\\u00e6re gjeldende fra\\u00a0tirsdag 12. november\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVa