 ('702', '367', 'no', NULL, '<p>- Rkt sild med rmme, rdlk og revet trket eggeplomme<br /></p>\n<p>- Lettrkt Rye fra Sterstad grd med ferskost fra Grindalen</p>\n<p>- Smilende hnseegg fra Aksel og Lise Hovde medhndpillede reker fra Lyngen,\nestragonmajones og fennikel</p>\n<p>- Kyllingsalat av Hovelsrudkylling med sennep, epler, selleri og sprtt kyllingskinn</p>\n<p>- Rrt tartar av melkeku med lpestikkemajones med syltede sopp og agurk</p>\n<p>- Leverpostei av soppgris med sopp, bacon, syltede rdbeter</p>\n<p>- Frikadeller av gris fra Trndersopp med rdkl kokt i solbr og honning</p>\n<p>- Serveres med Credo brd, rugbrd og Fannremssmr</p>\n<p><strong>kr. 350 pr. pers</strong></p>\n<p><strong><br /></strong></p>\n<p>\n<strong>Tilvalg kr. 60</strong></p>\n<p>- Jossas riskrem med kirsebrsaus</p>\n<p>- Klsalat med solbrvinaigrette, rdlg, koriander, ristede hasselndder og urter</p>\n<p>- Rbl med epler og ntter</p>\n<p>- Munkeby med chutney</p>\n<p>- Lammerull fra Skjlberg Sndre med syltet agurk ogsennep </p>\n<p><strong><br /></strong></p>\n<p><strong>Book bord for fire eller flere:<a href=\"https://jossa.dinesuperb.com/reserve/guests\">https://jossa.dinesuperb.com/reserve/guests</a></strong></p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2019-11-07 17:45:28', '2019-11-07 17:59:22', '77ac8cbc-8a1f-4b2c-99a7-520a89b9b984'),
 ('703', '367', 'en', NULL, '<p>Vi har gleden av  lansere rets julelunsj buffet p Jossa Mat &amp; Drikke.</p>\n<p>Menyen nedenfor vil vre gjeldende fratirsdag 12. november tillrdag 21. desember.</p>\n<p><br /></p>\n<p>- Rkt sild med rmme, rdlk og revet trket eggeplomme</p>\n<p>- Lettrkt Rye fra Sterstad grd med ferskost fra Grindalen</p>\n<p>- Smilende hnseegg fra Aksel og Lise Hovde medhndpillede reker fra Lyngen,\nestragonmajones og fennikel</p>\n<p>- Kyllingsalat av Hovelsrudkylling med sennep, epler, selleri og sprtt kyllingskinn</p>\n<p>- Rrt tartar av melkeku med lpestikkemajones med syltede sopp og agurk</p>\n<p>- Leverpostei av soppgris med sopp, bacon, syltede rdbeter</p>\n<p>- Frikadeller av gris fra Trndersopp med rdkl kokt i solbr og honning</p>\n<p>- Serveres med Credo brd, rugbrd og Fannremssmr</p>\n<p><strong>kr. 350 pr. pers</strong></p>\n<p><strong><br /></strong></p>\n<p>\n<strong>Tilvalg kr. 60</strong></p>\n<p>- Jossas riskrem med kirsebrsaus</p>\n<p>- Klsalat med solbrvinaigrette, rdlg, koriander, ristede hasselndder og urter</p>\n<p>- Rbl med epler og ntter</p>\n<p>- Munkeby med chutney</p>\n<p>- Lammerull fra Skjlberg Sndre med syltet agurk ogsennep </p>\n<p><strong><br /></strong></p>\n<p><strong>Book bord for fire eller flere:<a href=\"https://jossa.dinesuperb.com/reserve/guests\">https://jossa.dinesuperb.com/reserve/guests</a></strong></p>\n', 'Julelunsj buffet p Jossa ', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '100', '2019-11-07 17:45:28', '2019-11-07 17:45:28', 'e22b62aa-2fa6-44cb-b170-b194f1d43f37'),
