 ('160', '68', '4', '49', 'no', '2', '', '{\"typeId\":\"4\",\"authorId\":\"59\",\"title\":\"Meny\",\"slug\":\"meny\",\"postDate\":1506191340,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"9\",\"fields\":{\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Dagens meny\",\"standardImages\":[\"163\"],\"standardBodyText\":\"<p><\\/p>\\r\\n<p><em>Mandag 20. desember<\\/em><\\/p>\\r\\n<p>Kj\\u00f8kkenet v\\u00e5rt reiser kulinarisk ut i fra hvor Jossa bestemmer seg for \\u00e5 ta ferden, som kan variere fra uke til uke, m\\u00e5ned til m\\u00e5ned. Vi henter smaker utenfor Norden men strekker oss s\\u00e5 langt vi m\\u00e5 for \\u00e5 jobbe med lokale r\\u00e5varer og produsenter. Er det ikke det, stiller vi likevel kvalitetskrav som gir smaksopplevelser uten dikkedarer.<\\/p>\"}},\"new1\":{\"modified\":\"1\",\"type\":\"introLinks\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"customIntroLinks\":{\"new1\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"Lunsj meny\",\"internLink\":\"\",\"externalLink\":\"https:\\/\\/www.google.no\\/url?sa=i&rct=j&q=&esrc=s&source=images&cd=&ved=0ahUKEwin3ZSw55HYAhXQ1qQKHSxQC4IQjRwIBw&url=https%3A%2F%2Fwww.musthavemenus.com%2Fcategory%2Frestaurant-menu.html&psig=AOvVaw0n9ZPlm5jTt2i2b91zPPTI&ust=1513626258610592\"}},\"new2\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"Kvelds meny\",\"internLink\":\"\",\"externalLink\":\"https:\\/\\/www.google.no\\/url?sa=i&rct=j&q=&esrc=s&source=images&cd=&ved=0ahUKEwin3ZSw55HYAhXQ1qQKHSxQC4IQjRwIBw&url=https%3A%2F%2Fwww.musthavemenus.com%2Fcategory%2Frestaurant-menu.html&psig=AOvVaw0n9ZPlm5jTt2i2b91zPPTI&ust=1513626258610592\"}},\"new3\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"Vin meny\",\"internLink\":\"\",\"externalLink\":\"https:\\/\\/www.google.no\\/url?sa=i&rct=j&q=&esrc=s&source=images&cd=&ved=0ahUKEwin3ZSw