\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<br><\\/p>\\r\\n<p>Med n\\u00e6r kontakt til produsentene v\\u00e5re og med en etisk tiln\\u00e6rming til det vi gj\\u00f8r, s\\u00f8ker vi kontinuerlig utvikling mot b\\u00e6rekraft. Vi tror veldig p\\u00e5 at dette gjenspeiler seg i smak. <br><\\/p>\",\"settingImagePosition\":\"left\"}},\"105\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"99\"]}},\"106\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>R\\u00e5varene er motivasjonen v\\u00e5r. Hvorfor skulle vi ellers betale 260 kroner per kilo sm\\u00f8r? Med rent h\\u00e5ndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, p\\u00e5 gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, m\\u00e5nen, sj\\u00f8en, kroppen.<br><\\/p>\\r\\n<p>Vi tar deg n\\u00e6rt til smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 integrere deg og kretsl\\u00f8pene som g\\u00e5rdene v\\u00e5re representerer, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er p\\u00e5.<\\/p>\",\"settingImagePosition\":\"right\"}},\"107\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Heidi\",\"standardImages\":[\"127\"],\"standardBodyText\":\"<p>Heidi Bjerkan (1970) er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1997.<\\/p>\"}},\"108\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi Bjerkan vokste opp i Trondheim og i b\\u00e5ten til bestefaren p\\u00e5 Garten - tr\\u00f8ndelagskysten. Her knyttet hun sterke b\\u00e5nd til jord og vann, som siden er \\u00e5 se i hennes matlaging. For Heidi Bjerkan er det b\\u00f8ndene som er heltene, og det er produsentene som skal skinne. Gjennom m\\u00e5ltidet p\\u00e5 Credo tar hun med alle gjestene p\\u00e5 hennes tur gjennom g\\u00e5rdene, sj\\u00f8en og skogen der r\\u00e5varene kommer fra.<br><\\/p>\\r\\n<p>Heidi Bjerkan engasjerer seg for mer kunnskap, for bedre landbruk og for st\\u00f8rre interesse for tradisjoner, og Heidi Bjerkan fikk i \\u00e5r Matprisen for sitt engasjement for bedre mat og et bedre landbruk. <\\/p>\",\"settingImagePosition\":\"left\"}},\"111\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"125\"]}},\"112\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"standardBodyText\":\"<p>Skj\\u00f8lberg S\\u00f8ndre er en biodynamisk kretsl\\u00f8psg\\u00e5rd som drives av Elin \\u00d6stlund og Carl Erik Skj\\u00f8lberg. Her arbeider de med jordbrukskulturer hvor mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale. \\u00c5 plukke rene, \\u00e6rlige gr\\u00f8nnsaker og urter med egne hender er et h\\u00f8ydepunkt for oss som kokker, og vi setter sv\\u00e6rt stor pris p\\u00e5 kunnskapen som Skj\\u00f8lberg S\\u00f8ndre viser oss om agro-\\u00f8kologisk jordbruk.<\\/p>\"}},\"113\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"110\"]}},\"114\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Fannremsg\\u00e5rden, Orkdal\",\"standardBodyText\":\"<p>Credo jobber sv\\u00e6rt tett med historiker og g\\u00e5rdbruker Jon Fredrik Skauge. Blant flere r\\u00e5varer henter vi ukentlig nykinnet sm\\u00f8r, fersk melk, r\\u00f8mme og kj\\u00f8tt \\u2013 alt fra g\\u00e5rdens sidete Tr\\u00f8nderfe. De ulike sesongene gir r\\u00e5varer som endrer smak hele tiden, til v\\u00e5r store begeistring.<\\/p>\"}}},\"19\":\"1\",\"18\":\"1\"}}', '2018-01-10 09:37:33', '2018-01-10 09:37:33', '8dc1fa79-05b4-4f39-9820-6c0d4720b035'),
 ('168', '16', '4', '1', 'no', '12', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"102\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Credos hjerte ligger der r\\u00e5varene produseres.\",\"standardImages\":[\"82\"],\"standardBodyText\":\"<p>P\\u00e5 Credo skal du f\\u00e5 mat laget p\\u00e5 r\\u00e5varer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert p\\u00e5 m\\u00e5ter der smak og b\\u00e6rekraft er viktige elementer.<br><\\/p>\"}},\"103\":{\"modified\":\"1\",\"type\":\"textQuote\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"81\"],\"standardBodyText\":\"<p>Credo \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. &nbsp;<\\/p>\",\"standardSubHeading\":\"\"}},\"104\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"98\"],\"standardBodyText\":\"<p>Credo \\u00f8nsker \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert, fra dag til dag. Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<br><\\/p>\\r\\n<p>Med n\\u00e6r kontakt til produsentene v\\u00e5re og med en etisk tiln\\u00e6rming til det vi gj\\u00f8r, s\\u00f8ker vi kontinuerlig utvikling mot b\\u00e6rekraft. Vi tror veldig p\\u00e5 at dette gjenspeiler seg i smak. <br><\\/p>\",\"settingImagePosition\":\"left\"}},\"105\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"99\"]}},\"106\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>R\\u00e5varene er motivasjonen v\\u00e5r. Hvorfor skulle vi ellers betale 260 kroner per kilo sm\\u00f8r? Med rent h\\u00e5ndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, p\\u00e5 gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, m\\u00e5nen, sj\\u00f8en, kroppen.<br><\\/p>\\r\\n<p>Vi tar deg n\\u00e6rt til smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 integrere deg og kretsl\\u00f8pene som g\\u00e5rdene v\\u00e5re representerer, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er p\\u00e5.<\\/p>\",\"settingImagePosition\":\"right\"}},\"107\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Heidi\",\"standardImages\":[\"127\"],\"standardBodyText\":\"<p>Heidi Bjerkan (1970) er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1997.<\\/p>\"}},\"108\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi Bjerkan vokste opp i Trondheim og i b\\u00e5ten til bestefaren p\\u00e5 Garten - tr\\u00f8ndelagskysten. Her knyttet hun sterke b\\u00e5nd til jord og vann, som siden er \\u00e5 se i hennes matlaging. For Heidi Bjerkan er det b\\u00f8ndene som er heltene, og det er produsentene som skal skinne. Gjennom m\\u00e5ltidet p\\u00e5 Credo tar hun med alle gjestene p\\u00e5 hennes tur gjennom g\\u00e5rdene, sj\\u00f8en og skogen der r\\u00e5varene kommer fra.<br><\\/p>\\r\\n<p>Heidi Bjerkan engasjerer seg for mer kunnskap, for bedre landbruk og for st\\u00f8rre interesse for tradisjoner, og Heidi Bjerkan fikk i \\u00e5r Matprisen for sitt engasjement for bedre mat og et bedre landbruk. <\\/p>\",\"settingImagePosition\":\"left\"}},\"111\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"125\"]}},\"112\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"standardBodyText\":\"<p>Skj\\u00f8lberg S\\u00f8ndre er en biodynamisk kretsl\\u00f8psg\\u00e5rd som drives av Elin \\u00d6stlund og Carl Erik Skj\\u00f8lberg. Her arbeider de med jordbrukskulturer hvor mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale. \\u00c5 plukke rene, \\u00e6rlige gr\\u00f8nnsaker og urter med egne hender er et h\\u00f8ydepunkt for oss som kokker, og vi setter sv\\u00e6rt stor pris p\\u00e5 kunnskapen som Skj\\u00f8lberg S\\u00f8ndre viser oss om agro-\\u00f8kologisk jordbruk.<\\/p>\"}},\"113\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"110\"]}},\"114\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Fannremsg\\u00e5rden, Orkdal\",\"standardBodyText\":\"<p>Credo jobber sv\\u00e6rt tett med historiker og g\\u00e5rdbruker Jon Fredrik Skauge. Blant flere r\\u00e5varer henter vi ukentlig nykinnet sm\\u00f8r, fersk melk, r\\u00f8mme og kj\\u00f8tt \\u2013 alt fra g\\u00e5rdens sidete Tr\\u00f8nderfe. De ulike sesongene gir r\\u00e5varer som endrer smak hele tiden, til v\\u00e5r store beg