 ('324', '8', '4', '1', 'no', '17', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Finnes\",\"slug\":\"finnes\",\"postDate\":1505469180,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":{\"179\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Velkommen til oss\",\"standardImages\":[\"209\"],\"standardBodyText\":\"<p>Innkvartert i Lillebys historiske gamle barnehjem er Finnes Kafe det siste kulinariske tillegget til Heidi Bjerkans voksende spisestue.<\\/p>\",\"settingTextWhiteBox\":\"\"}},\"133\":{\"modified\":\"1\",\"type\":\"introWithOpeningHours\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardImages\":\"\",\"standardHeading\":\"\",\"standardBodyText\":\"\"}},\"228\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"226\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"229\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"217\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}},\"230\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"222\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Finnes\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Finnes\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-08-08 07:35:58', '2018-08-08 07:35:58', '64ce9264-c07b-45b7-a1b5-f60bce829488'),
 ('326', '90', '3', '66', 'no', '5', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"slug\":\"skjolberg-sondre\",\"postDate\":1513339680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"98\"],\"10\":\"<p>Gr\\u00f8nnsaker og andre spiselige vekster, and, andeegg, kj\\u00f8tt av \\\"utegris\\\", storfe, lam og ferskmelk.\\r\\n  <\\/p>\",\"3\":{\"91\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"125\"],\"standardBodyText\":\"<p>Det er gr\\u00f8nt overalt, vanligvis skeptiske og dystre byfolk blir overrasket n\\u00e5r de kommer hit og ser alt det som gror i skr\\u00e5ningen p\\u00e5 Svorkmo.&nbsp;\\r\\n  <\\/p>\\r\\n<p>Bakken ligger i Orkdal, inntil n\\u00e5 mest kjent for sin elv som deler sitt navn med den st\\u00f8rste produsenten av bearbeidede matvarer i Norge.\\r\\n  <\\/p>\\r\\n<p>Grunnen til at dette gr\\u00f8nne paradiset finnes er p\\u00e5 grunn av Elin og Carl Erik \\u00d6stlunds utrettelige arbeid og ren viljestyrke.<\\/p>\",\"settingImagePosition\":\"left\"}},\"new0\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"270\"],\"standardBodyText\":\"<p>Det er flere enn f\\u00e5 som har ristet p\\u00e5 hodet av m\\u00e5ten Elin og Carl Erik jobber p\\u00e5. Det er ikke mulig \\u00e5 dyrke de planter dere \\u00f8nsker her, ikke p\\u00e5 den m\\u00e5ten dere dr\\u00f8mmer om uansett, sier de.\\r\\n  Elin og Carl Erik arbeider etter biodynamiske prinsipper, og for dem er jorden alt. Den m\\u00e5 v\\u00e6re sunn og full av liv. P\\u00e5 Skj\\u00f8lberg S\\u00f8ndre hadde ikke jorda v\\u00e6rt i drift p\\u00e5 femten \\u00e5r, s\\u00e5 de har over tid m\\u00e5tte pleie jordsmonnet tilbake til liv.<\\/p>\",\"settingImagePosition\":\"right\"}},\"new1\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"274\"],\"standardBodyText\":\"<p>P\\u00e5 Skj\\u00f8lberg S\\u00f8ndre produseres det blant annet rotgr\\u00f8nnsaker, k\\u00e5l og neper av ulike variasjoner, agurker, epleagurker, spiselige vekster og urter. P\\u00e5 g\\u00e5rden har de ogs\\u00e5 den gamle kurasen \\\"Sidet Tr\\u00f8nder\\\" og \\\"Gammel Norsk Sp\\u00e6lsau\\\". Dyrene lever i harmoni med g\\u00e5rdens kretsl\\u00f8psfilosofi, og er en viktig bidragsyter til g\\u00e5rdens kretsl\\u00f8p.<\\/p>\",\"settingImagePosition\":\"left\"}},\"new3\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"120\"],\"standardBodyText\":\"<p>Kompostering er ogs\\u00e5 en stor del av kretsl\\u00f8pet til g\\u00e5rden, og alle gr\\u00f8nnsaksrester fra Credo Restaurant blir omgjort til kompost i fraukjelleren p\\u00e5 Skj\\u00f8lberg S\\u00f8ndre. Denne operasjonen er holistisk, og de beholder og gjenbruker s\\u00e5 mye som overhodet mulig. I de senere \\u00e5r har de ogs\\u00e5 begynt \\u00e5 dyrke mikrogr\\u00f8nt i jordkjelleren.&nbsp;<\\/p>\",\"settingImagePosition\":\"right\"}},\"new2\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"271\"],\"standardBodyText\":\"<p>Mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale i Skj\\u00f8lberg S\\u00f8ndre sitt arbeid, og det&nbsp;\\u00e5 plukke rene, \\u00e6rlige gr\\u00f8nnsaker og urter med egne hender er et h\\u00f8ydepunkt for oss som restaurant. Vi setter sv\\u00e6rt stor pris p\\u00e5 kunnskapen som Skj\\u00f8lberg S\\u00f8ndre viser oss om agro-\\u00f8kologisk jordbruk, og sammen pusher vi grensen for hva som er mulig \\u00e5 dyrke p\\u00e5 Svorkmo<br><\\/p>\\r\\n<p><a href=\\\"http:\\/\\/www.skjolbergsondre.no\\/\\\">www.skjolbergsondre.no<\\/a>\\r\\n  <\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Skj\\u00f8lberg S\\u00f8ndre er en biodynamisk kretsl\\u00f8psg\\u00e5rd som drives av Elin \\u00d6stlund og Carl Erik Skj\\u00f8lberg.\\u00a0\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"125\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-14 15:05:47', '2018-08-14 15:05:47', '4f64fc51-32ce-417e-973b-77b3a8e99217'),
 ('327', '94', '3', '66', 'no', '3', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Fannremsg\\u00e5rden, Orkdal\",\"slug\":\"fannremsgarden\",\"postDate\":1513339800,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"92\"],\"10\":\"<p>Melk, r\\u00f8mme, sm\\u00f8r, storfe&nbsp;av historisk omfang&nbsp;p\\u00e5 Fannremsg\\u00e5rden.<br><\\/p>\",\"3\":{\"95\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"279\"],\"standardBodyText\":\"<p>Mitt fag og h\\u00e5ndverk er egentlig tekstil. Historiske kl\\u00e6r, tekstiler og tradisjoner, men melk og sm\\u00f8r, det er en stor del av den samme g\\u00e5rdskulturen. G\\u00e5rden er min arv, den har v\\u00e6rt i min familie i \\u00e5rhundrer.&nbsp;<\\/p>\\r\\n<p>- Jon Fredrik Skauge<\\/p>\",\"settingImagePosition\":\"left\"}},\"new0\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"93\"],\"standardBodyText\":\"<p>Jon Fredrik har syv kyr, den samme typen storfe som var vanlig i dette omr\\u00e5det f\\u00f8r den mer produktive NRF (Norsk R\\u00f8dt Fe) kom som resultat av modernisering. Sidet Tr\\u00f8nder er ikke en veldig kjent kurase n\\u00e5 om dagen, men hvis du forestiller deg en ku som er mindre enn en moderne ku, nesten p\\u00e5 st\\u00f8rrelse med en Grand Danoise, bare kraftigere, er du p\\u00e5 rett spor. Disse kyrene, valgt bort tidlig under effektiviseringen av landbruket, produserer ikke den gjennomsnittlige 10.000 liter melk som NRF, de melker mer i de lave tresifrede tallene - men for Jon Fredrik er ikke dette et problem.&nbsp;<\\/p>\\r\\n<p>-&nbsp;Det er ikke mengden vi ser etter, sier han med et smil.<\\/p>\",\"settingImagePosition\":\"right\"}},\"new1\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"282\"],\"standardBodyText\":\"<p>Tilbake til sm\\u00f8rformen, som et objekt av vellyst, er det plassert p\\u00e5 midten av bordet akkurat som noen man tilber. Sm\\u00f8r har alltid v\\u00e6rt sentrum for oppmerksomheten, og gullfargen er bevis p\\u00e5 verdien, verdien av melkefett. I mange \\u00e5r var sm\\u00f8r den viktigste (og noen ganger eneste) inntekt for b\\u00f8nder. De solgte sm\\u00f8ret og beholdt skummetmelken og kjernemelken til eget bruk.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}},\"new2\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"280\"],\"standardBodyText\":\"<p>Jon Fredrik leverer mesteparten av sin melk til Credo Restaurant, resten bruker han til sine gjester, ettersom Fannremsg\\u00e5rden har mange bes\\u00f8kende som er interessert i tradisjonelt h\\u00e5ndverk og g\\u00e5rdskultur. Hus, holdt i stand akkurat slik hans besteforeldre hadde det, er fylt opp med flere kulturskatter enn gjennomsnittlig folkemuseum.&nbsp;<\\/p>\",\"settingImagePosition\":\"right\"}},\"new3\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"281\"],\"standardBodyText\":\"<p>Fannremsg\\u00e5rden ligger i Orkanger, i et typisk indre klima. Jorden er basert p\\u00e5 sand og moll, perfekte forhold for avlinger og gress. Og v\\u00e6ret?&nbsp;<br>Solen skinner alltid, n\\u00e5r jeg er hjemme, sier Jon Fredrik.&nbsp;<\\/p>\\r\\n<p>I tillegg til \\\"Sidet Tr\\u00f8nderfe\\\" som produserer melk, og etter etter livets l\\u00f8p, kj\\u00f8tt, har Jon Fredrik ogs\\u00e5 h\\u00f8ner for egg, og hester til fritid. Du kan bes\\u00f8ke han for \\u00e5 pr\\u00f8ve ut alle hans produkter, og kj\\u00f8pe tradisjonelle h\\u00e5ndverksprodukter i den lille butikken. Sm\\u00f8ret alene er verdt turen. Men for \\u00e5 f\\u00e5 den aller beste smaken av Jon Fredriks sm\\u00f8r, lukk \\u00f8ynene dine og husk potetkaken servert hos oss p\\u00e5 Credo.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Fannremsg\\u00e5rden, Orkdal\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Sm\\u00e5kk\\u00e5 p\\u00e5 historien p\\u00e5 Fannremsg\\u00e5rden.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"92\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-14 15:28:34', '2018-08-14 15:28:34', '2c8033ae-55dd-475e-a7b8-3819efd7d527'),
 ('328', '94', '3', '66', 'no', '4', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Fannremsg\\u00e5rden, Orkdal\",\"slug\":\"fannremsgarden\",\"postDate\":1513339800,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"92\"],\"10\":\"<p>Melk, r\\u00f8mme, sm\\u00f8r og&nbsp;storfe&nbsp;av historisk omfang&nbsp;p\\u00e5 Fannremsg\\u00e5rden.<br><\\/p>\",\"3\":{\"95\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"279\"],\"standardBodyText\":\"<p>Mitt fag og h\\u00e5ndverk er egentlig tekstil. Historiske kl\\u00e6r, tekstiler og tradisjoner, men melk og sm\\u00f8r, det er en stor del av den samme g\\u00e5rdskulturen. G\\u00e5rden er min arv, den har v\\u00e6rt i min familie i \\u00e5rhundrer.&nbsp;<\\/p>\\r\\n<p>- Jon Fredrik Skauge<\\/p>\",\"settingImagePosition\":\"left\"}},\"283\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"93\"],\"standardBodyText\":\"<p>Jon Fredrik har syv kyr, den samme typen storfe som var vanlig i dette omr\\u00e5det f\\u00f8r den mer produktive NRF (Norsk R\\u00f8dt Fe) kom som resultat av modernisering. Sidet Tr\\u00f8nder er ikke en veldig kjent kurase n\\u00e5 om dagen, men hvis du forestiller deg en ku som er mindre enn en moderne ku, nesten p\\u00e5 st\\u00f8rrelse med en Grand Danoise, bare kraftigere, er du p\\u00e5 rett spor. Disse kyrene, valgt bort tidlig under effektiviseringen av landbruket, produserer ikke den gjennomsnittlige 10.000 liter melk som NRF, de melker mer i de lave tresifrede tallene - men for Jon Fredrik er ikke dette et problem.&nbsp;<\\/p>\\r\\n<p>-&nbsp;Det er ikke mengden vi ser etter, sier han med et smil.<\\/p>\",\"settingImagePosition\":\"right\"}},\"284\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"282\"],\"standardBodyText\":\"<p>Tilbake til sm\\u00f8rformen, som et objekt av vellyst, er det plassert p\\u00e5 midten av bordet akkurat som noen man tilber. Sm\\u00f8r har alltid v\\u00e6rt sentrum for oppmerksomheten, og gullfargen er bevis p\\u00e5 verdien, verdien av melkefett. I mange \\u00e5r var sm\\u00f8r den viktigste (og noen ganger eneste) inntekt for b\\u00f8nder. De solgte sm\\u00f8ret og beholdt skummetmelken og kjernemelken til eget bruk.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}},\"285\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"280\"],\"standardBodyText\":\"<p>Jon Fredrik leverer mesteparten av sin melk til Credo Restaurant, resten bruker han til sine gjester, ettersom Fannremsg\\u00e5rden har mange bes\\u00f8kende som er interessert i tradisjonelt h\\u00e5ndverk og g\\u00e5rdskultur. Hus, holdt i stand akkurat slik hans besteforeldre hadde det, er fylt opp med flere kulturskatter enn gjennomsnittlig folkemuseum.&nbsp;<\\/p>\",\"settingImagePosition\":\"right\"}},\"286\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"281\"],\"standardBodyText\":\"<p>Fannremsg\\u00e5rden ligger i Orkanger, i et typisk indre klima. Jorden er basert p\\u00e5 sand og moll, perfekte forhold for avlinger og gress. Og v\\u00e6ret?&nbsp;<br>Solen skinner alltid, n\\u00e5r jeg er hjemme, sier Jon Fredrik.&nbsp;<\\/p>\\r\\n<p>I tillegg til \\\"Sidet Tr\\u00f8nderfe\\\" som produserer melk, og etter etter livets l\\u00f8p, kj\\u00f8tt, har Jon Fredrik ogs\\u00e5 h\\u00f8ner for egg, og hester til fritid. Du kan bes\\u00f8ke han for \\u00e5 pr\\u00f8ve ut alle hans produkter, og kj\\u00f8pe tradisjonelle h\\u00e5ndverksprodukter i den lille butikken. Sm\\u00f8ret alene er verdt turen. Men for \\u00e5 f\\u00e5 den aller beste smaken av Jon Fredriks sm\\u00f8r, lukk \\u00f8ynene dine og husk potetkaken servert hos oss p\\u00e5 Credo.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Fannremsg\\u00e5rden, Orkdal\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Sm\\u00e5kk\\u00e5 p\\u00e5 historien p\\u00e5 Fannremsg\\u00e5rden.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"92\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-14 15:29:38', '2018-08-14 15:29:38', 'c4ce99d7-be0d-4cdf-ac6a-643dc1189ad5'),
