otetkaken servert hos oss p\\u00e5 Credo.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Fannremsg\\u00e5rden, Orkdal\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Sm\\u00e5kk\\u00e5 p\\u00e5 historien p\\u00e5 Fannremsg\\u00e5rden.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"92\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-14 15:29:59', '2018-08-14 15:29:59', '70b26e29-c670-4fdf-86c0-43ef13f3ed6a'),
 ('330', '171', '3', '66', 'no', '4', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Heidi Bjerkan\",\"slug\":\"heidi\",\"postDate\":1515583680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"174\"],\"10\":\"<p>Heidi Bjerkan er en norsk kokk og kj\\u00f8kkensjef. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.&nbsp;I dag driver hun mat-triangelen Credo Restaurant, Jossa mat og drikke og Finnes Kaf\\u00e9 p\\u00e5 Lilleby, Trondheim. Hun er ogs\\u00e5 initiativtaker og eier av&nbsp;Vippa i Oslo, en mathall med visjon om \\u00e5 samle kulturer.<\\/p>\",\"3\":{\"172\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi vokste opp i Trondheim og i b\\u00e5ten til bestefaren p\\u00e5 Garten langs Tr\\u00f8ndelagskysten. Her knyttet hun sterke b\\u00e5nd til jord og vann, som siden er \\u00e5 se i hennes matlaging.&nbsp;<\\/p><p>Bjerkan sin karriere innenfor kokkeyrket startet allerede som&nbsp;atten\\u00e5ring da hun begynte sin sommerjobb&nbsp;p\\u00e5 \\u00d8stbanekafeen. Der forstod hun raskt&nbsp;at hun&nbsp;ville jobbe med mat. Det h\\u00f8ye tempoet et kj\\u00f8kken inneb\\u00e6rer var til stor begeistring for Bjerkan, som er rastl\\u00f8s av natur.&nbsp;<span><\\/span><\\/p>\",\"settingImagePosition\":\"left\"}},\"new0\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"127\"],\"standardBodyText\":\"<p>Bjerkan er omtalt som en h\\u00f8yt respektert kokk med en kompromissl\\u00f8s, engasjert og grundig visjon om fruktbart land, r\\u00e5varenes ubenyttede ressurser og framtidens bonde.&nbsp;<\\/p><p>Bjerkan har alltid v\\u00e6rt opptatt av \\u00e5 jobbe b\\u00e6rekraftig, noe som gjenspeiler seg i kvaliteten Credo st\\u00e5r for. Med sterk interesse og dedikert ansvar, har Bjerkan i senere tid rekonstruert og utvidet hvordan drive restaurant med et ideal om at n\\u00e6ringen kan livsgi lokale b\\u00f8nder i et voksende kommersialisert landbruk. De tette samarbeidene med g\\u00e5rdene Skj\\u00f8lberg S\\u00f8ndre og Fannremsg\\u00e5rden er eksempler p\\u00e5 hvordan Credo \\u00f8nsker \\u00e5 bringe de lokale b\\u00f8ndenes h\\u00e5ndarbeid fram.<\\/p>\\r\\n<p><\\/p>\",\"settingImagePosition\":\"right\"}},\"new1\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"],\"standardBodyText\":\"<p>For Heidi er det b\\u00f8ndene som er heltene, og det er produsentene som skal skinne. Gjennom m\\u00e5ltidet p\\u00e5 Credo tar hun med gjesten&nbsp;p\\u00e5 hennes tur gjennom g\\u00e5rdene, sj\\u00f8en og skogen der r\\u00e5varene kommer fra.<\\/p><p>Heidi Bjerkan fikk i 2017 b\\u00e5de Ingridprisen og&nbsp;Matprisen for sitt engasjement for bedre mat og et bedre landbruk.<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Heidi\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Heidi Bjerkan er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"174\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-14 15:49:53', '2018-08-14 15:49:53', '2ba1432b-ed93-4460-b451-c97ce5caccd2'),
 ('331', '171', '3', '66', 'no', '5', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Heidi Bjerkan\",\"slug\":\"heidi\",\"postDate\":1515583680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"174\"],\"10\":\"<p>Heidi Bjerkan er en norsk kokk og kj\\u00f8kkensjef. I dag driver hun mat-triangelen Credo Restaurant, Jossa mat og drikke og Finnes Kaf\\u00e9 p\\u00e5 Lilleby, Trondheim.<\\/p>\",\"3\":{\"172\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi vokste opp i Trondheim og i b\\u00e5ten til bestefaren p\\u00e5 Garten langs Tr\\u00f8ndelagskysten. Her knyttet hun sterke b\\u00e5nd til jord og vann, som siden er \\u00e5 se i hennes matlaging.&nbsp;<\\/p>\\r\\n<p>Bjerkan sin karriere innenfor kokkeyrket startet allerede som&nbsp;atten\\u00e5ring da hun begynte sin sommerjobb&nbsp;p\\u00e5 \\u00d8stbanekafeen. Der forstod hun raskt&nbsp;at hun&nbsp;ville jobbe med mat. Det h\\u00f8ye tempoet et kj\\u00f8kken inneb\\u00e6rer var til stor begeistring for Bjerkan, som er rastl\\u00f8s av natur.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}},\"287\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"127\"],\"standardBodyText\":\"<p>Bjerkan er omtalt som en h\\u00f8yt respektert kokk med en kompromissl\\u00f8s, engasjert og grundig visjon om fruktbart land, r\\u00e5varenes ubenyttede ressurser og framtidens bonde.&nbsp;<\\/p>\\r\\n<p>Bjerkan har alltid v\\u00e6rt opptatt av \\u00e5 jobbe b\\u00e6rekraftig, noe som gjenspeiler seg i kvaliteten Credo st\\u00e5r for. Med sterk interesse og dedikert ansvar, har Bjerkan i senere tid rekonstruert og utvidet hvordan drive restaurant med et ideal om at n\\u00e6ringen kan livsgi lokale b\\u00f8nder i et voksende kommersialisert landbruk. De tette samarbeidene med g\\u00e5rdene Skj\\u00f8lberg S\\u00f8ndre og Fannremsg\\u00e5rden er eksempler p\\u00e5 hvordan Credo \\u00f8nsker \\u00e5 bringe de lokale b\\u00f8ndenes h\\u00e5ndarbeid fram.<\\/p>\",\"settingImagePosition\":\"right\"}},\"288\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"],\"standardBodyText\":\"<p>For Heidi er det b\\u00f8ndene som er heltene, og det er produsentene som skal skinne. Gjennom m\\u00e5ltidet p\\u00e5 Credo tar hun med gjesten&nbsp;p\\u00e5 hennes tur gjennom g\\u00e5rdene, sj\\u00f8en og skogen der r\\u00e5varene kommer fra.<\\/p>\\r\\n<p>Heidi Bjerkan fikk i 2017 b\\u00e5de Ingridprisen og&nbsp;Matprisen for sitt engasjement for bedre mat og et bedre landbruk.<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Heidi\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Heidi Bjerkan er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"174\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-14 15:51:05', '2018-08-14 15:51:05', 'bd211ab3-aa7b-49e5-b578-d6cb33006813'),
 ('332', '16', '4', '66', 'no', '20', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"102\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Credos hjerte ligger der r\\u00e5varene produseres.\",\"standardImages\":[\"175\"],\"standardBodyText\":\"<p>P\\u00e5 Credo skal du f\\u00e5 mat laget p\\u00e5 r\\u00e5varer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert p\\u00e5 m\\u00e5ter der smak og b\\u00e6rekraft er viktige elementer.<br><\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"103\":{\"modified\":\"1\",\"type\":\"textQuote\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"81\"],\"standardBodyText\":\"<p>Credo \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. &nbsp;<\\/p>\",\"standardSubHeading\":\"\"}},\"new0\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>Det viktigste her p\\u00e5 Credo er r\\u00e5varene. N\\u00e5r vi snakker om smak, s\\u00e5 tenker vi p\\u00e5 muligheten en r\\u00e5vare gir. Hva smaker en gulrot, hva smaker denne gulroten? Hvordan kan vi bruke den, og hvordan endrer smaken seg over tid? Kan den fermenteres, kan den r\\u00f8ykes, eller skal vi gj\\u00f8re begge deler?&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}},\"104\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"96\"],\"standardBodyText\":\"<p>P\\u00e5 Credo er vi underordnet den opprinnelig smak, smakene som er stedsbestemt. Vi trenger tilgang p\\u00e5 de beste r\\u00e5varene, og&nbsp;derfor leter vi etter smaker, smaken som kommer fra en g\\u00e5rd, en g\\u00e5rdbruker eller et jordsmonn, for&nbsp;det er de sm\\u00e5 forskjellene som gir de gode gr\\u00f8nnsakene.&nbsp;<\\/p><p>Credo \\u00f8nsker \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert, fra dag til dag.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}},\"106\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"200\"],\"standardBodyText\":\"<p>Med n\\u00e6r kontakt til produsentene v\\u00e5re og med en etisk tiln\\u00e6rming til det vi gj\\u00f8r, s\\u00f8ker vi kontinuerlig utvikling mot b\\u00e6rekraft. Vi tror p\\u00e5 at dette gjenspeiler seg i smak.&nbsp;R\\u00e5varene er motivasjonen, og&nbsp;med rent h\\u00e5ndverk kan vi utfolde oss med en oppmerksomhet rettet utad. Vi tror at enhver komponent er gjeldende - dyrene, skogen, jorden, m\\u00e5nen, sj\\u00f8en og kroppen.<\\/p><p>P\\u00e5 Credo feirer vi dette mangfoldet. Vi feirer h\\u00f8ydementer, t\\u00e5ke, sol og regn i st\\u00f8rre og mindre mengder. P\\u00e5 Credo feirer vi smaken av stedet.&nbsp;<\\/p>\",\"settingImagePosition\":\"right\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Om oss\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Om oss\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-08-14 16:29:49', '2018-08-14 16:29:49', 'd5b091e3-5d4a-4bae-8ade-b802df2376f7'),
 ('333', '16', '4', '66', 'no', '21', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"102\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Credos hjerte ligger der r\\u00e5varene produseres.\",\"standardImages\":[\"175\"],\"standardBodyText\":\"<p>P\\u00e5 Credo skal du f\\u00e5 mat laget p\\u00e5 r\\u00e5varer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert p\\u00e5 m\\u00e5ter der smak og b\\u00e6rekraft er viktige elementer.<br><\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"289\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>Det viktigste her p\\u00e5 Credo er r\\u00e5varene. N\\u00e5r vi snakker om smak, s\\u00e5 tenker vi p\\u00e5 muligheten en r\\u00e5vare gir. Hva smaker en gulrot, hva smaker denne gulroten? Hvordan kan vi bruke den, og hvordan endrer smaken seg over tid? Kan den fermenteres, kan den r\\u00f8ykes, eller skal vi gj\\u00f8re begge deler?&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}},\"104\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"291\"],\"standardBodyText\":\"<p>P\\u00e5 Credo er vi underordnet den opprinnelig smak, smakene som er stedsbestemt. Vi trenger tilgang p\\u00e5 de beste r\\u00e5varene, og&nbsp;derfor leter vi etter smaker, smaken som kommer fra en g\\u00e5rd, en g\\u00e5rdbruker eller et jordsmonn, for&nbsp;det er de sm\\u00e5 forskjellene som gir de gode gr\\u00f8nnsakene.&nbsp;<\\/p>\\r\\n<p>Credo \\u00f8nsker \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert, fra dag til dag.&nbsp;<\\/p>\",\"settingImagePosition\":\"right\"}},\"106\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"292\"],\"standardBodyText\":\"<p>Med n\\u00e6r kontakt til produsentene v\\u00e5re og med en etisk tiln\\u00e6rming til det vi gj\\u00f8r, s\\u00f8ker vi kontinuerlig utvikling mot b\\u00e6rekraft. Vi tror p\\u00e5 at dette gjenspeiler seg i smak.&nbsp;R\\u00e5varene er motivasjonen, og&nbsp;med rent h\\u00e5ndverk kan vi utfolde oss med en oppmerksomhet rettet utad. Vi tror at enhver komponent er gjeldende - dyrene, skogen, jorden, m\\u00e5nen, sj\\u00f8en og kroppen.<\\/p>\\r\\n<p>P\\u00e5 Credo feirer vi dette mangfoldet. Vi feirer h\\u00f8ydementer, t\\u00e5ke, sol og regn i st\\u00f8rre og mindre mengder. P\\u00e5 Credo feirer vi smaken av stedet.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Om oss\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Om oss\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-08-14 16:40:05', '2018-08-14 16:40:05', '1f973bf5-8d99-4748-9d2f-f3d7196b5157'),
