 ('354', '226', '3', '50', 'no', '2', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Fossan Br\\u00f8d\",\"slug\":\"fossan-brod\",\"postDate\":1515600180,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"5\"],\"4\":[\"224\"],\"10\":\"<p>Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.&nbsp;<\\/p>\",\"3\":{\"227\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Den ble til da selve turbinen m\\u00f8llen best\\u00e5r av, ble fraktet med jernbane til Hegra, og&nbsp;deretter med hest og vogn opp til Skjelstadmarka. I dag driftes Fossan M\\u00f8lle av Petter Fossan,&nbsp;og matmel blir fortsatt malt i denne gamle m\\u00f8lla. Finnes Kaf\\u00e9 \\u00f8nsker \\u00e5 sette lys p\\u00e5 denne gamle perlen, og til v\\u00e5r store begeistring f\\u00e5r vi oppdage melet i br\\u00f8dbaksten v\\u00e5r. Vi har utforsket med ulike melsorter fra Fossan M\\u00f8lle, og eksperimentene har resultert i et eget \\u201dFossan Br\\u00f8d\\u201d som er til salgs i kafeen!<\\/p>\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Fossan Br\\u00f8d\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"224\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:37:36', '2018-08-15 09:37:36', 'f5509acf-aa21-4e78-b121-199c1fca05a7'),
 ('355', '222', '3', '50', 'no', '3', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Finnes bakeri\",\"slug\":\"finnes-bakeri\",\"postDate\":1515600000,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"5\"],\"4\":[\"221\"],\"10\":\"<p>Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Br\\u00f8d Surdeigsbakeri* startet vi opp et lite h\\u00e5ndtverksbakeri p\\u00e5 Finnes Kaf\\u00e9 i September 2017.&nbsp;<\\/p>\",\"3\":{\"223\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"220\"],\"standardBodyText\":\"<p>Bakeriet har fokus p\\u00e5 naturlig hevet br\\u00f8d \\u2013 SURDEIGSBR\\u00d8D \\u2013 og br\\u00f8dene er utelukkende laget p\\u00e5 norsk mel og kornarter. Spelt, Havre, Emmer, og r\\u00f8kt bygg er bare noen alternativer som er \\u00e5 f\\u00e5 p\\u00e5 kafeen.<\\/p>\\r\\n<p>&nbsp;*Ille Br\\u00f8d Surdeigsbakeri (<a href=\\\"https:\\/\\/www.facebook.com\\/illebrod\\/)\\\">https:\\/\\/www.facebook.com\\/illebrod\\/)<\\/a> er et surdeigsbakeri lokalisert i Oslo. De lager naturlig hevet br\\u00f8d og tar utelukkende i bruk lokalt dyrket mel og urkorn. Bakeriet holder til i Lakkegata 53, Oslo, og vi anbefaler hele Oslos befolkning, og alle tilreisende \\u00e5 ta turen innom bakeriet for en smak av byens beste br\\u00f8d!<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Finnes bakeri\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Br\\u00f8d Surdeigsbakeri* startet vi opp et lite h\\u00e5ndtverksbakeri p\\u00e5 Finnes\\u2026\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"221\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:37:58', '2018-08-15 09:37:58', 'f0d7a1e9-e600-4a3e-96ba-4d7eb8ed4aaf'),
 ('356', '217', '3', '50', 'no', '2', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Gr\\u00f8nne omgivelser \",\"slug\":\"gronne-omgivelser\",\"postDate\":1515599760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"5\"],\"4\":[\"216\"],\"10\":\"<p>Vel i hus p\\u00e5 Finnes Kaf\\u00e9 s\\u00e5 blomstrer det for fullt i parsellhagen p\\u00e5 Lilleby.&nbsp;<br><\\/p>\",\"3\":{\"218\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Friske urter, nydelige blomster og nyttevekster som folk flest bare kan dr\\u00f8mme om er lett tilgjengelig like utenfor d\\u00f8ra \\u2013 For en LUKSUS!<\\/p>\\r\\n<p>Lilleby Hagelag, i samarbeid med kretsl\\u00f8psg\\u00e5rden Skj\\u00f8lberg S\\u00f8ndre holder hagen i sjakk, og til v\\u00e5r forn\\u00f8yelse s\\u00f8rger de for friske og gr\\u00f8nne omgivelser rundt Finnes Kaf\\u00e9, Jossa mat & drikke og Credo Restaurant.<\\/p>\\r\\n<p>Alle som \\u00f8nsker kan bli med i Lilleby Hagelag, og for mer informasjon, ta kontakt p\\u00e5 <a href=\\\"mailto:post@lillebyhagelag.no\\\">post@lillebyhagelag.no<\\/a><\\/p>\\r\\n<p>&nbsp;\\r\\n  <\\/p>\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Gr\\u00f8nne omgivelser \",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Vel i hus p\\u00e5 Finnes Kaf\\u00e9 s\\u00e5 blomstrer det for fullt i parsellhagen p\\u00e5 Lilleby.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"216\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSource