 ('359', '211', '3', '50', 'en', '1', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Jossa til Mexico\",\"slug\":\"viva-mexico\",\"postDate\":1515599340,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"210\"],\"10\":\"<p>Etter et lengre opphold p\\u00e5 hjemmebane, hvor Jossa har nytt godt av b\\u00e5de sild, svinekj\\u00f8tt og akevitt, pakker Jossa kofferten og sikter mot varmere str\\u00f8k. Jossa har savnet tropiske frukter, de eksotiske smakene og ikke minst de livlige rytmene \\u2013 Mexico, watch out!&nbsp;<\\/p>\",\"3\":\"\",\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Viva Mexico\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Etter et lengre opphold p\\u00e5 hjemmebane, hvor Jossa har nytt godt av b\\u00e5de sild, svinekj\\u00f8tt og akevitt, pakker Jossa kofferten og sikter mot varmere str\\u00f8k.\\u2026\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"210\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:39:44', '2018-08-15 09:39:44', '96cd119e-76a1-4002-ac19-89f80177a7e6'),
 ('360', '211', '3', '50', 'no', '3', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Jossa til Mexico\",\"slug\":\"viva-mexico\",\"postDate\":1515599340,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"210\"],\"10\":\"<p>Etter et lengre opphold p\\u00e5 hjemmebane, hvor Jossa har nytt godt av b\\u00e5de sild, svinekj\\u00f8tt og akevitt, pakker Jossa kofferten og sikter mot varmere str\\u00f8k. Jossa har savnet tropiske frukter, de eksotiske smakene og ikke minst de livlige rytmene \\u2013 Mexico, watch out!&nbsp;<\\/p>\",\"3\":\"\",\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Viva Mexico\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Etter et lengre opphold p\\u00e5 hjemmebane, hvor Jossa har nytt godt av b\\u00e5de sild, svinekj\\u00f8tt og akevitt, pakker Jossa kofferten og sikter mot varmere str\\u00f8k.\\u2026\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"210\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:39:56', '2018-08-15 09:39:56', 'baacdce0-ed1a-4aab-baea-b9a25d65fe6d'),
 ('361', '201', '3', '50', 'en', '1', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Lokalt grogrunnlag\",\"slug\":\"lokalt-grogrunnlag\",\"postDate\":1515593760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"200\"],\"10\":\"<p>Jossa setter seg opp i stolen, tar en slurk kaffe og tenker p\\u00e5 hva hun smakte i g\\u00e5r. Det er utvilsomt det beste i Norge sier hun h\\u00f8yt til seg selv. Men hvor g\\u00e5r egentlig grensene for smak, og hvem bestemmer hva som er godt og vondt, fortsetter hun mens koppen snart er tom. Med r\\u00e5varer fra tr\\u00f8ndelag, s\\u00e5 burde man kunne lag hva som helst, men hvem avgj\\u00f8r hva som er best akkurat her?<\\/p>\",\"3\":\"\",\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Lokalt grogrunnlag\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Jossa setter seg opp i stolen, tar en slurk kaffe og tenker p\\u00e5 hva hun smakte i g\\u00e5r. Det er utvilsomt det beste i Norge sier hun h\\u00f8yt til seg selv. Men hvor\\u2026\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"200\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:40:08', '2018-08-15 09:40:08', '3c32d34a-2ffc-4368-91a5-3478a7f48324'),
 ('362', '195', '3', '50', 'no', '2', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Jossa p\\u00e5 hjemmebane\",\"slug\":\"jossa-pa-hjemmebane\",\"postDate\":1515593400,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"194\"],\"10\":\"<p>Jossa ser utover Ripa p\\u00e5 den store b\\u00e5ten. Hun tar dype trekk av den friske lufta, helt inn. Det er som om lungene har lengtet etter den kj\\u00f8lige fuktige lufta.<\\/p>\",\"3\":{\"196\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Hun ser havnen i det fjerne, og tusler ned i kahytten.<br>\\u2013 Hjem. Jeg skal hjem en liten tur, hun smiler til seg selv og tenker p\\u00e5 hvordan hun plutselig savnet sild. Og akevitt.&nbsp;<\\/p>\\r\\n<p>Det har v\\u00e6rt en lang reise siden hun var i Bangkok, eller lille bangkokk da, gjemt inne i chinatown i london. Der hun fikk noen nye smaker, som aldri hadde v\\u00e6rt innom Trondheim, f\\u00f8r n\\u00e5. Hun klapper p\\u00e5 kofferten som er breddfull av urter, r\\u00f8tter, krydder og oppskrifter hun tar med seg hjem.<br>Men nam prik pao til side, selv om det kanskje er det beste hun hadde smakt, p\\u00e5 alt, hun er klar for sild. Og for svinekj\\u00f8tt. Hun har tenkt mye p\\u00e5 hvordan svinekj\\u00f8ttet fra nettopp tr\\u00f8ndelag vil passe til alle de thailandske smakene, som et avbrekk fra all julematen. Friskt, sterkt, morsomt.<\\/p>\\r\\n<p>Men n\\u00e5 er det r\\u00f8mme som st\\u00e5r i hodet. R\\u00f8mme p\\u00e5 vaffel, med l\\u00f8yrom. Og riskrem. Jossa klarer nesten ikke st\\u00e5 stille hun tripper opp og ned dekk mens de legger landgangen klar.<\\/p>\\r\\n<p>Hjemme, n\\u00e6rmest roper hun n\\u00e5r hun treffer brygga med foten.<\\/p>\\r\\n<p>N\\u00e5 skal det bli godt med gravet fisk.<\\/p>\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Jossa p\\u00e5 hjemmebane\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Jossa ser utover Ripa p\\u00e5 den store b\\u00e5ten. Hun tar dype trekk av den friske lufta, helt inn. Det er som om lungene har lengtet etter den kj\\u00f8lige fuktige\\u2026\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"194\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:40:35', '2018-08-15 09:40:35', '5ddcb2a0-718d-4d51-a52a-066543617cc9'),
 ('363', '192', '3', '50', 'no', '2', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Jossa til Sverige\",\"slug\":\"jossa-til-sverige\",\"postDate\":1515593280,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"191\"],\"10\":\"<p>Jossa ser nedover dalen. Hun har vandret i et par dager fra Trondheim.&nbsp;N\\u00e5 har hun endelig m\\u00f8tt Tobias, en som er kjent i dalen.<\\/p>\",\"3\":{\"193\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>\\u2013 Jaha du, s\\u00e5 du er ute etter den svenske smaken du, sier Tobias p\\u00e5 slepent svensk m\\u00e5l.<br>Jossa har spurt og gravd for \\u00e5 finne den som lager den beste maten p\\u00e5 denne siden av grensen.<\\/p>\\r\\n<p>\\u2013 S\\u00e5 de sier det ja. Hehe.&nbsp;Tobias ler mens han plukker opp noe som kan virke som en vilk\\u00e5rlig blomst fra bakken.Han smaker og smatter.<br>\\u2013 At jeg er den du skal snakke med ja.<br>Jossa smiler oppr\\u00f8mt, og nikker.&nbsp;<br>\\u2013 Den kommer herfra. Det er i jorden&nbsp;alt starter, det er der alt opprinner. S\\u00e5 vi m\\u00e5 bevege oss litt rundt.<\\/p>\\r\\n<p>De fortsetter ferden nedover, mot et forgjettet sted, mot en g\\u00e5rd som det g\\u00e5r flotte ord om rundt i hele verden.<br>\\u2013 For at du skal forst\\u00e5 hva de gj\\u00f8r akkurat der, s\\u00e5 m\\u00e5 vi nesten spise et par ting p\\u00e5 veien.<\\/p>\\r\\n<p>Tobias lister opp hva Jossa skal smake&nbsp;-Raggmunk med Vesterbotten,&nbsp;Sild med egg, poteter, rug og r\\u00f8dbeter , sild ost og sm\\u00f8r,&nbsp;Falukorv,&nbsp;Flesk, rotmos, l\\u00f8k,&nbsp;Fisk med Skagensaus.&nbsp;<br>Dette er veldig kjente smaker, men Raggmunk, det er jeg usikker p\\u00e5.<br>Han ler, mens han henter ut en potet fra sekken. Raggmunk, det er nesten det beste du kan gj\\u00f8re med poteter.<br>Men kom n\\u00e5, s\\u00e5 spiser vi. S\\u00e5 f\\u00e5r du oppskriftenen p\\u00e5 alt, som du kan ta med deg hjem igjen.<\\/p>\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Jossa til Sverige\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Jossa ser nedover dalen. Hun har vandret i et par dager fra Trondheim.\\u00a0N\\u00e5 har hun endelig m\\u00f8tt Tobias, en som er kjent i dalen.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"191\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:41:52', '2018-08-15 09:41:52', '69b2be06-5838-45fe-a220-e176ee124220'),
 ('364', '189', '3', '50', 'no', '2', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Jossa til \\u00d8sterike\",\"slug\":\"jossa-til-osterike\",\"postDate\":1515593220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"188\"],\"10\":\"<p>Jossa st\\u00e5r p\\u00e5 stasjonen med sekken full av tj\\u00e6repastiller og kandisert angelicastang, en god porsjon med isterban, en falukorv og en limpa.&nbsp;<\\/p>\",\"3\":{\"190\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Tobias har sagt farvel for kort tid siden. Han takket for selskapet, ga henne en god klem og trykket en gave ned i sekken. \\u2013 Du m\\u00e5 ikke \\u00e5pne den pakken f\\u00f8r du er fremme. Tobias s\\u00e5 p\\u00e5 Jossa og smilte.\\r\\n\\u2013 God tur, og hils til Werner.<\\/p>\\r\\n<p>Jossa klatrer om bord i toget og finner kupeen sin. Nattoget til malm\\u00f8, en behagelig m\\u00e5te \\u00e5 reise p\\u00e5, og fra Malm\\u00f8 er det ikke langt til kontinentet. Hun bryter av skalken p\\u00e5 br\\u00f8det og legger seg p\\u00e5 den oppredde senga. F\\u00f8ttene er m\\u00f8re etter all vandringen.&nbsp;Hun forsvinner inn i s\\u00f8vnen samtidig med togets startende bevegelser. Som et barn blir hun dysset i s\\u00f8vn, f\\u00f8r hun selv hadde tenkt. Det er m\\u00f8rkt, varmt og behagelig.<\\/p>\\r\\n<p>Det spraker i en h\\u00f8yttaler, plinger i en bjelle og det bankes p\\u00e5 d\\u00f8ren. Det f\\u00f8les som om det er samtidig, men hun tar det p\\u00e5 oppv\\u00e5kingsfasen, at hun har duppet av mellom lydene, bare fortrengt det litt.\\r\\nMalm\\u00f8, den kom raskere enn hun trodde, hele byen ligger der, foran henne, flat som den er.\\r\\nHun har b\\u00f8rstet av seg smulene fra br\\u00f8dskalken, skiftet, tatt en kattevask og pr\\u00f8vd \\u00e5 legge h\\u00e5ret stramt slik det s\\u00f8mmer seg, f\\u00f8r hun gikk av toget.<\\/p>\\r\\n<p>B\\u00e5ten venter, b\\u00e5ten til kontinentet st\\u00e5r i havna, noen hundre meter bortenfor stasjonen.\\r\\nFra K\\u00f8benhavn ble det tog til wien, med bytte i m\\u00fcnchen, Jossa var utmattet men merket seg at K\\u00f8benhavn var en by hun skulle utforske, men da p\\u00e5 vei hjem.<\\/p>\\r\\n<p>Brosteinen og kumlokkene, de er fine. Jossa ser ned mens hun tusler ut av stasjonsbygget i Wien.\\r\\nMen jeg er sulten. Sier hun h\\u00f8yt til seg selv, s\\u00e5 den d\\u00f8sige mannen som sto rett ved siden av i sin egen verden skvetter til og ser p\\u00e5 henne.\\r\\n\\u2013 unnskyld, sier han.\\r\\n\\u00c5h, nei \\u2013 det var ikke meningen, men jeg er bare litt sulten. Eller hvis jeg skal si det som sant er, jeg er skrubbsulten.\\r\\nHun hadde helt glemt \\u00e5 spise, helt glemt at hun var sulten n\\u00e5r hun l\\u00f8p fra b\\u00e5t til tog i K\\u00f8benhavn, og i M\\u00fcnchen ble det akkurat tid nok til en p\\u00f8lse med sauerkraut.\\r\\nHaha! Mannen smiler til, det glimter i gull bakerst i munnen\\r\\n\\u2013 Du har kommet til rett sted. Kom bli med meg.\\r\\n-Unnskyld, jeg glemte meg helt bort. Hvor er mine manerer, uff , Werner heter jeg fr\\u00f8ken. &nbsp;Han strekker ut en h\\u00e5nd. Jossa griper den og kjenner det faste h\\u00e5ndtrykket. Jossa sier hun, og smiler.<\\/p>\\r\\n<p>De n\\u00e6rmest sm\\u00e5l\\u00f8per innover byen. Jossa klarer ikke f\\u00e5 med seg noe, hun tenker bare p\\u00e5 mat.\\r\\n\\u2013 Hva skal du her i Wien ?\\r\\n\\u2013 Jeg skal spise, jeg vil smake det som er \\u00f8sterisk. Det er det som er reisen min skj\\u00f8nner du, jeg vil finne ut av hva ting smaker p\\u00e5 forskjellige steder.\\r\\nWerner stopper litt, mens han tenker.\\r\\n\\u2013 S\\u00e5 du vil smake det som er mest Wiensk, ok, men da tar vi til h\\u00f8yre her.\\r\\nDu skal f\\u00e5 Sp\\u00e4tzle, og det er best p\\u00e5 et bitte lite sted rett her borte.<\\/p>\\r\\n<p>De sm\\u00e5l\\u00f8per videre, litt uten grunn, men drevet av sult og nysgjerrighet.&nbsp;Sp\\u00e4tzle, en slags urpasta, eller gnocchi, eller en blanding av de begge.&nbsp;N\\u00e5r Werner forteller om smaken, den smeltede osten og ikke minst vinen som skal drikkes til g\\u00e5r det nesten rundt for Jossa.<\\/p>\\r\\n<p>Endelig skal hun f\\u00e5 mat.\\r\\nWerner dumper ned i stolen ved siden av henne.\\r\\n\\u2013 S\\u00e5nn, vin og mat p\\u00e5 vei. Du er skikkelig sulten ? Jossa klarer knapt \\u00e5 ytre ja, hun venter bare p\\u00e5 noe \\u00e5 spise.\\r\\n\\u2013 Jeg bestillte litt forskjellig, s\\u00e5 du skal f\\u00e5 et raskt overblikk, det blir kanskje litt mye. Men det kommer noen andre venner av meg ogs\\u00e5, som kan mer om vin, s\\u00e5 da spiser han det vi ikke klarer. Ok? Werner har tatt kommandoen og ser ut til \\u00e5 kose seg i rollen som vertskap. \\u2013 Grillet kalvetunge med syltede gr\\u00f8nnsaker, Sp\\u00e4tzle med sopp og ost, Gresskarsuppe med krepse-dumplings, P\\u00f8lse med sauerkraut, Snitzel med potetsalat og sitron, R\\u00f8ye med k\\u00e5l, og til dessert f\\u00e5r du Schwartswaldkake med kirseb\\u00e6r ogs\\u00e5 kan du ikke unng\\u00e5 strudelen da. Den m\\u00e5 du smake n\\u00e5r du er i Wien .\\r\\nJossa rister p\\u00e5 hodet og ler.\\r\\n\\u2013 Jeg klarer jo ikke alt sammen, det er jo umulig.<\\/p>\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Jossa til \\u00d8sterike\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Jossa st\\u00e5r p\\u00e5 stasjonen med sekken full av tj\\u00e6repastiller og kandisert angelicastang, en god porsjon med isterban, en falukorv og en limpa.\\u00a0\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"188\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:42:33', '2018-08-15 09:42:33', '8c30c848-7694-4a9e-bf81-898be011a24f'),
 ('365', '189', '3', '50', 'en', '1', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Jossa til \\u00d8sterike\",\"slug\":\"jossa-til-osterike\",\"postDate\":1515593220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"188\"],\"10\":\"<p>Jossa st\\u00e5r p\\u00e5 stasjonen med sekken full av tj\\u00e6repastiller og kandisert angelicastang, en god porsjon med isterban, en falukorv og en limpa.&nbsp;<\\/p>\",\"3\":{\"190\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Tobias har sagt farvel for kort tid siden. Han takket for selskapet, ga henne en god klem og trykket en gave ned i sekken. \\u2013 Du m\\u00e5 ikke \\u00e5pne den pakken f\\u00f8r du er fremme. Tobias s\\u00e5 p\\u00e5 Jossa og smilte.\\r\\n\\u2013 God tur, og hils til Werner.<\\/p>\\r\\n<p>Jossa klatrer om bord i toget og finner kupeen sin. Nattoget til malm\\u00f8, en behagelig m\\u00e5te \\u00e5 reise p\\u00e5, og fra Malm\\u00f8 er det ikke langt til kontinentet. Hun bryter av skalken p\\u00e5 br\\u00f8det og legger seg p\\u00e5 den oppredde senga. F\\u00f8ttene er m\\u00f8re etter all vandringen.&nbsp;Hun forsvinner inn i s\\u00f8vnen samtidig med togets startende bevegelser. Som et barn blir hun dysset i s\\u00f8vn, f\\u00f8r hun selv hadde tenkt. Det er m\\u00f8rkt, varmt og behagelig.<\\/p>\\r\\n<p>Det spraker i en h\\u00f8yttaler, plinger i en bjelle og det bankes p\\u00e5 d\\u00f8ren. Det f\\u00f8les som om det er samtidig, men hun tar det p\\u00e5 oppv\\u00e5kingsfasen, at hun har duppet av mellom lydene, bare fortrengt det litt.\\r\\nMalm\\u00f8, den kom raskere enn hun trodde, hele byen ligger der, foran henne, flat som den er.\\r\\nHun har b\\u00f8rstet av seg smulene fra br\\u00f8dskalken, skiftet, tatt en kattevask og pr\\u00f8vd \\u00e5 legge h\\u00e5ret stramt slik det s\\u00f8mmer seg, f\\u00f8r hun gikk av toget.<\\/p>\\r\\n<p>B\\u00e5ten venter, b\\u00e5ten til kontinentet st\\u00e5r i havna, noen hundre meter bortenfor stasjonen.\\r\\nFra K\\u00f8benhavn ble det tog til wien, med bytte i m\\u00fcnchen, Jossa var utmattet men merket seg at K\\u00f8benhavn var en by hun skulle utforske, men da p\\u00e5 vei hjem.<\\/p>\\r\\n<p>Brosteinen og kumlokkene, de er fine. Jossa ser ned mens hun tusler ut av stasjonsbygget i Wien.\\r\\nMen jeg er sulten. Sier hun h\\u00f8yt til seg selv, s\\u00e5 den d\\u00f8sige mannen som sto rett ved siden av i sin egen verden skvetter til og ser p\\u00e5 henne.\\r\\n\\u2013 unnskyld, sier han.\\r\\n\\u00c5h, nei \\u2013 det var ikke meningen, men jeg er bare litt sulten. Eller hvis jeg skal si det som sant er, jeg er skrubbsulten.\\r\\nHun hadde helt glemt \\u00e5 spise, helt glemt at hun var sulten n\\u00e5r hun l\\u00f8p fra b\\u00e5t til tog i K\\u00f8benhavn, og i M\\u00fcnchen ble det akkurat tid nok til en p\\u00f8lse med sauerkraut.\\r\\nHaha! Mannen smiler til, det glimter i gull bakerst i munnen\\r\\n\\u2013 Du har kommet til rett sted. Kom bli med meg.\\r\\n-Unnskyld, jeg glemte meg helt bort. Hvor er mine manerer, uff , Werner heter jeg fr\\u00f8ken. &nbsp;Han strekker ut en h\\u00e5nd. Jossa griper den og kjenner det faste h\\u00e5ndtrykket. Jossa sier hun, og smiler.<\\/p>\\r\\n<p>De n\\u00e6rmest sm\\u00e5l\\u00f8per innover byen. Jossa klarer ikke f\\u00e5 med seg noe, hun tenker bare p\\u00e5 mat.\\r\\n\\u2013 Hva skal du her i Wien ?\\r\\n\\u2013 Jeg skal spise, jeg vil smake det som er \\u00f8sterisk. Det er det som er reisen min skj\\u00f8nner du, jeg vil finne ut av hva ting smaker p\\u00e5 forskjellige steder.\\r\\nWerner stopper litt, mens han tenker.\\r\\n\\u2013 S\\u00e5 du vil smake det som er mest Wiensk, ok, men da tar vi til h\\u00f8yre her.\\r\\nDu skal f\\u00e5 Sp\\u00e4tzle, og det er best p\\u00e5 et bitte lite sted rett her borte.<\\/p>\\r\\n<p>De sm\\u00e5l\\u00f8per videre, litt uten grunn, men drevet av sult og nysgjerrighet.&nbsp;Sp\\u00e4tzle, en slags urpasta, eller gnocchi, eller en blanding av de begge.&nbsp;N\\u00e5r Werner forteller om smaken, den smeltede osten og ikke minst vinen som skal drikkes til g\\u00e5r det nesten rundt for Jossa.<\\/p>\\r\\n<p>Endelig skal hun f\\u00e5 mat.\\r\\nWerner dumper ned i stolen ved siden av henne.\\r\\n\\u2013 S\\u00e5nn, vin og mat p\\u00e5 vei. Du er skikkelig sulten ? Jossa klarer knapt \\u00e5 ytre ja, hun venter bare p\\u00e5 noe \\u00e5 spise.\\r\\n\\u2013 Jeg bestillte litt forskjellig, s\\u00e5 du skal f\\u00e5 et raskt overblikk, det blir kanskje litt mye. Men det kommer noen andre venner av meg ogs\\u00e5, som kan mer om vin, s\\u00e5 da spiser han det vi ikke klarer. Ok? Werner har tatt kommandoen og ser ut til \\u00e5 kose seg i rollen som vertskap. \\u2013 Grillet kalvetunge med syltede gr\\u00f8nnsaker, Sp\\u00e4tzle med sopp og ost, Gresskarsuppe med krepse-dumplings, P\\u00f8lse med sauerkraut, Snitzel med potetsalat og sitron, R\\u00f8ye med k\\u00e5l, og til dessert f\\u00e5r du Schwartswaldkake med kirseb\\u00e6r ogs\\u00e5 kan du ikke unng\\u00e5 strudelen da. Den m\\u00e5 du smake n\\u00e5r du er i Wien .\\r\\nJossa rister p\\u00e5 hodet og ler.\\r\\n\\u2013 Jeg klarer jo ikke alt sammen, det er jo umulig.<\\/p>\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Jossa til \\u00d8sterike\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Jossa st\\u00e5r p\\u00e5 stasjonen med sekken full av tj\\u00e6repastiller og kandisert angelicastang, en god porsjon med isterban, en falukorv og en limpa.\\u00a0\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"188\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:42:46', '2018-08-15 09:42:46', 'f26cca2c-48e6-4814-9cdc-27a3ed6919e7'),
 ('366', '171', '3', '50', 'no', '6', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Heidi Bjerkan\",\"slug\":\"heidi\",\"postDate\":1515583680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"174\"],\"10\":\"<p>Heidi Bjerkan er en norsk kokk og kj\\u00f8kkensjef. I dag driver hun mat-triangelen Credo Restaurant, Jossa mat og drikke og Finnes Kaf\\u00e9 p\\u00e5 Lilleby, Trondheim.<\\/p>\",\"3\":{\"172\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi vokste opp i Trondheim og i b\\u00e5ten til bestefaren p\\u00e5 Garten langs Tr\\u00f8ndelagskysten. Her knyttet hun sterke b\\u00e5nd til jord og vann, som siden er \\u00e5 se i hennes matlaging.<\\/p>\\r\\n<p>Bjerkan sin karriere innenfor kokkeyrket startet allerede som&nbsp;atten\\u00e5ring da hun begynte sin sommerjobb&nbsp;p\\u00e5 \\u00d8stbanekafeen. Der forstod hun raskt&nbsp;at hun&nbsp;ville jobbe med mat. Det h\\u00f8ye tempoet et kj\\u00f8kken inneb\\u00e6rer var til stor begeistring for Bjerkan, som er rastl\\u00f8s av natur.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}},\"287\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"127\"],\"standardBodyText\":\"<p>Bjerkan er omtalt som en h\\u00f8yt respektert kokk med en kompromissl\\u00f8s, engasjert og grundig visjon om fruktbart land, r\\u00e5varenes ubenyttede ressurser og framtidens bonde.&nbsp;<\\/p>\\r\\n<p>Bjerkan har alltid v\\u00e6rt opptatt av \\u00e5 jobbe b\\u00e6rekraftig, noe som gjenspeiler seg i kvaliteten Credo st\\u00e5r for. Med sterk interesse og dedikert ansvar, har Bjerkan i senere tid rekonstruert og utvidet hvordan drive restaurant med et ideal om at n\\u00e6ringen kan livsgi lokale b\\u00f8nder i et voksende kommersialisert landbruk. De tette samarbeidene med g\\u00e5rdene Skj\\u00f8lberg S\\u00f8ndre og Fannremsg\\u00e5rden er eksempler p\\u00e5 hvordan Credo \\u00f8nsker \\u00e5 bringe de lokale b\\u00f8ndenes h\\u00e5ndarbeid fram.<\\/p>\",\"settingImagePosition\":\"right\"}},\"288\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"],\"standardBodyText\":\"<p>For Heidi er det b\\u00f8ndene som er heltene, og det er produsentene som skal skinne. Gjennom m\\u00e5ltidet p\\u00e5 Credo tar hun med gjesten&nbsp;p\\u00e5 hennes tur gjennom g\\u00e5rdene, sj\\u00f8en og skogen der r\\u00e5varene kommer fra.<\\/p>\\r\\n<p>Heidi Bjerkan fikk i 2017 b\\u00e5de Ingridprisen og&nbsp;Matprisen for sitt engasjement for bedre mat og et bedre landbruk.<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Heidi\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Heidi Bjerkan er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"174\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:43:05', '2018-08-15 09:43:05', '4962c62c-75e9-4255-9ea0-b15cf1b99c61'),
 ('367', '171', '3', '50', 'en', '1', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Heidi Bjerkan\",\"slug\":\"heidi\",\"postDate\":1515583680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"174\"],\"10\":\"<p>Heidi Bjerkan er en norsk kokk og kj\\u00f8kkensjef. I dag driver hun mat-triangelen Credo Restaurant, Jossa mat og drikke og Finnes Kaf\\u00e9 p\\u00e5 Lilleby, Trondheim.<\\/p>\",\"3\":{\"172\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi vokste opp i Trondheim og i b\\u00e5ten til bestefaren p\\u00e5 Garten langs Tr\\u00f8ndelagskysten. Her knyttet hun sterke b\\u00e5nd til jord og vann, som siden er \\u00e5 se i hennes matlaging.<\\/p>\\r\\n<p>Bjerkan sin karriere innenfor kokkeyrket startet allerede som&nbsp;atten\\u00e5ring da hun begynte sin sommerjobb&nbsp;p\\u00e5 \\u00d8stbanekafeen. Der forstod hun raskt&nbsp;at hun&nbsp;ville jobbe med mat. Det h\\u00f8ye tempoet et kj\\u00f8kken inneb\\u00e6rer var til stor begeistring for Bjerkan, som er rastl\\u00f8s av natur.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}},\"287\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"127\"],\"standardBodyText\":\"<p>Bjerkan er omtalt som en h\\u00f8yt respektert kokk med en kompromissl\\u00f8s, engasjert og grundig visjon om fruktbart land, r\\u00e5varenes ubenyttede ressurser og framtidens bonde.&nbsp;<\\/p>\\r\\n<p>Bjerkan har alltid v\\u00e6rt opptatt av \\u00e5 jobbe b\\u00e6rekraftig, noe som gjenspeiler seg i kvaliteten Credo st\\u00e5r for. Med sterk interesse og dedikert ansvar, har Bjerkan i senere tid rekonstruert og utvidet hvordan drive restaurant med et ideal om at n\\u00e6ringen kan livsgi lokale b\\u00f8nder i et voksende kommersialisert landbruk. De tette samarbeidene med g\\u00e5rdene Skj\\u00f8lberg S\\u00f8ndre og Fannremsg\\u00e5rden er eksempler p\\u00e5 hvordan Credo \\u00f8nsker \\u00e5 bringe de lokale b\\u00f8ndenes h\\u00e5ndarbeid fram.<\\/p>\",\"settingImagePosition\":\"right\"}},\"288\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"],\"standardBodyText\":\"<p>For Heidi er det b\\u00f8ndene som er heltene, og det er produsentene som skal skinne. Gjennom m\\u00e5ltidet p\\u00e5 Credo tar hun med gjesten&nbsp;p\\u00e5 hennes tur gjennom g\\u00e5rdene, sj\\u00f8en og skogen der r\\u00e5varene kommer fra.<\\/p>\\r\\n<p>Heidi Bjerkan fikk i 2017 b\\u00e5de Ingridprisen og&nbsp;Matprisen for sitt engasjement for bedre mat og et bedre landbruk.<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Heidi\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Heidi Bjerkan er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"174\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:43:16', '2018-08-15 09:43:16', 'aff973c9-7dd2-4f84-a53d-7076f64f651d'),
 ('368', '94', '3', '50', 'no', '6', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Fannremsg\\u00e5rden, Orkdal\",\"slug\":\"fannremsgarden\",\"postDate\":1513339800,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"92\"],\"10\":\"<p>Melk, r\\u00f8mme, sm\\u00f8r og&nbsp;storfe&nbsp;av historisk omfang&nbsp;p\\u00e5 Fannremsg\\u00e5rden.<br><\\/p>\",\"3\":{\"95\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"279\"],\"standardBodyText\":\"<p>Mitt fag og h\\u00e5ndverk er egentlig tekstil. Historiske kl\\u00e6r, tekstiler og tradisjoner, men melk og sm\\u00f8r, det er en stor del av den samme g\\u00e5rdskulturen. G\\u00e5rden er min arv, den har v\\u00e6rt i min familie i \\u00e5rhundrer.<\\/p>\\r\\n<p>- Jon Fredrik Skauge<\\/p>\",\"settingImagePosition\":\"left\"}},\"283\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"93\"],\"standardBodyText\":\"<p>Jon Fredrik har syv kyr, den samme typen storfe som var vanlig i dette omr\\u00e5det f\\u00f8r den mer produktive NRF (Norsk R\\u00f8dt Fe) kom som resultat av modernisering. Sidet Tr\\u00f8nder er ikke en veldig kjent kurase n\\u00e5 om dagen, men hvis du forestiller deg en ku som er mindre enn en moderne ku, nesten p\\u00e5 st\\u00f8rrelse med en Grand Danoise, bare kraftigere, er du p\\u00e5 rett spor. Disse kyrene, valgt bort tidlig under effektiviseringen av landbruket, produserer ikke den gjennomsnittlige 10.000 liter melk som NRF, de melker mer i de lave tresifrede tallene - men for Jon Fredrik er ikke dette et problem.&nbsp;<\\/p>\\r\\n<p>-&nbsp;Det er ikke mengden vi ser etter, sier han med et smil.<\\/p>\",\"settingImagePosition\":\"right\"}},\"284\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"282\"],\"standardBodyText\":\"<p>Tilbake til sm\\u00f8rformen, som et objekt av vellyst, er det plassert p\\u00e5 midten av bordet akkurat som noen man tilber. Sm\\u00f8r har alltid v\\u00e6rt sentrum for oppmerksomheten, og gullfargen er bevis p\\u00e5 verdien, verdien av melkefett. I mange \\u00e5r var sm\\u00f8r den viktigste (og noen ganger eneste) inntekt for b\\u00f8nder. De solgte sm\\u00f8ret og beholdt skummetmelken og kjernemelken til eget bruk.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}},\"285\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"280\"],\"standardBodyText\":\"<p>Jon Fredrik leverer mesteparten av sin melk til Credo Restaurant, resten bruker han til sine gjester, ettersom Fannremsg\\u00e5rden har mange bes\\u00f8kende som er interessert i tradisjonelt h\\u00e5ndverk og g\\u00e5rdskultur. Hus, holdt i stand akkurat slik hans besteforeldre hadde det, er fylt opp med flere kulturskatter enn gjennomsnittlig folkemuseum.&nbsp;<\\/p>\",\"settingImagePosition\":\"right\"}},\"286\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"281\"],\"standardBodyText\":\"<p>Fannremsg\\u00e5rden ligger i Orkanger, i et typisk indre klima. Jorden er basert p\\u00e5 sand og moll, perfekte forhold for avlinger og gress. Og v\\u00e6ret?&nbsp;<br>- Solen skinner alltid, n\\u00e5r jeg er hjemme, sier Jon Fredrik.&nbsp;<\\/p>\\r\\n<p>I tillegg til \\\"Sidet Tr\\u00f8nderfe\\\" som produserer melk, og etter etter livets l\\u00f8p, kj\\u00f8tt, har Jon Fredrik ogs\\u00e5 h\\u00f8ner for egg, og hester til fritid. Du kan bes\\u00f8ke han for \\u00e5 pr\\u00f8ve ut alle hans produkter, og kj\\u00f8pe tradisjonelle h\\u00e5ndverksprodukter i den lille butikken. Sm\\u00f8ret alene er verdt turen. Men for \\u00e5 f\\u00e5 den aller beste smaken av Jon Fredriks sm\\u00f8r, lukk \\u00f8ynene dine og husk potetkaken servert hos oss p\\u00e5 Credo.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Fannremsg\\u00e5rden, Orkdal\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Sm\\u00e5kk\\u00e5 p\\u00e5 historien p\\u00e5 Fannremsg\\u00e5rden.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"92\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:43:32', '2018-08-15 09:43:32', '2121c540-9e69-4ead-86de-ff015fcd03f8'),
 ('369', '90', '3', '50', 'no', '6', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"slug\":\"skjolberg-sondre\",\"postDate\":1513339680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"98\"],\"10\":\"<p>Gr\\u00f8nnsaker og andre spiselige vekster, and, andeegg, kj\\u00f8tt av \\\"utegris\\\", storfe, lam og ferskmelk.\\r\\n  <\\/p>\",\"3\":{\"91\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"125\"],\"standardBodyText\":\"<p>Det er gr\\u00f8nt overalt, vanligvis skeptiske og dystre byfolk blir overrasket n\\u00e5r de kommer hit og ser alt det som gror i skr\\u00e5ningen p\\u00e5 Svorkmo.<\\/p>\\r\\n<p>Bakken ligger i Orkdal, inntil n\\u00e5 mest kjent for sin elv som deler sitt navn med den st\\u00f8rste produsenten av bearbeidede matvarer i Norge.\\r\\n  <\\/p>\\r\\n<p>Grunnen til at dette gr\\u00f8nne paradiset finnes er p\\u00e5 grunn av Elin og Carl Erik \\u00d6stlunds utrettelige arbeid og ren viljestyrke.<\\/p>\",\"settingImagePosition\":\"left\"}},\"275\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"270\"],\"standardBodyText\":\"<p>Det er flere enn f\\u00e5 som har ristet p\\u00e5 hodet av m\\u00e5ten Elin og Carl Erik jobber p\\u00e5. Det er ikke mulig \\u00e5 dyrke de planter dere \\u00f8nsker her, ikke p\\u00e5 den m\\u00e5ten dere dr\\u00f8mmer om uansett, sier de.\\r\\n  Elin og Carl Erik arbeider etter biodynamiske prinsipper, og for dem er jorden alt. Den m\\u00e5 v\\u00e6re sunn og full av liv. P\\u00e5 Skj\\u00f8lberg S\\u00f8ndre hadde ikke jorda v\\u00e6rt i drift p\\u00e5 femten \\u00e5r, s\\u00e5 de har over tid m\\u00e5tte pleie jordsmonnet tilbake til liv.<\\/p>\",\"settingImagePosition\":\"right\"}},\"276\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"274\"],\"standardBodyText\":\"<p>P\\u00e5 Skj\\u00f8lberg S\\u00f8ndre produseres det blant annet rotgr\\u00f8nnsaker, k\\u00e5l og neper av ulike variasjoner, agurker, epleagurker, spiselige vekster og urter. P\\u00e5 g\\u00e5rden har de ogs\\u00e5 den gamle kurasen \\\"Sidet Tr\\u00f8nder\\\" og \\\"Gammel Norsk Sp\\u00e6lsau\\\". Dyrene lever i harmoni med g\\u00e5rdens kretsl\\u00f8psfilosofi, og er en viktig bidragsyter til g\\u00e5rdens kretsl\\u00f8p.<\\/p>\",\"settingImagePosition\":\"left\"}},\"277\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"120\"],\"standardBodyText\":\"<p>Kompostering er ogs\\u00e5 en stor del av kretsl\\u00f8pet til g\\u00e5rden, og alle gr\\u00f8nnsaksrester fra Credo Restaurant blir omgjort til kompost i fraukjelleren p\\u00e5 Skj\\u00f8lberg S\\u00f8ndre. Denne operasjonen er holistisk, og de beholder og gjenbruker s\\u00e5 mye som overhodet mulig. I de senere \\u00e5r har de ogs\\u00e5 begynt \\u00e5 dyrke mikrogr\\u00f8nt i jordkjelleren.&nbsp;<\\/p>\",\"settingImagePosition\":\"right\"}},\"278\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"271\"],\"standardBodyText\":\"<p>Mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale i Skj\\u00f8lberg S\\u00f8ndre sitt arbeid, og det&nbsp;\\u00e5 plukke rene, \\u00e6rlige gr\\u00f8nnsaker og urter med egne hender er et h\\u00f8ydepunkt for oss som restaurant. Vi setter sv\\u00e6rt stor pris p\\u00e5 kunnskapen som Skj\\u00f8lberg S\\u00f8ndre viser oss om agro-\\u00f8kologisk jordbruk, og sammen pusher vi grensen for hva som er mulig \\u00e5 dyrke p\\u00e5 Svorkmo<br><\\/p>\\r\\n<p><a href=\\\"http:\\/\\/www.skjolbergsondre.no\\/\\\">www.skjolbergsondre.no<\\/a>\\r\\n  <\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Skj\\u00f8lberg S\\u00f8ndre er en biodynamisk kretsl\\u00f8psg\\u00e5rd som drives av Elin \\u00d6stlund og Carl Erik Skj\\u00f8lberg.\\u00a0\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"98\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:43:57', '2018-08-15 09:43:57', 'be91dba3-02a9-46a7-9be2-675f31e98cca'),
