 ('387', '12', '4', '50', 'no', '7', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469300,\"expiryDate\":null,\"enabled\":0,\"parentId\":\"8\",\"fields\":{\"3\":{\"153\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Finnes Kaf\\u00e9\",\"standardImages\":[\"149\"],\"standardBodyText\":\"<p>Innkvartert i Lillebys historiske gamle barnehjem er Finnes Kafe det siste kulinariske tillegget til Heidi Bjerkans voksende spisestue.&nbsp;<\\/p>\",\"settingTextWhiteBox\":\"\"}},\"53\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"122\"],\"standardBodyText\":\"<p>En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus p\\u00e5 menneskene som maten, b\\u00f8ndene og dyrene, med kj\\u00f8tt og fisk tilberedt i samme m\\u00e5l, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbr\\u00f8d, andebryst, stekte torskehoder og rabarbraslush.<\\/p>\",\"settingImagePosition\":\"left\"}},\"154\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Historien\",\"standardBodyText\":\"<p>En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus p\\u00e5 menneskene som maten, b\\u00f8ndene og dyrene, med kj\\u00f8tt og fisk tilberedt i samme m\\u00e5l, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbr\\u00f8d, andebryst, stekte torskehoder og rabarbraslush.<\\/p>\"}},\"158\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Menneskene\",\"standardImages\":[\"71\"],\"standardBodyText\":\"<p>En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus p\\u00e5 mennesken