,\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"90\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}},\"124\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"94\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Credo\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Credo\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-09-08 11:19:30', '2018-09-08 11:19:30', 'd60fb768-1df9-4b3b-b8b2-282d64bf5045'),
 ('418', '16', '4', '66', 'en', '1', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"About us\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"102\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Credo\\u2019s heart lies where our raw ingredients are produced.\",\"standardImages\":[\"175\"],\"standardBodyText\":\"<p>At Credo you will experience food cooked from the raw goods grown in the Tr\\u00f8ndelag region, fished from the waters surrounding it, and dairy and local speciality products cultivated with a focus on flavors and sustainability.<\\/p><p><br><\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"289\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>Credo\\u2019s great wish is to take you through a multi-faceted experience of tastes, textures and experiences when you dine with us. We want to show you our gardens, our animals and all that we get from land and sea. We dedicate our time to finding raw ingredients that exemplify the best<br>qualities of the time and place we are in.<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"104\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"159\"],\"standardBodyText\":\"<p>Ingredients are our motivation. Why else would we spend 260 kr ($32) per kilogram on butter alone?&nbsp;With proper craftsmanship, our chef\\u2019s goal is to give equal attention to our guests as we do to our&nbsp;plates. We believe that each component is crucial - the animals, forests, earth, moon, sea and you,&nbsp;the individual.<\\/p><p><\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"106\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"292\"],\"standardBodyText\":\"<p>At Credo we wish to bring you as close to the tastes, textures and feelings of our food as we possibly&nbsp;can. We can\\u2019t wait to introduce you to our farms, food and philosophy by sharing the best of who&nbsp;and what we are with all who visit.<\\/p><p><\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Om oss\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Om oss\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-09-08 11:23:42', '2018-09-08 11:23:42', '66c66334-0bff-4165-8a5a-42d30a330ceb'),
 ('419', '69', '4', '66', 'en', '1', '', '{\"typeId\":\"4\",\"authorId\":\"66\",\"title\":\"Menu\",\"slug\":\"meny\",\"postDate\":1506234240,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"117\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Menu\",\"standardImages\":[\"96\"],\"standardBodyText\":\"<p>Credo menu - 1300,-&nbsp;<br><\\/p>\\r\\n<p>Wine menu&nbsp;- 1200,-<\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"294\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"160\"],\"standardBodyText\":\"<p>Our menu is based on the most interesting and highest&nbsp;quality goods we receive from day to day. The menu is set, and&nbsp;consist of in between 20-25 courses, and it changes every day.&nbsp;<br><\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"295\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"293\"],\"standardBodyText\":\"<p>Our drink menu is thoughtfully arranged to best&nbsp;compliment our dishes, so that each combination raises the profile of the individual dish. If you have&nbsp;a special request, you will be delighted by our extensive wine cellar of several thousand wines.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Meny\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Meny\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":