 ('420', '233', '4', '66', 'en', '1', '', '{\"typeId\":\"4\",\"authorId\":\"49\",\"title\":\"Contact\",\"slug\":\"kontakt-1\",\"postDate\":1515770640,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"296\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Contact\",\"standardImages\":[\"115\"],\"standardBodyText\":\"<p>+47 954 37 028<br><a href=\\\"mailto:credo@restaurantcredo.no\\\" class=\\\"link\\\">credo@restaurantcredo.no&nbsp;<\\/a><\\/p>\\r\\n<p>Ladeveien 9,&nbsp; 7066 Trondheim&nbsp;<\\/p>\\r\\n<p>Follow us on&nbsp;<a href=\\\"https:\\/\\/www.facebook.com\\/restaurantcredo.no\\/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Facebook&nbsp;<\\/a>and&nbsp;<a href=\\\"https:\\/\\/www.instagram.com\\/restaurantcredo\\/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Instagram<\\/a><\\/p>\",\"settingTextWhiteBox\":\"1\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Kontakt\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Kontakt\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\"}}', '2018-09-08 11:33:50', '2018-09-08 11:33:50', '6f2085cd-8379-44b8-b59a-36d53b8a1627'),
 ('421', '17', '4', '66', 'en', '1', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Careers\",\"slug\":\"kontakt\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"74\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Careers\",\"standardImages\":[\"82\"],\"standardBodyText\":\"<p>We are always on the lookout for new, engaged and passionate employees who wish to become a part of our family.<\\/p>\\r\\n<p>If you wish to apply for a position, or have questions, please contact us at:&nbsp;<a href=\\\"mailto:credo@restaurantcredo.no\\\" class=\\\"link\\\" style=\\\"background-color: initial;\\\">credo@restaurantcredo.no<\\/a>&nbsp;<\\/p>\",\"settingTextWhiteBox\":\"1\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Karriere\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Karriere\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-09-08 11:35:31', '2018-09-08 11:35:31', '7c932cd4-2e06-4cdb-9da4-83f9304a07fa'),
 ('422', '171', '3', '66', 'en', '2', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Heidi Bjerkan\",\"slug\":\"heidi\",\"postDate\":1515583680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"174\"],\"10\":\"<p>Heidi Bjerkan is a Norwegian chef, our chef de cuisine and owner of Credo. She opened Credo at Credoveita in Trondheim in 1998, and are now running the food-triangle Credo Restaurant, Jossa mat og drikke and Finnes Kaf\\u00e9 at Lilleby, Trondheim.<\\/p>\",\"3\":{\"172\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi grew up in Trondheim and on her grandfather\\u2019s boat in Garten along the Tr\\u00f8ndelag coast.&nbsp;Here she developed strong connections to the land and sea, which to this day may be seen in her&nbsp;cooking.&nbsp;<\\/p><p>Bjerkan\'s career within the food industry started already when she was eighteen years old during a summer job at the caf\\u00e9 at \\u00d8stbanehallen. She soon realized that she wanted to work as a chef, as the high tempo within a kitchen fed Bjerkan\'s&nbsp;natural habit of being restless.<br><\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"287\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"127\"],\"standardBodyText\":\"<p>Heidi is passionate about raising awareness of our food systems, improving land use practices and preserving the traditional food cultures of the region.&nbsp;<\\/p><p>For Heidi, the farmers are the heroes of this story, and it is their work that should shine&nbsp;above all others. During a meal at Credo, Heidi takes all of her guests on a personal tour through the&nbsp;gardens, waterways and forests where our raw ingredients grow.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"288\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"],\"standardBodyText\":\"<p>Last year, Heidi was awarded the&nbsp;distinguished Matprisen (Food Prize) and Ingridprisen&nbsp;for her engagement in promoting better food and sustainable&nbsp;land use practices.<span><\\/span><br><\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Heidi\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Heidi Bjerkan er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"174\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-09-08 11:45:31', '2018-09-08 11:45:31', '97cd2b76-6dca-44ac-a73c-23f9b8d97bf7'),
 ('423', '171', '3', '66', 'en', '3', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Heidi Bjerkan\",\"slug\":\"heidi\",\"postDate\":1515583680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"174\"],\"10\":\"<p>Heidi Bjerkan is a Norwegian chef, our chef de cuisine and owner of Credo. Now she is running the food-triangle Credo Restaurant, Jossa mat og drikke and Finnes Kaf\\u00e9 at Lilleby, Trondheim.<\\/p>\",\"3\":{\"172\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi grew up in Trondheim and on her grandfather\\u2019s boat in Garten along the Tr\\u00f8ndelag coast.&nbsp;Here she developed strong connections to the land and sea, which to this day may be seen in her&nbsp;cooking.&nbsp;<\\/p>\\r\\n<p>Bjerkan\'s career within the food industry started already when she was eighteen years old during a summer job at the caf\\u00e9 at \\u00d8stbanehallen. She soon realized that she wanted to work as a chef, as the high tempo within a kitchen fed Bjerkan\'s&nbsp;natural habit of being restless.<br><\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"287\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"127\"],\"standardBodyText\":\"<p>Heidi is passionate about raising awareness of our food systems, improving land use practices and preserving the traditional food cultures of the region.&nbsp;<\\/p>\\r\\n<p>For Heidi, the farmers are the heroes of this story, and it is their work that should shine&nbsp;above all others. During a meal at Credo, Heidi takes all of her guests on a personal tour through the&nbsp;gardens, waterways and forests where our raw ingredients grow.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"288\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"],\"standardBodyText\":\"<p>Last year, Heidi was awarded the&nbsp;distinguished Matprisen (Food Prize) and Ingridprisen&nbsp;for her engagement in promoting better food and sustainable&nbsp;land use practices.<br><\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Heidi\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Heidi Bjerkan er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"174\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-09-08 11:46:15', '2018-09-08 11:46:15', 'd597a60f-4590-466d-ac44-d132936577bf'),
