 ('426', '15', '4', '66', 'en', '2', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Stories\",\"slug\":\"journal\",\"postDate\":1505469300,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"17\":[\"4\"],\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Historier\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Stories\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"}}}', '2018-09-08 13:21:50', '2018-09-08 13:21:50', 'ee6592d5-b17d-45ad-b477-8d16c76781bf');
