 ('427', '90', '3', '66', 'en', '1', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"slug\":\"skjolberg-sondre\",\"postDate\":1513339680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"98\"],\"10\":\"<p>Vegetables and other edible growths, duck eggs, duck meat, pork and fresh milk.<\\/p>\",\"3\":{\"91\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"125\"],\"standardBodyText\":\"<p>In the vast green hills of The Valley in Orkdal, guests will get lost of words. This is a heaven of biodiversity. The Valley is filled to the treetops with life in all shapes and sizes, but the valley is most known for its river, which shares its name with the biggest producer of processed foods in Norway.&nbsp;<\\/p><p>The reason this green paradise exists is because of Elin and Carl Erik \\u00d6stlund\'s stubbornness and willfull work.<br><\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"275\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"270\"],\"standardBodyText\":\"<p>Elin and Carl Erik have been the talk of the valley for some years, not in a good way, more of a head shaking disturbed distrust kind of way, from the other farmers that is. It is not possible to grow the plants you would like to grow here, not the way you are dreaming of anyway, they say.&nbsp;Elin and Carl Erik work after biodynamic principles, and for them the soil is everything. It needs to be healthy and full of life, and in this hill, they started the work of rebuilding the soil. So they carried on, and slowly but decisivly it started to grow, to almost overgrow that small part of the hill facing west.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"276\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"274\"],\"standardBodyText\":\"<p>At the farm they produce root vegetables, cabbage, cucumbers, apple cucumbers, chilies, edible flowers and herbs. They also have the old bovinae \\\"sidet tr\\u00f8nderfe\\\", mosk ducks, pigs and the lamb breed \\\"Gr\\u00e5 Tr\\u00f8nder\\\" and \\\"Gammel Norsk Sp\\u00e6lsau\\\". The animals live in harmony with the farm\'s cyclical philosophy, and are an important supporter of the farm\'s cycle.<br><\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"277\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"120\"],\"standardBodyText\":\"<p>Composting is a big part of the cycle of life at the farm as well, and all the compost from Credo are given to the farm. This process of composting is holistic, and they keep and reuse as much as possible. Lately, they have also started growing micro greens in the cellar during winter.<br><\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"278\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"271\"],\"standardBodyText\":\"<p>Diversity, taste, experiences and curiosity for the order of nature is in center at Skj\\u00f8lberg S\\u00f8ndre, and being able to pick honest vegetables and herbs ourselves is the highlight for our restaurant. We appreciate the knowledge Skj\\u00f8lberg S\\u00f8ndre show and teach us about agro-ecological farming, and together, we push the limit of what is possible to grow at Svorkmo.<\\/p>\\r\\n<p><a href=\\\"http:\\/\\/www.skjolbergsondre.no\\/\\\">www.skjolbergsondre.no<\\/a>\\r\\n  <\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Skj\\u00f8lberg S\\u00f8ndre er en biodynamisk kretsl\\u00f8psg\\u00e5rd som drives av Elin \\u00d6stlund og Carl Erik Skj\\u00f8lberg.\\u00a0\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"98\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-09-08 14:12:06', '2018-09-08 14:12:06', 'b448ec12-bfd0-42d6-a518-79f3d5c39659'),
 ('428', '94', '3', '66', 'en', '1', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Fannremsg\\u00e5rden, Orkdal\",\"slug\":\"fannremsgarden\",\"postDate\":1513339800,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"92\"],\"10\":\"<p>Milk, Sour Cream, Butter and Cattle of historical scope at Fannremsg\\u00e5rden.<br><\\/p>\",\"3\":{\"95\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"279\"],\"standardBodyText\":\"<p>Jon Fredrik, a defender of tradition, a knight of old crafts, both in his making of butter and sour cream, as well as in his needlework.&nbsp;<\\/p><p>- My knowledge and craft are really of historic clothing, og textiles and traditions, he says, but milk and butter, well, it\'s a big part of the same culture. And the farm is my inheritance, it\'s been in my family for centuries.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"283\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"93\"],\"standardBodyText\":\"<p>Jon Fredrik har syv kyr, den samme typen storfe som var vanlig i dette omr\\u00e5det f\\u00f8r den mer produktive NRF (Norsk R\\u00f8dt Fe) kom som resultat av modernisering. Sidet Tr\\u00f8nder er ikke en veldig kjent kurase n\\u00e5 om dagen, men hvis du forestiller deg en ku som er mindre enn en moderne ku, nesten p\\u00e5 st\\u00f8rrelse med en Grand Danoise, bare kraftigere, er du p\\u00e5 rett spor. Disse kyrene, valgt bort tidlig under effektiviseringen av landbruket, produserer ikke den gjennomsnittlige 10.000 liter melk som NRF, de melker mer i de lave tresifrede tallene - men for Jon Fredrik er ikke dette et problem.&nbsp;<\\/p>\\r\\n<p>-&nbsp;Det er ikke mengden vi ser etter, sier han med et smil.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"284\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"282\"],\"standardBodyText\":\"<p>Tilbake til sm\\u00f8rformen, som et objekt av vellyst, er det plassert p\\u00e5 midten av bordet akkurat som noen man tilber. Sm\\u00f8r har alltid v\\u00e6rt sentrum for oppmerksomheten, og gullfargen er bevis p\\u00e5 verdien, verdien av melkefett. I mange \\u00e5r var sm\\u00f8r den viktigste (og noen ganger eneste) inntekt for b\\u00f8nder. De solgte sm\\u00f8ret og beholdt skummetmelken og kjernemelken til eget bruk.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"285\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"280\"],\"standardBodyText\":\"<p>Jon Fredrik leverer mesteparten av sin melk til Credo Restaurant, resten bruker han til sine gjester, ettersom Fannremsg\\u00e5rden har mange bes\\u00f8kende som er interessert i tradisjonelt h\\u00e5ndverk og g\\u00e5rdskultur. Hus, holdt i stand akkurat slik hans besteforeldre hadde det, er fylt opp med flere kulturskatter enn gjennomsnittlig folkemuseum.&nbsp;<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"286\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"281\"],\"standardBodyText\":\"<p>Fannremsg\\u00e5rden ligger i Orkanger, i et typisk indre klima. Jorden er basert p\\u00e5 sand og moll, perfekte forhold for avlinger og gress. Og v\\u00e6ret?&nbsp;<br>- Solen skinner alltid, n\\u00e5r jeg er hjemme, sier Jon Fredrik.&nbsp;<\\/p>\\r\\n<p>I tillegg til \\\"Sidet Tr\\u00f8nderfe\\\" som produserer melk, og etter etter livets l\\u00f8p, kj\\u00f8tt, har Jon Fredrik ogs\\u00e5 h\\u00f8ner for egg, og hester til fritid. Du kan bes\\u00f8ke han for \\u00e5 pr\\u00f8ve ut alle hans produkter, og kj\\u00f8pe tradisjonelle h\\u00e5ndverksprodukter i den lille butikken. Sm\\u00f8ret alene er verdt turen. Men for \\u00e5 f\\u00e5 den aller beste smaken av Jon Fredriks sm\\u00f8r, lukk \\u00f8ynene dine og husk potetkaken servert hos oss p\\u00e5 Credo.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Fannremsg\\u00e5rden, Orkdal\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Sm\\u00e5kk\\u00e5 p\\u00e5 historien p\\u00e5 Fannremsg\\u00e5rden.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"92\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-09-13 09:43:40', '2018-09-13 09:43:40', 'fb3a6fa1-f74c-41f2-9291-11c88da3282d'),
