:\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"282\"],\"standardBodyText\":\"<p>Tilbake til sm\\u00f8rformen, som et objekt av vellyst, er det plassert p\\u00e5 midten av bordet akkurat som noen man tilber. Sm\\u00f8r har alltid v\\u00e6rt sentrum for oppmerksomheten, og gullfargen er bevis p\\u00e5 verdien, verdien av melkefett. I mange \\u00e5r var sm\\u00f8r den viktigste (og noen ganger eneste) inntekt for b\\u00f8nder. De solgte sm\\u00f8ret og beholdt skummetmelken og kjernemelken til eget bruk.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"285\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"280\"],\"standardBodyText\":\"<p>Jon Fredrik leverer mesteparten av sin melk til Credo Restaurant, resten bruker han til sine gjester, ettersom Fannremsg\\u00e5rden har mange bes\\u00f8kende som er interessert i tradisjonelt h\\u00e5ndverk og g\\u00e5rdskultur. Hus, holdt i stand akkurat slik hans besteforeldre hadde det, er fylt opp med flere kulturskatter enn gjennomsnittlig folkemuseum.&nbsp;<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"286\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"281\"],\"standardBodyText\":\"<p>Fannremsg\\u00e5rden ligger i Orkanger, i et typisk indre klima. Jorden er basert p\\u00e5 sand og moll, perfekte forhold for avlinger og gress. Og v\\u00e6ret?&nbsp;<br>- Solen skinner alltid, n\\u00e5r jeg er hjemme, sier Jon Fredrik.&nbsp;<\\/p>\\r\\n<p>I tillegg til \\\"Sidet Tr\\u00f8nderfe\\\" som produserer melk, og etter etter livets l\\u00f8p, kj\\u00f8tt, har Jon Fredrik ogs\\u00e5 h\\u00f8ner for egg, og hester til fritid. Du kan bes\\u00f8ke han for \\u00e5 pr\\u00f8ve ut alle hans produkter, og kj\\u00f8pe tradisjonelle h\\u00e5ndverksprodukter i den lille butikken. Sm\\u00f8ret alene er verdt turen. Men for \\u00e5 f\\u00e5 den aller beste smaken av Jon Fredriks sm\\u00f8r, lukk \\u00f8ynene dine og husk potetkaken servert hos oss p\\u00e5 Credo.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Fannremsg\\u00e5rden, Orkdal\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Sm\\u00e5kk\\u00e5 p\\u00e5 historien p\\u00e5 Fannremsg\\u00e5rden.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"92\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-09-13 09:44:10', '2018-09-13 09:44:10', 'c5504cd2-e9b8-4d95-bd9c-f9909ae84e93'),
 ('430', '94', '3', '66', 'en', '3', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Fannremsg\\u00e5rden, Orkdal\",\"slug\":\"fannremsgarden\",\"postDate\":1513339800,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"92\"],\"10\":\"<p>Milk, Sour Cream, Butter and Cattle of historical scope.<br><\\/p>\",\"3\":{\"95\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"279\"],\"standardBodyText\":\"<p>Jon Fredrik, a defender of tradition, a knight of old crafts, both in his making of butter and sour cream, as well as in his needlework.&nbsp;<\\/p>\\r\\n<p>- My knowledge and craft are really of historic clothing, og textiles and traditions, he says, but milk and butter, well, it\'s a big part of the same culture. And the farm is my inheritance, it\'s been in my family for centuries.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"283\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"93\"],\"standardBodyText\":\"<p>Jon Fredrik has seven cows, the same type of bovinae kept in this area before the more productive NRF (Norwegian Red Cow) came along. Sidet Tr\\u00f8nder has no English name, but if you imagine a cow smaller than a modern cow, almost of the size of an overgrown Grand Danoise only stockier, you\'re on the right track. These cows, selected away in early modernization of agriculture doesn\'t produce the average 10.000 liters of milk as the NRF. They are more in the lower three-digit number, but for Jon Fredrik that isn\'t a problem.<\\/p><p>- It\'s not the quantity we are looking for, he says with a smile.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"284\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"282\"],\"standardBodyText\":\"<p>Back to the butter - shaped as an object of desire, it is placed in the middle of the tavle as something to worship. Butter has always been the center of attention, it\'s golden color proves its value, the value of milkfat. For many years, butter was the main (and sometimes the only) income for farmers. They sold the butter and kept the skimmed milk and the buttermilk for their own use.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"285\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"280\"],\"standardBodyText\":\"<p>Jon Fredrik delivers most of his milk to Restaurant Credo, the rest he keeps for his own guests, as his farm has quite a few visitors interested in traditional crafts and farming. His house, kept the way his grandparents had it, only adding items of numbers that would surpass the amount of memorabilia in a national museum of a mid-sized country.&nbsp;<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"286\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"281\"],\"standardBodyText\":\"<p>Fannremsg\\u00e5rden is located in Orkanger, in a typical inland climate. The soil is based on sand and moll, perfect conditions for crops and grass. And the weather, well - The sun always shines when I\'m home, Jon Fredrik says.&nbsp;<\\/p><p>Aside from the \\\"Sidet Tr\\u00f8nder\\\" for his milk, sour cream and butter production, Jon Fredrik also have hens for eggs, and gorses for leisure. You can visit him to try out all his products, and also yo buy traditional handcrafted products in his little shop. The butter alone is worth the trip. But to really get the very best taste of Jon Fredrik\'s butter, just close your eyes and remember the potato cake, served here at Credo.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Fannremsg\\u00e5rden, Orkdal\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Sm\\u00e5kk\\u00e5 p\\u00e5 historien p\\u00e5 Fannremsg\\u00e5rden.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"92\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-09-13 09:55:48', '2018-09-13 09:55:48', '22a06fc6-4ad4-4e1b-a40f-3e1db8968831'),
 ('431', '16', '4', '66', 'en', '2', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"About us\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"102\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Credo\\u2019s heart lies where our raw ingredients are produced.\",\"standardImages\":[\"175\"],\"standardBodyText\":\"<p>At Credo you will experience food cooked from the raw goods grown in the Tr\\u00f8ndelag region, fished from the waters surrounding it, and dairy and local speciality products cultivated with a focus on flavors and sustainability.<\\/p>\\r\\n<p><br><\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"289\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>Credo\\u2019s great wish is to take you through a multi-faceted experience of tastes, textures and experiences when you dine with us. We want to show you our gardens, our animals and all that we get from land and sea. We dedicate our time to finding raw ingredients that exemplify the best qualities of the time and place we are in.<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"104\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"159\"],\"standardBodyText\":\"<p>Ingredients are our motivation. Why else would we spend 260 kr ($32) per kilogram on butter alone?&nbsp;With proper craftsmanship, our chef\\u2019s goal is to give equal attention to our guests as we do to our&nbsp;plates. We believe that each component is crucial - the animals, forests, earth, moon, sea and you,&nbsp;the individual.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"106\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"292\"],\"standardBodyText\":\"<p>At Credo we wish to bring you as close to the tastes, textures and feelings of our food as we possibly&nbsp;can. We can\\u2019t wait to introduce you to our farms, food and philosophy by sharing the best of who&nbsp;and what we are with all who visit.<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Om oss\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Om oss\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-09-13 09:59:17', '2018-09-13 09:59:17', 'e85a706c-fd25-4072-8a16-507cf52fffb4'),
