 ('433', '8', '4', '66', 'no', '20', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Finnes \",\"slug\":\"finnes\",\"postDate\":1505469180,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":{\"179\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Velkommen til oss\",\"standardImages\":[\"209\"],\"standardBodyText\":\"<p>I denne fasen av utbyggingen p\\u00e5 Lilleby er&nbsp;Finnes Kaf\\u00e9 stengt grunnet vanskelig fremkommelighet og tilgjengelighet for v\\u00e5re gjester. Finnes Kaf\\u00e9 er \\u00e5pen for forh\\u00e5ndsbestilte selskaper og vi h\\u00e5per \\u00e5 \\u00e5pne s\\u00e5 snart som mulig for alle v\\u00e5re gjester.&nbsp;&nbsp;<\\/p>\",\"settingTextWhiteBox\":\"\"}},\"133\":{\"modified\":\"1\",\"type\":\"introWithOpeningHours\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardImages\":\"\",\"standardHeading\":\"\",\"standardBodyText\":\"\"}},\"228\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"226\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"229\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"217\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}},\"230\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"222\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Finnes\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Finnes\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSour