 ('434', '329', '3', '66', 'no', '1', '', '{\"typeId\":null,\"authorId\":\"66\",\"title\":\"Meinklang p\\u00e5 Jossa\",\"slug\":\"meinklang-pa-jossa\",\"postDate\":1540364809,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"328\"],\"10\":\"\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Den biodynamiske vinprodusenten Meinklang gjester Jossa og Credo\",\"standardBodyText\":\"<p>Den \\u00f8sterrikske familiebedriften Meinklang er i fullstendig harmoni med naturens syklus, og det er ikke bare vin de lager i solfylte Burgenland. Mens det unge ekteparet Angela og Werner Michlits har ansvar for vinproduksjonen p\\u00e5 g\\u00e5rden, tar Werners foreldre og to br\\u00f8dre seg av oppdrett av storfe og svin, i tillegg til dyrking av korn, epler, mais og solsikker \\u2013 alt produsert p\\u00e5 biodynamisk vis.&nbsp;<br><br>P\\u00e5 mange m\\u00e5ter er dette forenelig med Credos filosofi, og vi er kjempestolte av \\u00e5 f\\u00e5 Meinklang p\\u00e5 bes\\u00f8k til Jossa.<br><br>Fredag 26. oktober f\\u00e5r vi et l\\u00e6rerikt innsyn i b\\u00e5de ideologi og viner.&nbsp;<br>Et must for alle som er interessert i \\u00f8kologiske tankesett og kvalitet,<br>men det er ogs\\u00e5 verd \\u00e5 nevne at Werner er en skikkelig trivelig fyr.<br><br>Kvelden er todelt. Du kan selv velge smaking, middag eller begge deler:&nbsp;<br><br>Kl 17.00: Foredrag og vinsmaking av seks viner med Werner Michlits, mannen bak vinhuset Meinklang.&nbsp;<br>Pris 200,- Tid: 90 minutter.&nbsp;<br>Book gjerne plass via mail: credo@restaurantcredo.no.&nbsp;<br><br>Fra kl 18.30: Middag med Werner p\\u00e5 Jossa.&nbsp;<br>4-retters middag med vinpakke fra Meinklang.&nbsp;<br>Pris kr 950,-<br>Book gjerne bord til middagen via:&nbsp;<a href=\\\"https:\\/\\/jossa.dinesuperb.com\\/reserve\\/guests?fbclid=IwAR0kSaTQqD7LxSDYKfGq1Whjk_BpwQNMe7bx2XOGtaY64ohyrpTaCszuLxc\\\" target=\