 ('440', '69', '4', '66', 'no', '20', '', '{\"typeId\":\"4\",\"authorId\":\"66\",\"title\":\"Meny\",\"slug\":\"meny\",\"postDate\":1506234240,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"117\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Meny\",\"standardImages\":[\"96\"],\"standardBodyText\":\"<p>Credo meny - 1400,-&nbsp;<br><\\/p>\\r\\n<p>Vinpakke - 1300,-<\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"294\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"160\"],\"standardBodyText\":\"<p>P\\u00e5 Credo \\u00f8nsker vi \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg det beste fra g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i, og til stedet vi er p\\u00e5.<\\/p>\\r\\n<p>Menyen er satt og best\\u00e5r av mellom 20-25 serveringer. Den endres hver eneste dag, da den&nbsp;er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert fra v\\u00e5re leverand\\u00f8rer.<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"295\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"293\"],\"standardBodyText\":\"<p>Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Drikkemenyen best\\u00e5r av b\\u00e5de \\u00f8l, cider og et utvalg av viner, og ogs\\u00e5 denne endres daglig. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Meny\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Meny\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2019-01-03 13:33:01', '2019-01-03 13:33:01', '04e5b4ce-9090-488a-9192-9b35e5fa0e44'),
 ('441', '69', '4', '66', 'en', '2', '', '{\"typeId\":\"4\",\"authorId\":\"66\",\"title\":\"Menu\",\"slug\":\"meny\",\"postDate\":1506234240,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"117\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Menu\",\"standardImages\":[\"96\"],\"standardBodyText\":\"<p>Credo menu - 1400,-&nbsp;<br><\\/p>\\r\\n<p>Wine menu&nbsp;- 1300,-<\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"294\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"160\"],\"standardBodyText\":\"<p>Our menu is based on the most interesting and highest&nbsp;quality goods we receive from day to day. The menu is set, and&nbsp;consist of in between 20-25 courses, and it changes every day.&nbsp;<br><\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"295\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"293\"],\"standardBodyText\":\"<p>Our drink menu is thoughtfully arranged to best&nbsp;compliment our dishes, so that each combination raises the profile of the individual dish. If you have&nbsp;a special request, you will be delighted by our extensive wine cellar of several thousand wines.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Meny\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Meny\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":