 ('442', '69', '4', '66', 'no', '21', '', '{\"typeId\":\"4\",\"authorId\":\"66\",\"title\":\"Meny\",\"slug\":\"meny\",\"postDate\":1506234240,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"117\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Meny\",\"standardImages\":[\"96\"],\"standardBodyText\":\"<p>Credo meny - 1400,-&nbsp;<br><\\/p>\\r\\n<p>Vinpakke - 1300,-<\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"294\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"160\"],\"standardBodyText\":\"<p>P\\u00e5 Credo \\u00f8nsker vi \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg det beste fra g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i, og til stedet vi er p\\u00e5.<\\/p>\\r\\n<p>Menyen er satt og best\\u00e5r av mellom 20-25 serveringer. Den endres hver eneste dag, da den&nbsp;er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert fra v\\u00e5re leverand\\u00f8rer.<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"295\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"293\"],\"standardBodyText\":\"<p>Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Drikkemenyen best\\u00e5r av b\\u00e5de \\u00f8l, cider og et utvalg av viner, og ogs\\u00e5 denne endres daglig. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Meny\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Meny\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2019-01-03 13:34:10', '2019-01-03 13:34:10', 'be65e745-fc54-46e0-a1bf-275e4e86e33e'),
 ('443', '332', '3', '66', 'no', '1', '', '{\"typeId\":null,\"authorId\":\"66\",\"title\":\"Jossa drar til Thailand\",\"slug\":\"jossa-drar-til-thailand\",\"postDate\":1546523710,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"213\"],\"10\":\"<p>Midt i gata i Bangkok har hun nettopp fort\\u00e6rt den beste sj\\u00f8maten hun har v\\u00e6rt borti. Det er sterkt, salt, syrlig - Det renner i nese og \\u00f8yer, det brenner p\\u00e5 leppene.<\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>I det \\u00e5pne kj\\u00f8kkenet som vender ut mot gaten lukter det av grill og frityr - Det freser og koker, P\\u00e5 Jay Fai blir all maten laget over trekull, det wokkes p\\u00e5 r\\u00f8dgl\\u00f8dende trekull, og kokken selv st\\u00e5r med skibriller mens hun friterer en av hennes mest ikoniske retter - En Gigantisk krabbeomelett. Den lille damen bak de store smakene jobber utrettelig over den boblende woken.&nbsp;<\\/p>\\r\\n<p>Rett bortenfor st\\u00e5r en annen kokk, med en fj\\u00f8l p\\u00e5 magen og fire b\\u00f8tter rundt seg - En rekke mennesker har stilt seg opp i k\\u00f8 og ser p\\u00e5 kokken som jobber raskt og uten stans - &nbsp;Hun fyller et gr\\u00f8nt blad med reker, chilli, kokos, ingef\\u00e6r og lime f\\u00f8r hun bretter bladet og rekker det til Jossa. - &nbsp;Ventetiden bel\\u00f8nnes med en smaksbombe - Hun tar en til med det samme. Miang Kum, sier de n\\u00e5r hun sp\\u00f8r hva hun akkurat har spist.&nbsp;\\r\\nMiang Kum - Det skal jeg servere hjemme.&nbsp;<\\/p>\\r\\n<p>Vi ses p\\u00e5 Jossa 4.januar - 13.januar&nbsp;<\\/p>\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2019-01-03 13:55:10', '2019-01-03 13:55:10', '570990a9-bc4e-46a1-82a0-dfe3f904c886'),
 ('444', '332', '3', '66', 'no', '2', '', '{\"typeId\":\"3\",\"authorId\":\"66\",\"title\":\"Jossa drar til Thailand\",\"slug\":\"jossa-drar-til-thailand\",\"postDate\":1546523700,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"334\"],\"10\":\"<p>Midt i gata i Bangkok har hun nettopp fort\\u00e6rt den beste sj\\u00f8maten hun har v\\u00e6rt borti. Det er sterkt, salt og syrlig&nbsp;syrlig - Det renner i nese og \\u00f8yer, det brenner p\\u00e5 leppene.<\\/p>\",\"3\":{\"333\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>I det \\u00e5pne kj\\u00f8kkenet som vender ut mot gaten lukter det av grill og frityr - Det freser og koker, P\\u00e5 Jay Fai blir all maten laget over trekull, det wokkes p\\u00e5 r\\u00f8dgl\\u00f8dende trekull, og kokken selv st\\u00e5r med skibriller mens hun friterer en av hennes mest ikoniske retter - En Gigantisk krabbeomelett. Den lille damen bak de store smakene jobber utrettelig over den boblende woken.&nbsp;<\\/p>\\r\\n<p>Rett bortenfor st\\u00e5r en annen kokk, med en fj\\u00f8l p\\u00e5 magen og fire b\\u00f8tter rundt seg - En rekke mennesker har stilt seg opp i k\\u00f8 og ser p\\u00e5 kokken som jobber raskt og uten stans - &nbsp;Hun fyller et gr\\u00f8nt blad med reker, chilli, kokos, ingef\\u00e6r og lime f\\u00f8r hun bretter bladet og rekker det til Jossa. - &nbsp;Ventetiden bel\\u00f8nnes med en smaksbombe - Hun tar en til med det samme. Miang Kum, sier de n\\u00e5r hun sp\\u00f8r hva hun akkurat har spist.&nbsp;\\r\\nMiang Kum - Det skal jeg servere hjemme.&nbsp;<\\/p>\\r\\n<p>Vi ses p\\u00e5 Jossa 4.januar - 13.januar&nbsp;<\\/p>\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Jossa drar til Thailand\",\"seoDescriptionSource\