 ('453', '349', '3', '66', 'no', '1', '', '{\"typeId\":null,\"authorId\":\"66\",\"title\":\"Jossa drar til Kina\",\"slug\":\"jossa-drar-til-kina\",\"postDate\":1549211096,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"347\"],\"10\":\"<p>Tirsdag 5. februar starter grisens \\u00e5r! Kineserne feirer v\\u00e5rfestival og nytt\\u00e5r i to uker til ende. Jossa feirer ogs\\u00e5 med mat hun har tenkt p\\u00e5 siden den gangen hun var i Hong Kong...<\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Lange frokoster i store rom fulle av tedrikkende mennesker som plukket sm\\u00e5 retter fra traller som kom i endel\\u00f8se rekker. S\\u00f8te, salte, sure og bitre biter pakket inn i dampet, stekt eller fritert deig.&nbsp;<\\/p>\\r\\n<p>Siden vi i tr\\u00f8ndelag ikke er s\\u00e5 sterke p\\u00e5 frokost og lunsj utenfor faste rammer har hun bestemt seg for \\u00e5 gj\\u00f8re det til et like fint middagsrituale. P\\u00e5 jossa blir det kinesisk matfest i fem dager til ende, og festen starter p\\u00e5 Kinesisk nytt\\u00e5r, 5. februar. Allerede 6. februar er det en viktig dag i v\\u00e5rfestivalen - Det er dagen da du tar med svigermor p\\u00e5 middag.<\\/p>\\r\\n<p>Vi sees p\\u00e5 Jossa 5.februar - 10.februar!<\\/p>\",\"settingAlignCenter\":\"\"}},\"new1\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":\"\",\"settingImageWidth\":\"100\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2019-02-03 16:24:56', '2019-02-03 16:24:56', '16101672-655a-47b5-939b-f2e3291a26a8'),
