 ('465', '69', '4', '66', 'no', '22', '', '{\"typeId\":\"4\",\"authorId\":\"66\",\"title\":\"Meny\",\"slug\":\"meny\",\"postDate\":1506234240,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"117\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Meny\",\"standardImages\":[\"96\"],\"standardBodyText\":\"<p>Credo meny - 1500,-&nbsp;<br><\\/p>\\r\\n<p>Vinpakke - 1300,-<\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"294\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"160\"],\"standardBodyText\":\"<p>P\\u00e5 Credo \\u00f8nsker vi \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg det beste fra g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i, og til stedet vi er p\\u00e5.<\\/p>\\r\\n<p>Menyen er satt og best\\u00e5r av mellom 20-25 serveringer. Den endres hver eneste dag, da den&nbsp;er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert fra v\\u00e5re leverand\\u00f8rer.<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"295\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"293\"],\"standardBodyText\":\"<p>Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Drikkemenyen best\\u00e5r av b\\u00e5de \\u00f8l, cider og et utvalg av viner, og ogs\\u00e5 denne endres daglig. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"Creativ