 ('469', '9', '4', '66', 'no', '31', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Jossa \",\"slug\":\"jossa\",\"postDate\":1505469240,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":{\"177\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Jossa\",\"standardImages\":[\"146\"],\"standardBodyText\":\"<p>Jossa er et rustikt alternativ til Credo, og endrer meny ut ifra hvor Jossa reiser.<\\/p>\",\"settingTextWhiteBox\":\"\"}},\"304\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"300\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"231\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"214\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}},\"232\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"211\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"142\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"141\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"203\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"189\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}},\"204\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"201\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"205\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"198\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}},\"206\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"192\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}},\"207\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"195\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Jossa\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Jossa\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2019-08-02 09:16:19', '2019-08-02 09:16:19', '64570d9b-cad2-407d-81ad-d6b15eeba625'),
 ('470', '171', '3', '66', 'no', '7', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Heidi Bjerkan\",\"slug\":\"heidi\",\"postDate\":1515583680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"174\"],\"10\":\"<p>Heidi Bjerkan er en norsk kokk og kj\\u00f8kkensjef. I dag driver hun mat-triangelen Credo Restaurant, Jossa mat og drikke og Finnes Kaf\\u00e9 p\\u00e5 Lilleby, Trondheim.<\\/p>\",\"3\":{\"172\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi vokste opp i Trondheim og i b\\u00e5ten til bestefaren p\\u00e5 Garten langs Tr\\u00f8ndelagskysten. Her knyttet hun sterke b\\u00e5nd til jord og vann, som siden er \\u00e5 se i hennes matlaging.<\\/p>\\r\\n<p>Bjerkan sin karriere innenfor kokkeyrket startet allerede som&nbsp;atten\\u00e5ring da hun begynte sin sommerjobb&nbsp;p\\u00e5 \\u00d8stbanekafeen. Der forstod hun raskt&nbsp;at hun&nbsp;ville jobbe med mat. Det h\\u00f8ye tempoet et kj\\u00f8kken inneb\\u00e6rer var til stor begeistring for Bjerkan, som er rastl\\u00f8s av natur.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"287\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"127\"],\"standardBodyText\":\"<p>Bjerkan er omtalt som en h\\u00f8yt respektert kokk med en kompromissl\\u00f8s, engasjert og grundig visjon om fruktbart land, r\\u00e5varenes ubenyttede ressurser og framtidens bonde.&nbsp;<\\/p>\\r\\n<p>Bjerkan har alltid v\\u00e6rt opptatt av \\u00e5 jobbe b\\u00e6rekraftig, noe som gjenspeiler seg i kvaliteten Credo st\\u00e5r for. Med sterk interesse og dedikert ansvar, har Bjerkan i senere tid rekonstruert og utvidet hvordan drive restaurant med et ideal om at n\\u00e6ringen kan livsgi lokale b\\u00f8nder i et voksende kommersialisert landbruk. De tette samarbeidene med g\\u00e5rdene Skj\\u00f8lberg S\\u00f8ndre og Fannremsg\\u00e5rden er eksempler p\\u00e5 hvordan Credo \\u00f8nsker \\u00e5 bringe fram de lokale b\\u00f8ndenes h\\u00e5ndarbeid.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"288\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"],\"standardBodyText\":\"<p>For Heidi er det b\\u00f8ndene som er heltene, og det er produsentene som skal skinne. Gjennom m\\u00e5ltidet p\\u00e5 Credo tar hun med gjesten&nbsp;p\\u00e5 hennes tur gjennom g\\u00e5rdene, sj\\u00f8en og skogen der r\\u00e5varene kommer fra.<\\/p>\\r\\n<p>Heidi Bjerkan ble i 2015 k\\u00e5ret til \\u00c5rets Kj\\u00f8kkensjef,&nbsp;fikk i 2017 b\\u00e5de Ingridprisen og&nbsp;Matprisen for sitt engasjement for bedre mat og et bedre landbruk, og ble i 2019 k\\u00e5ret til Kokkenes Kokk.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Heidi\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Heidi Bjerkan er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"174\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2019-08-14 15:55:43', '2019-08-14 15:55:43', 'a458da16-5695-45f0-8c31-50f3084bbe68'),
 ('471', '171', '3', '66', 'en', '5', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Heidi Bjerkan\",\"slug\":\"heidi\",\"postDate\":1515583680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"174\"],\"10\":\"<p>Heidi Bjerkan is a Norwegian chef, our chef de cuisine and owner of Credo. Now she is running the food-triangle Credo Restaurant, Jossa mat og drikke and Finnes Kaf\\u00e9 at Lilleby, Trondheim.<\\/p>\",\"3\":{\"172\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi grew up in Trondheim and on her grandfather\\u2019s boat in Garten along the Tr\\u00f8ndelag coast.&nbsp;Here she developed strong connections to the land and sea, which to this day may be seen in her&nbsp;cooking.&nbsp;<\\/p>\\r\\n<p>Bjerkan\'s career within the food industry started already when she was eighteen years old during a summer job at the caf\\u00e9 at \\u00d8stbanehallen. She soon realized that she wanted to work as a chef, as the high tempo within a kitchen fed Bjerkan\'s&nbsp;natural habit of being restless.<br><\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}},\"287\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"127\"],\"standardBodyText\":\"<p>Heidi is passionate about raising awareness of our food systems, improving land use practices and preserving the traditional food cultures of the region.&nbsp;<\\/p>\\r\\n<p>For Heidi, the farmers are the heroes of this story, and it is their work that should shine&nbsp;above all others. During a meal at Credo, Heidi takes all of her guests on a personal tour through the&nbsp;gardens, waterways and forests where our raw ingredients grow.<\\/p>\",\"settingImagePosition\":\"right\",\"settingAlignCenter\":\"\"}},\"288\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"],\"standardBodyText\":\"<p>Heidi was in 2015 voted as the Head Chef of the year, awarded the&nbsp;distinguished Matprisen (Food Prize) and Ingridprisen&nbsp;for her engagement in promoting better food and sustainable&nbsp;land use practices in 2017, and in 2019 she was awarded as the Chef\'s Chef in Norway.<br><\\/p>\",\"settingImagePosition\":\"left\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Heidi\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Heidi Bjerkan er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"174\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2019-08-14 15:57:39', '2019-08-14 15:57:39', '7497fce8-f5ee-4d41-9956-b63f158de9cd'),
