 ('498', '366', '3', '66', 'no', '1', '', '{\"typeId\":null,\"authorId\":\"66\",\"title\":\"Julelunsj buffet p\\u00e5 Jossa \",\"slug\":\"julelunsj-buffet-pa-jossa\",\"postDate\":1573148727,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"365\"],\"10\":\"<p>Vi har gleden av \\u00e5 lansere \\u00e5rets julelunsj buffet p\\u00e5 Jossa Mat & Drikke. Trykk deg videre for \\u00e5 se menyen som vil v\\u00e6re gjeldende fra&nbsp;tirsdag 12. november til&nbsp;l\\u00f8rdag 21. desember.&nbsp;<\\/p>\\r\\n<p><\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"introBoxes\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"365\"],\"standardHeading\":\"Julelunsj buffet p\\u00e5 Jossa \",\"standardBodyText\":\"<p>Vi har gleden av \\u00e5 lansere \\u00e5rets julelunsj buffet p\\u00e5 Jossa Mat & Drikke.&nbsp;<\\/p>\\r\\n<p>Menyen nedenfor vil v\\u00e6re gjeldende fra&nbsp;tirsdag 12. november til&nbsp;l\\u00f8rdag 21. desember.&nbsp;&nbsp;<\\/p>\\r\\n<p><br><\\/p>\\r\\n<p>- R\\u00f8kt sild med r\\u00f8mme, r\\u00f8dl\\u00f8k og revet t\\u00f8rket eggeplomme&nbsp;<\\/p>\\r\\n<p>- Lettr\\u00f8kt R\\u00f8ye fra S\\u00e6terstad g\\u00e5rd med ferskost fra Grindalen&nbsp;<\\/p>\\r\\n<p>- Smilende h\\u00f8nseegg fra Aksel og Lise Hovde med&nbsp;h\\u00e5ndpillede reker fra Lyngen,\\r\\nestragonmajones og fennikel&nbsp;<\\/p>\\r\\n<p>- Kyllingsalat av Hovelsrudkylling med sennep, epler, selleri og spr\\u00f8tt kyllingskinn&nbsp;<\\/p>\\r\\n<p>- R\\u00f8rt tartar av melkeku med l\\u00f8pestikkemajones med syltede sopp og agurk&nbsp;<\\/p>\\r\\n<p>- Leverpostei av soppgris med sopp, bacon, syltede r\\u00f8dbeter&nbsp;<\\/p>\\r\\n<p>- Frikadeller av gris fra Tr\\u00f8ndersopp med r\\u00f8dk\\u00e5l kokt i solb\\u00e6r og honning&nbsp;<\\/p>\\r\\n<p>- Serveres med Credo br\\u00f8d, rugbr\\u00f8d og Fannremssm\\u00f8r<\\/p>\\r\\n<p><strong>kr. 350 pr. pers&nbsp;<\\/strong><\\/p>\\r\\n<p><strong><br><\\/strong><\\/p>\\r\\n<p>\\r\\n<strong>Tilvalg kr. 60<\\/strong><\\/p>\\r\\n<p>- Jossas riskrem med kirseb\\u00e6rsaus&nbsp;<\\/p>\\r\\n<p>- K\\u00e5lsalat med solb\\u00e6rvinaigrette, r\\u00f8dl\\u00f8g, koriander, ristede hasseln\\u00f8dder og urter&nbsp;<\\/p>\\r\\n<p>- R\\u00e5bl\\u00e5 med epler og n\\u00f8tter&nbsp;<\\/p>\\r\\n<p>- Munkeby med chutney&nbsp;<\\/p>\\r\\n<p>- Lammerull fra Skj\\u00f8lberg S\\u00f8ndre med syltet agurk og&nbsp;sennep &nbsp;<\\/p>\\r\\n<p><strong><br><\\/strong><\\/p>\\r\\n<p><strong>Book bord for fire eller flere:&nbsp;<a href=\\\"https:\\/\\/jossa.dinesuperb.com\\/reserve\\/guests\\\">https:\\/\\/jossa.dinesuperb.com\\/reserve\\/guests<\\/a><\\/strong><\\/p>\\r\\n<p><\\/p>\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2019-11-07 17:45:32', '2019-11-07 17:45:32', 'a36dfae3-b918-4b95-aa2f-3fab981e3a4a'),
