 ('190', 'field', '6', 'en', ''),
 ('190', 'field', '5', 'en', ' tobias har sagt farvel for kort tid siden han takket for selskapet ga henne en god klem og trykket en gave ned i sekken du ma ikke apne den pakken for du er fremme tobias sa pa jossa og smilte god tur og hils til werner jossa klatrer om bord i toget og finner kupeen sin nattoget til malmo en behagelig mate a reise pa og fra malmo er det ikke langt til kontinentet hun bryter av skalken pa brodet og legger seg pa den oppredde senga fottene er more etter all vandringen hun forsvinner inn i sovnen samtidig med togets startende bevegelser som et barn blir hun dysset i sovn for hun selv hadde tenkt det er morkt varmt og behagelig det spraker i en hoyttaler plinger i en bjelle og det bankes pa doren det foles som om det er samtidig men hun tar det pa oppvakingsfasen at hun har duppet av mellom lydene bare fortrengt det litt malmo den kom raskere enn hun trodde hele byen ligger der foran henne flat som den er hun har borstet av seg smulene fra brodskalken skiftet tatt en kattevask og provd a legge haret stramt slik det sommer seg for hun gikk av toget baten venter baten til kontinentet star i havna noen hundre meter bortenfor stasjonen fra kobenhavn ble det tog til wien med bytte i muenchen jossa var utmattet men merket seg at kobenhavn var en by hun skulle utforske men da pa vei hjem brosteinen og kumlokkene de er fine jossa ser ned mens hun tusler ut av stasjonsbygget i wien men jeg er sulten sier hun hoyt til seg selv sa den dosige mannen som sto rett ved siden av i sin egen verden skvetter til og ser pa henne unnskyld sier han ah nei det var ikke meningen men jeg er bare litt sulten eller hvis jeg skal si det som sant er jeg er skrubbsulten hun hadde helt glemt a spise helt glemt at hun var sulten nar hun lop fra bat til tog i kobenhavn og i muenchen ble det akkurat tid nok til en polse med sauerkraut haha mannen smiler til det glimter i gull bakerst i munnen du har kommet til rett sted kom bli med meg unnskyld jeg glemte meg helt bort hvor er mine manerer uff werner heter jeg froken han strekker ut en hand jossa griper den og kjenner det faste handtrykket jossa sier hun og smiler de naermest smaloper innover byen jossa klarer ikke fa med seg noe hun tenker bare pa mat hva skal du her i wien jeg skal spise jeg vil smake det som er osterisk det er det som er reisen min skjonner du jeg vil finne ut av hva ting smaker pa forskjellige steder werner stopper litt mens han tenker sa du vil smake det som er mest wiensk ok men da tar vi til hoyre her du skal fa spaetzle og det er best pa et bitte lite sted rett her borte de smaloper videre litt uten grunn men drevet av sult og nysgjerrighet spaetzle en slags urpasta eller gnocchi eller en blanding av de begge nar werner forteller om smaken den smeltede osten og ikke minst vinen som skal drikkes til gar det nesten rundt for jossa endelig skal hun fa mat werner dumper ned i stolen ved siden av henne sann vin og mat pa vei du er skikkelig sulten jossa klarer knapt a ytre ja hun venter bare pa noe a spise jeg bestillte litt forskjellig sa du skal fa et raskt overblikk det blir kanskje litt mye men det kommer noen andre venner av meg ogsa som kan mer om vin sa da spiser han det vi ikke klarer ok werner har tatt kommandoen og ser ut til a kose seg i rollen som vertskap grillet kalvetunge med syltede gronnsaker spaetzle med sopp og ost gresskarsuppe med krepse dumplings polse med sauerkraut snitzel med potetsalat og sitron roye med kal og til dessert far du schwartswaldkake med kirsebaer ogsa kan du ikke unnga strudelen da den ma du smake nar du er i wien jossa rister pa hodet og ler jeg klarer jo ikke alt sammen det er jo umulig '),
